}

private Multimap < Class < ? >, Subscriber > findAllSubscribers (Object listener) {
    Multimap < Class < ? >, Subscriber > methodsInListener = HashMultimap.create ();
    Class < ? > clazz = listener.getClass ();
    for (Method method : getAnnotatedMethods (clazz)) {
        Class < ? > [] parameterTypes = method.getParameterTypes ();
        Class < ? > eventType = parameterTypes [0];
        methodsInListener.put (eventType, Subscriber.create (bus, listener, method));
    }
    return methodsInListener;
}

private static ImmutableList < Method > getAnnotatedMethods (Class < ? > clazz) {
    return subscriberMethodsCache.getUnchecked (clazz);
}

private static ImmutableList < Method > getAnnotatedMethodsNotCached (Class < ? > clazz) {
    Set < ? extends Class < ? > > supertypes = TypeToken.of (clazz).getTypes ().rawTypes ();
    Map < MethodIdentifier, Method > identifiers = Maps.newHashMap ();
    for (Class < ? > supertype : supertypes) {
        for (Method method : supertype.getDeclaredMethods ()) {
            if (method.isAnnotationPresent (Subscribe.class) && ! method.isSynthetic ()) {
                Class < ? > [] parameterTypes = method.getParameterTypes ();
                checkArgument (parameterTypes.length == 1, "Method %s has @Subscribe annotation but has %s parameters." + "Subscriber methods must have exactly 1 parameter.", method, parameterTypes.length);
                MethodIdentifier ident = new MethodIdentifier (method);
                if (! identifiers.containsKey (ident)) {
                    identifiers.put (ident, method);
                }
            }
        }
    }
    return ImmutableList.copyOf (identifiers.values ());
}

public ImmutableSet < Class < ? > > load (Class < ? > concreteClass) {
    return ImmutableSet.< Class < ? > > copyOf (TypeToken.of (concreteClass).getTypes ().rawTypes ());
}

static ImmutableSet < Class < ? > > flattenHierarchy (Class < ? > concreteClass) {
    try {
        return flattenHierarchyCache.getUnchecked (concreteClass);
    } catch (UncheckedExecutionException e) {
        throw Throwables.propagate (e.getCause ());
    }
}

MethodIdentifier (Method method) {
    this.name = method.getName ();
    this.parameterTypes = Arrays.asList (method.getParameterTypes ());
}

public int hashCode () {
    return Objects.hashCode (name, parameterTypes);
}

public boolean equals (@Nullable
Object o) {
    if (o instanceof MethodIdentifier) {
        MethodIdentifier ident = (MethodIdentifier) o;
        return name.equals (ident.name) && parameterTypes.equals (ident.parameterTypes);
    }
    return false;
}

static Subscriber create (EventBus bus, Object listener, Method method) {
    return isDeclaredThreadSafe (method) ? new Subscriber (bus, listener, method) : new SynchronizedSubscriber (bus, listener, method);
}

private Subscriber (EventBus bus, Object target, Method method) {
    this.bus = bus;
    this.target = checkNotNull (target);
    this.method = method;
    method.setAccessible (true);
    this.executor = bus.executor ();
}

final void dispatchEvent (final Object event) {
    executor.execute (new Runnable () {
        @Override
        public void run () {
            try {
                invokeSubscriberMethod (event);
            } catch (InvocationTargetException e) {
                bus.handleSubscriberException (e.getCause (), context (event));
            }
        }}

    );
}

public void run () {
    try {
        invokeSubscriberMethod (event);
    } catch (InvocationTargetException e) {
        bus.handleSubscriberException (e.getCause (), context (event));
    }
}

void invokeSubscriberMethod (Object event) throws InvocationTargetException {
    try {
        method.invoke (target, checkNotNull (event));
    } catch (IllegalArgumentException e) {
        throw new Error ("Method rejected target/argument: " + event, e);
    } catch (IllegalAccessException e) {
        throw new Error ("Method became inaccessible: " + event, e);
    } catch (InvocationTargetException e) {
        if (e.getCause () instanceof Error) {
            throw (Error) e.getCause ();
        }
        throw e;
    }
}

private SubscriberExceptionContext context (Object event) {
    return new SubscriberExceptionContext (bus, event, target, method);
}

public final int hashCode () {
    return (31 + method.hashCode ()) * 31 + System.identityHashCode (target);
}

public final boolean equals (@Nullable
Object obj) {
    if (obj instanceof Subscriber) {
        Subscriber that = (Subscriber) obj;
        return target == that.target && method.equals (that.method);
    }
    return false;
}

private static boolean isDeclaredThreadSafe (Method method) {
    return method.getAnnotation (AllowConcurrentEvents.class) != null;
}

private SynchronizedSubscriber (EventBus bus, Object target, Method method) {
    super (bus, target, method);
}

void invokeSubscriberMethod (Object event) throws InvocationTargetException {
    synchronized (this) {
        super.invokeSubscriberMethod (event);
    }
}

