public void execute (Runnable task) {
    synchronized (internalLock) {
        queue.add (task);
    }
    startQueueWorker ();
}

public void executeFirst (Runnable task) {
    synchronized (internalLock) {
        queue.addFirst (task);
    }
    startQueueWorker ();
}

public void suspend () {
    synchronized (internalLock) {
        suspensions ++;
    }
}

public void resume () {
    synchronized (internalLock) {
        Preconditions.checkState (suspensions > 0);
        suspensions --;
    }
    startQueueWorker ();
}

private void startQueueWorker () {
    synchronized (internalLock) {
        if (queue.peek () == null) {
            return;
        }
        if (suspensions > 0) {
            return;
        }
        if (isWorkerRunning) {
            return;
        }
        isWorkerRunning = true;
    }
    boolean executionRejected = true;
    try {
        executor.execute (new QueueWorker ());
        executionRejected = false;
    } finally {
        if (executionRejected) {
            synchronized (internalLock) {
                isWorkerRunning = false;
            }
        }
    }
}

public void run () {
    try {
        workOnQueue ();
    } catch (Error e) {
        synchronized (internalLock) {
            isWorkerRunning = false;
        }
        throw e;
    }
}

private void workOnQueue () {
    while (true) {
        Runnable task = null;
        synchronized (internalLock) {
            if (suspensions == 0) {
                task = queue.poll ();
            }
            if (task == null) {
                isWorkerRunning = false;
                return;
            }
        }
        try {
            task.run ();
        } catch (RuntimeException e) {
            log.log (Level.SEVERE, "Exception while executing runnable " + task, e);
        }
    }
}

protected final void doStart () {
    Executor executor = MoreExecutors.renamingDecorator (executor (), new Supplier < String > () {
        @Override
        public String get () {
            return serviceName ();
        }}

    );
    executor.execute (new Runnable () {
        @Override
        public void run () {
            try {
                startUp ();
                notifyStarted ();
                if (isRunning ()) {
                    try {
                        AbstractExecutionThreadService.this.run ();
                    } catch (Throwable t) {
                        try {
                            shutDown ();
                        } catch (Exception ignored) {
                            logger.log (Level.WARNING, "Error while attempting to shut down the service after failure.", ignored);
                        }
                        notifyFailed (t);
                        return;
                    }
                }
                shutDown ();
                notifyStopped ();
            } catch (Throwable t) {
                notifyFailed (t);
            }
        }}

    );
}

