        wrapped.call ();
    } catch (Exception e) {
        throwIfUnchecked (e);
        throw new RuntimeException (e);
    }
}

private final < T > ImmutableList < Callable < T > > wrapTasks (Collection < ? extends Callable < T > > tasks) {
    ImmutableList.Builder < Callable < T > > builder = ImmutableList.builder ();
