SetFuture (AbstractFuture < V > owner, ListenableFuture < ? extends V > future) {
    this.owner = owner;
    this.future = future;
}

public void run () {
    if (owner.value != this) {
        return;
    }
    Object valueToSet = getFutureValue (future);
    if (ATOMIC_HELPER.casValue (owner, this, valueToSet)) {
        complete (owner);
    }
}

public V get (long timeout, TimeUnit unit) throws InterruptedException, TimeoutException, ExecutionException {
    long remainingNanos = unit.toNanos (timeout);
    if (Thread.interrupted ()) {
        throw new InterruptedException ();
    }
    Object localValue = value;
    if (localValue != null & ! (localValue instanceof AbstractFuture.SetFuture)) {
        return getDoneValue (localValue);
    }
    final long endNanos = remainingNanos > 0 ? System.nanoTime () + remainingNanos : 0;
    long_wait_loop : if (remainingNanos >= SPIN_THRESHOLD_NANOS) {
        Waiter oldHead = waiters;
        if (oldHead != Waiter.TOMBSTONE) {
            Waiter node = new Waiter ();
            do {
                node.setNext (oldHead);
                if (ATOMIC_HELPER.casWaiters (this, oldHead, node)) {
                    while (true) {
                        LockSupport.parkNanos (this, remainingNanos);
                        if (Thread.interrupted ()) {
                            removeWaiter (node);
                            throw new InterruptedException ();
                        }
                        localValue = value;
                        if (localValue != null & ! (localValue instanceof AbstractFuture.SetFuture)) {
                            return getDoneValue (localValue);
                        }
                        remainingNanos = endNanos - System.nanoTime ();
                        if (remainingNanos < SPIN_THRESHOLD_NANOS) {
                            removeWaiter (node);
                            break long_wait_loop;
                        }
                    }
                }
                oldHead = waiters;
            } while (oldHead != Waiter.TOMBSTONE);
        }
        return getDoneValue (value);
    }
    while (remainingNanos > 0) {
        localValue = value;
        if (localValue != null & ! (localValue instanceof AbstractFuture.SetFuture)) {
            return getDoneValue (localValue);
        }
        if (Thread.interrupted ()) {
            throw new InterruptedException ();
        }
        remainingNanos = endNanos - System.nanoTime ();
    }
    throw new TimeoutException ();
}

public V get () throws InterruptedException, ExecutionException {
    if (Thread.interrupted ()) {
        throw new InterruptedException ();
    }
    Object localValue = value;
    if (localValue != null & ! (localValue instanceof AbstractFuture.SetFuture)) {
        return getDoneValue (localValue);
    }
    Waiter oldHead = waiters;
    if (oldHead != Waiter.TOMBSTONE) {
        Waiter node = new Waiter ();
        do {
            node.setNext (oldHead);
            if (ATOMIC_HELPER.casWaiters (this, oldHead, node)) {
                while (true) {
                    LockSupport.park (this);
                    if (Thread.interrupted ()) {
                        removeWaiter (node);
                        throw new InterruptedException ();
                    }
                    localValue = value;
                    if (localValue != null & ! (localValue instanceof AbstractFuture.SetFuture)) {
                        return getDoneValue (localValue);
                    }
                }
            }
            oldHead = waiters;
        } while (oldHead != Waiter.TOMBSTONE);
    }
    return getDoneValue (value);
}

private V getDoneValue (Object obj) throws ExecutionException {
    if (obj instanceof Cancellation) {
        throw cancellationExceptionWithCause ("Task was cancelled.", ((Cancellation) obj).cause);
    } else if (obj instanceof Failure) {
        throw new ExecutionException (((Failure) obj).exception);
    } else if (obj == NULL) {
        return null;
    } else {
        @SuppressWarnings("unchecked")
        V asV = (V) obj;
        return asV;
    }

}

public boolean isDone () {
    final Object localValue = value;
    return localValue != null & ! (localValue instanceof AbstractFuture.SetFuture);
}

public boolean isCancelled () {
    final Object localValue = value;
    return localValue instanceof Cancellation;
}

public boolean cancel (boolean mayInterruptIfRunning) {
    Object localValue = value;
    boolean rValue = false;
    if (localValue == null | localValue instanceof AbstractFuture.SetFuture) {
        Throwable cause = GENERATE_CANCELLATION_CAUSES ? new CancellationException ("Future.cancel() was called.") : null;
        Object valueToSet = new Cancellation (mayInterruptIfRunning, cause);
        AbstractFuture < ? > abstractFuture = this;
        while (true) {
            if (ATOMIC_HELPER.casValue (abstractFuture, localValue, valueToSet)) {
                rValue = true;
                if (mayInterruptIfRunning) {
                    abstractFuture.interruptTask ();
                }
                complete (abstractFuture);
                if (localValue instanceof AbstractFuture.SetFuture) {
                    ListenableFuture < ? > futureToPropagateTo = ((AbstractFuture.SetFuture) localValue).future;
                    if (futureToPropagateTo instanceof TrustedFuture) {
                        AbstractFuture < ? > trusted = (AbstractFuture < ? >) futureToPropagateTo;
                        localValue = trusted.value;
                        if (localValue == null | localValue instanceof AbstractFuture.SetFuture) {
                            abstractFuture = trusted;
                            continue;
                        }
                    } else {
                        futureToPropagateTo.cancel (mayInterruptIfRunning);
                    }
                }
                break;
            }
            localValue = abstractFuture.value;
            if (! (localValue instanceof AbstractFuture.SetFuture)) {
                break;
            }
        }
    }
    return rValue;
}

protected final boolean wasInterrupted () {
    final Object localValue = value;
    return (localValue instanceof Cancellation) && ((Cancellation) localValue).wasInterrupted;
}

public void addListener (Runnable listener, Executor executor) {
    checkNotNull (listener, "Runnable was null.");
    checkNotNull (executor, "Executor was null.");
    Listener oldHead = listeners;
    if (oldHead != Listener.TOMBSTONE) {
        Listener newNode = new Listener (listener, executor);
        do {
            newNode.next = oldHead;
            if (ATOMIC_HELPER.casListeners (this, oldHead, newNode)) {
                return;
            }
            oldHead = listeners;
        } while (oldHead != Listener.TOMBSTONE);
    }
    executeListener (listener, executor);
}

protected boolean set (@Nullable
V value) {
    Object valueToSet = value == null ? NULL : value;
    if (ATOMIC_HELPER.casValue (this, null, valueToSet)) {
        complete (this);
        return true;
    }
    return false;
}

protected boolean setException (Throwable throwable) {
    Object valueToSet = new Failure (checkNotNull (throwable));
    if (ATOMIC_HELPER.casValue (this, null, valueToSet)) {
        complete (this);
        return true;
    }
    return false;
}

protected boolean setFuture (ListenableFuture < ? extends V > future) {
    checkNotNull (future);
    Object localValue = value;
    if (localValue == null) {
        if (future.isDone ()) {
            Object value = getFutureValue (future);
            if (ATOMIC_HELPER.casValue (this, null, value)) {
                complete (this);
                return true;
            }
            return false;
        }
        SetFuture valueToSet = new SetFuture < V > (this, future);
        if (ATOMIC_HELPER.casValue (this, null, valueToSet)) {
            try {
                future.addListener (valueToSet, directExecutor ());
            } catch (Throwable t) {
                Failure failure;
                try {
                    failure = new Failure (t);
                } catch (Throwable oomMostLikely) {
                    failure = Failure.FALLBACK_INSTANCE;
                }
                boolean unused = ATOMIC_HELPER.casValue (this, valueToSet, failure);
            }
            return true;
        }
        localValue = value;
    }
    if (localValue instanceof Cancellation) {
        future.cancel (((Cancellation) localValue).wasInterrupted);
    }
    return false;
}

private static Object getFutureValue (ListenableFuture < ? > future) {
    Object valueToSet;
    if (future instanceof TrustedFuture) {
        return ((AbstractFuture < ? >) future).value;
    } else {
        try {
            Object v = getDone (future);
            valueToSet = v == null ? NULL : v;
        } catch (ExecutionException exception) {
            valueToSet = new Failure (exception.getCause ());
        } catch (CancellationException cancellation) {
            valueToSet = new Cancellation (false, cancellation);
        } catch (Throwable t) {
            valueToSet = new Failure (t);
        }
    }
    return valueToSet;
}

private static void complete (AbstractFuture < ? > future) {
    Listener next = null;
    outer : while (true) {
        future.releaseWaiters ();
        future.afterDone ();
        next = future.clearListeners (next);
        future = null;
        while (next != null) {
            Listener curr = next;
            next = next.next;
            Runnable task = curr.task;
            if (task instanceof AbstractFuture.SetFuture) {
                AbstractFuture.SetFuture < ? > setFuture = (AbstractFuture.SetFuture) task;
                future = setFuture.owner;
                if (future.value == setFuture) {
                    Object valueToSet = getFutureValue (setFuture.future);
                    if (ATOMIC_HELPER.casValue (future, setFuture, valueToSet)) {
                        continue outer;
                    }
                }
            } else {
                executeListener (task, curr.executor);
            }
        }
        break;
    }
}

final Throwable trustedGetException () {
    return ((Failure) value).exception;
}

final void maybePropagateCancellation (@Nullable
Future < ? > related) {
    if (related != null & isCancelled ()) {
        related.cancel (wasInterrupted ());
    }
}

private void releaseWaiters () {
    Waiter head;
    do {
        head = waiters;
    } while (! ATOMIC_HELPER.casWaiters (this, head, Waiter.TOMBSTONE));
    for (Waiter currentWaiter = head;
    currentWaiter != null; currentWaiter = currentWaiter.next) {
        currentWaiter.unpark ();
    }
}

private Listener clearListeners (Listener onto) {
    Listener head;
    do {
        head = listeners;
    } while (! ATOMIC_HELPER.casListeners (this, head, Listener.TOMBSTONE));
    Listener reversedList = onto;
    while (head != null) {
        Listener tmp = head;
        head = head.next;
        tmp.next = reversedList;
        reversedList = tmp;
    }
    return reversedList;
}

private static void executeListener (Runnable runnable, Executor executor) {
    try {
        executor.execute (runnable);
    } catch (RuntimeException e) {
        log.log (Level.SEVERE, "RuntimeException while executing runnable " + runnable + " with executor " + executor, e);
    }
}

public sun.misc.Unsafe run () throws Exception {
    Class < sun.misc.Unsafe > k = sun.misc.Unsafe.class;
    for (java.lang.reflect.Field f : k.getDeclaredFields ()) {
        f.setAccessible (true);
        Object x = f.get (null);
        if (k.isInstance (x)) {
            return k.cast (x);
        }
    }
    throw new NoSuchFieldError ("the Unsafe");
}

