boolean casWaiters (AbstractFuture < ? > future, Waiter expect, Waiter update) {
    synchronized (future) {
        if (future.waiters == expect) {
            future.waiters = update;
            return true;
        }
        return false;
    }
}

boolean casListeners (AbstractFuture < ? > future, Listener expect, Listener update) {
    synchronized (future) {
        if (future.listeners == expect) {
            future.listeners = update;
            return true;
        }
        return false;
    }
}

boolean casValue (AbstractFuture < ? > future, Object expect, Object update) {
    synchronized (future) {
        if (future.value == expect) {
            future.value = update;
            return true;
        }
        return false;
    }
}

private static CancellationException cancellationExceptionWithCause (@Nullable
String message,@Nullable
Throwable cause) {
    CancellationException exception = new CancellationException (message);
    exception.initCause (cause);
    return exception;
}

protected final void afterDone () {
    super.afterDone ();
    RunningState localRunningState = runningState;
    if (localRunningState != null) {
        this.runningState = null;
        ImmutableCollection < ? extends ListenableFuture < ? extends InputT > > futures = localRunningState.futures;
        boolean wasInterrupted = wasInterrupted ();
        if (wasInterrupted ()) {
            localRunningState.interruptTask ();
        }
        if (isCancelled () & futures != null) {
            for (ListenableFuture < ? > future : futures) {
                future.cancel (wasInterrupted);
            }
        }
    }
}

final void init (RunningState runningState) {
    this.runningState = runningState;
    runningState.init ();
}

RunningState (ImmutableCollection < ? extends ListenableFuture < ? extends InputT > > futures, boolean allMustSucceed, boolean collectsValues) {
    super (futures.size ());
    this.futures = checkNotNull (futures);
    this.allMustSucceed = allMustSucceed;
    this.collectsValues = collectsValues;
}

public final void run () {
    decrementCountAndMaybeComplete ();
}

private void init () {
    if (futures.isEmpty ()) {
        handleAllCompleted ();
        return;
    }
    if (allMustSucceed) {
        int i = 0;
        for (final ListenableFuture < ? extends InputT > listenable : futures) {
            final int index = i ++;
            listenable.addListener (new Runnable () {
                @Override
                public void run () {
                    try {
                        handleOneInputDone (index, listenable);
                    } finally {
                        decrementCountAndMaybeComplete ();
                    }
                }}

            , directExecutor ());
        }
    } else {
        for (ListenableFuture < ? extends InputT > listenable : futures) {
            listenable.addListener (this, directExecutor ());
        }
    }
}

public void run () {
    try {
        handleOneInputDone (index, listenable);
    } finally {
        decrementCountAndMaybeComplete ();
    }
}

private void handleException (Throwable throwable) {
    checkNotNull (throwable);
    boolean completedWithFailure = false;
    boolean firstTimeSeeingThisException = true;
    if (allMustSucceed) {
        completedWithFailure = setException (throwable);
        if (completedWithFailure) {
            releaseResourcesAfterFailure ();
        } else {
            firstTimeSeeingThisException = addCausalChain (getOrInitSeenExceptions (), throwable);
        }
    }
    if (throwable instanceof Error | (allMustSucceed & ! completedWithFailure & firstTimeSeeingThisException)) {
        String message = (throwable instanceof Error) ? "Input Future failed with Error" : "Got more than one input Future failure. Logging failures after the first";
        logger.log (Level.SEVERE, message, throwable);
    }
}

final void addInitialException (Set < Throwable > seen) {
    if (! isCancelled ()) {
        boolean unused = addCausalChain (seen, trustedGetException ());
    }
}

private void handleOneInputDone (int index, Future < ? extends InputT > future) {
    checkState (allMustSucceed || ! isDone () || isCancelled (), "Future was done before all dependencies completed");
    try {
        checkState (future.isDone (), "Tried to set value from future which is not done");
        if (allMustSucceed) {
            if (future.isCancelled ()) {
                runningState = null;
                cancel (false);
            } else {
                InputT result = getDone (future);
                if (collectsValues) {
                    collectOneValue (allMustSucceed, index, result);
                }
            }
        } else if (collectsValues && ! future.isCancelled ()) {
            collectOneValue (allMustSucceed, index, getDone (future));
        }

    } catch (ExecutionException e) {
        handleException (e.getCause ());
    } catch (Throwable t) {
        handleException (t);
    }
}

private void decrementCountAndMaybeComplete () {
    int newRemaining = decrementRemainingAndGet ();
    checkState (newRemaining >= 0, "Less than 0 remaining futures");
    if (newRemaining == 0) {
        processCompleted ();
    }
}

private void processCompleted () {
    if (collectsValues & ! allMustSucceed) {
        int i = 0;
        for (ListenableFuture < ? extends InputT > listenable : futures) {
            handleOneInputDone (i ++, listenable);
        }
    }
    handleAllCompleted ();
}

void releaseResourcesAfterFailure () {
    this.futures = null;
}

private static boolean addCausalChain (Set < Throwable > seen, Throwable t) {
    for (; t != null; t = t.getCause ()) {
        boolean firstTimeSeen = seen.add (t);
        if (! firstTimeSeen) {
            return false;
        }
    }
    return true;
}

static < V, X extends Exception > V getChecked (Future < V > future, Class < X > exceptionClass) throws X {
    return getChecked (bestGetCheckedTypeValidator (), future, exceptionClass);
}

static < V, X extends Exception > V getChecked (GetCheckedTypeValidator validator, Future < V > future, Class < X > exceptionClass) throws X {
    validator.validateClass (exceptionClass);
    try {
        return future.get ();
    } catch (InterruptedException e) {
        currentThread ().interrupt ();
        throw newWithCause (exceptionClass, e);
    } catch (ExecutionException e) {
        wrapAndThrowExceptionOrError (e.getCause (), exceptionClass);
        throw new AssertionError ();
    }
}

static < V, X extends Exception > V getChecked (Future < V > future, Class < X > exceptionClass, long timeout, TimeUnit unit) throws X {
    bestGetCheckedTypeValidator ().validateClass (exceptionClass);
    try {
        return future.get (timeout, unit);
    } catch (InterruptedException e) {
        currentThread ().interrupt ();
        throw newWithCause (exceptionClass, e);
    } catch (TimeoutException e) {
        throw newWithCause (exceptionClass, e);
    } catch (ExecutionException e) {
        wrapAndThrowExceptionOrError (e.getCause (), exceptionClass);
        throw new AssertionError ();
    }
}

private static GetCheckedTypeValidator bestGetCheckedTypeValidator () {
    return GetCheckedTypeValidatorHolder.BEST_VALIDATOR;
}

static GetCheckedTypeValidator weakSetValidator () {
    return GetCheckedTypeValidatorHolder.WeakSetValidator.INSTANCE;
}

static GetCheckedTypeValidator classValueValidator () {
    return GetCheckedTypeValidatorHolder.ClassValueValidator.INSTANCE;
}

protected Boolean computeValue (Class < ? > type) {
    checkExceptionClassValidity (type.asSubclass (Exception.class));
    return true;
}

public void validateClass (Class < ? extends Exception > exceptionClass) {
    isValidClass.get (exceptionClass);
}

public void validateClass (Class < ? extends Exception > exceptionClass) {
    for (WeakReference < Class < ? extends Exception > > knownGood : validClasses) {
        if (exceptionClass.equals (knownGood.get ())) {
            return;
        }
    }
    checkExceptionClassValidity (exceptionClass);
    if (validClasses.size () > 1000) {
        validClasses.clear ();
    }
    validClasses.add (new WeakReference < Class < ? extends Exception > > (exceptionClass));
}

static GetCheckedTypeValidator getBestValidator () {
    try {
        Class < ? > theClass = Class.forName (CLASS_VALUE_VALIDATOR_NAME);
        return (GetCheckedTypeValidator) theClass.getEnumConstants () [0];
    } catch (Throwable t) {
        return weakSetValidator ();
    }
}

private static < X extends Exception > void wrapAndThrowExceptionOrError (Throwable cause, Class < X > exceptionClass) throws X {
    if (cause instanceof Error) {
        throw new ExecutionError ((Error) cause);
    }
    if (cause instanceof RuntimeException) {
        throw new UncheckedExecutionException (cause);
    }
    throw newWithCause (exceptionClass, cause);
}

private static boolean hasConstructorUsableByGetChecked (Class < ? extends Exception > exceptionClass) {
    try {
        Exception unused = newWithCause (exceptionClass, new Exception ());
        return true;
    } catch (Exception e) {
        return false;
    }
}

private static < X extends Exception > X newWithCause (Class < X > exceptionClass, Throwable cause) {
    @SuppressWarnings ({"unchecked", "rawtypes"})
    List < Constructor < X > > constructors = (List) Arrays.asList (exceptionClass.getConstructors ());
    for (Constructor < X > constructor : preferringStrings (constructors)) {
        @Nullable
        X instance = newFromConstructor (constructor, cause);
        if (instance != null) {
            if (instance.getCause () == null) {
                instance.initCause (cause);
            }
            return instance;
        }
    }
    throw new IllegalArgumentException ("No appropriate constructor for exception of type " + exceptionClass + " in response to chained exception", cause);
}

private static < X extends Exception > List < Constructor < X > > preferringStrings (List < Constructor < X > > constructors) {
    return WITH_STRING_PARAM_FIRST.sortedCopy (constructors);
}

public Boolean apply (Constructor < ? > input) {
    return asList (input.getParameterTypes ()).contains (String.class);
}

private static < X > X newFromConstructor (Constructor < X > constructor, Throwable cause) {
    Class < ? > [] paramTypes = constructor.getParameterTypes ();
    Object [] params = new Object [paramTypes.length];
    for (int i = 0;
    i < paramTypes.length; i ++) {
        Class < ? > paramType = paramTypes [i];
        if (paramType.equals (String.class)) {
            params [i] = cause.toString ();
        } else if (paramType.equals (Throwable.class)) {
            params [i] = cause;
        } else {
            return null;
        }

    }
    try {
        return constructor.newInstance (params);
    } catch (IllegalArgumentException e) {
        return null;
    } catch (InstantiationException e) {
        return null;
    } catch (IllegalAccessException e) {
        return null;
    } catch (InvocationTargetException e) {
        return null;
    }
}

static boolean isCheckedException (Class < ? extends Exception > type) {
    return ! RuntimeException.class.isAssignableFrom (type);
}

static void checkExceptionClassValidity (Class < ? extends Exception > exceptionClass) {
    checkArgument (isCheckedException (exceptionClass), "Futures.getChecked exception type (%s) must not be a RuntimeException", exceptionClass);
    checkArgument (hasConstructorUsableByGetChecked (exceptionClass), "Futures.getChecked exception type (%s) must be an accessible class with an accessible " + "constructor whose parameters (if any) must be of type String and/or Throwable", exceptionClass);
}

