CollectionFutureRunningState (ImmutableCollection < ? extends ListenableFuture < ? extends V > > futures, boolean allMustSucceed) {
    super (futures, allMustSucceed, true);
    this.values = futures.isEmpty () ? ImmutableList.< Optional < V > > of () : Lists.< Optional < V > > newArrayListWithCapacity (futures.size ());
    for (int i = 0;
    i < futures.size (); ++ i) {
        values.add (null);
    }
}

final void collectOneValue (boolean allMustSucceed, int index,@Nullable
V returnValue) {
    List < Optional < V > > localValues = values;
    if (localValues != null) {
        localValues.set (index, Optional.fromNullable (returnValue));
    } else {
        checkState (allMustSucceed || isCancelled (), "Future was done before all dependencies completed");
    }
}

final void handleAllCompleted () {
    List < Optional < V > > localValues = values;
    if (localValues != null) {
        set (combine (localValues));
    } else {
        checkState (isDone ());
    }
}

