static < T > T invokeAnyImpl (ListeningExecutorService executorService, Collection < ? extends Callable < T > > tasks, boolean timed, long timeout, TimeUnit unit) throws InterruptedException, ExecutionException, TimeoutException {
    checkNotNull (executorService);
    checkNotNull (unit);
    int ntasks = tasks.size ();
    checkArgument (ntasks > 0);
    List < Future < T > > futures = Lists.newArrayListWithCapacity (ntasks);
    BlockingQueue < Future < T > > futureQueue = Queues.newLinkedBlockingQueue ();
    long timeoutNanos = unit.toNanos (timeout);
    try {
        ExecutionException ee = null;
        long lastTime = timed ? System.nanoTime () : 0;
        Iterator < ? extends Callable < T > > it = tasks.iterator ();
        futures.add (submitAndAddQueueListener (executorService, it.next (), futureQueue));
        -- ntasks;
        int active = 1;
        while (true) {
            Future < T > f = futureQueue.poll ();
            if (f == null) {
                if (ntasks > 0) {
                    -- ntasks;
                    futures.add (submitAndAddQueueListener (executorService, it.next (), futureQueue));
                    ++ active;
                } else if (active == 0) {
                    break;
                } else if (timed) {
                    f = futureQueue.poll (timeoutNanos, TimeUnit.NANOSECONDS);
                    if (f == null) {
                        throw new TimeoutException ();
                    }
                    long now = System.nanoTime ();
                    timeoutNanos -= now - lastTime;
                    lastTime = now;
                } else {
                    f = futureQueue.take ();
                }

            }
            if (f != null) {
                -- active;
                try {
                    return f.get ();
                } catch (ExecutionException eex) {
                    ee = eex;
                } catch (RuntimeException rex) {
                    ee = new ExecutionException (rex);
                }
            }
        }
        if (ee == null) {
            ee = new ExecutionException (null);
        }
        throw ee;
    } finally {
        for (Future < T > f : futures) {
            f.cancel (true);
        }
    }
}

private static < T > ListenableFuture < T > submitAndAddQueueListener (ListeningExecutorService executorService, Callable < T > task, final BlockingQueue < Future < T > > queue) {
    final ListenableFuture < T > future = executorService.submit (task);
    future.addListener (new Runnable () {
        @Override
        public void run () {
            queue.add (future);
        }}

    , directExecutor ());
    return future;
}

public void run () {
    queue.add (future);
}

public static ThreadFactory platformThreadFactory () {
    if (! isAppEngine ()) {
        return Executors.defaultThreadFactory ();
    }
    try {
        return (ThreadFactory) Class.forName ("com.google.appengine.api.ThreadManager").getMethod ("currentRequestThreadFactory").invoke (null);
    } catch (IllegalAccessException e) {
        throw new RuntimeException ("Couldn't invoke ThreadManager.currentRequestThreadFactory", e);
    } catch (ClassNotFoundException e) {
        throw new RuntimeException ("Couldn't invoke ThreadManager.currentRequestThreadFactory", e);
    } catch (NoSuchMethodException e) {
        throw new RuntimeException ("Couldn't invoke ThreadManager.currentRequestThreadFactory", e);
    } catch (InvocationTargetException e) {
        throw Throwables.propagate (e.getCause ());
    }
}

private static boolean isAppEngine () {
    if (System.getProperty ("com.google.appengine.runtime.environment") == null) {
        return false;
    }
    try {
        return Class.forName ("com.google.apphosting.api.ApiProxy").getMethod ("getCurrentEnvironment").invoke (null) != null;
    } catch (ClassNotFoundException e) {
        return false;
    } catch (InvocationTargetException e) {
        return false;
    } catch (IllegalAccessException e) {
        return false;
    } catch (NoSuchMethodException e) {
        return false;
    }
}

