public static boolean tryAcquireUninterruptibly (Semaphore semaphore, int permits, long timeout, TimeUnit unit) {
    boolean interrupted = false;
    try {
        long remainingNanos = unit.toNanos (timeout);
        long end = System.nanoTime () + remainingNanos;
        while (true) {
            try {
                return semaphore.tryAcquire (permits, remainingNanos, NANOSECONDS);
            } catch (InterruptedException e) {
                interrupted = true;
                remainingNanos = end - System.nanoTime ();
            }
        }
    } finally {
        if (interrupted) {
            Thread.currentThread ().interrupt ();
        }
    }
}

public final void run () {
    if (! ATOMIC_HELPER.compareAndSetRunner (this, null, Thread.currentThread ())) {
        return;
    }
    try {
        runInterruptibly ();
    } finally {
        if (wasInterrupted ()) {
            while (! doneInterrupting) {
                Thread.yield ();
            }
        }
    }
}

final void interruptTask () {
    Thread currentRunner = runner;
    if (currentRunner != null) {
        currentRunner.interrupt ();
    }
    doneInterrupting = true;
}

SafeAtomicHelper (AtomicReferenceFieldUpdater runnerUpdater) {
    this.runnerUpdater = runnerUpdater;
}

boolean compareAndSetRunner (InterruptibleTask task, Thread expect, Thread update) {
    return runnerUpdater.compareAndSet (task, expect, update);
}

boolean compareAndSetRunner (InterruptibleTask task, Thread expect, Thread update) {
    synchronized (task) {
        if (task.runner == expect) {
            task.runner = update;
        }
    }
    return true;
}

SmoothWarmingUp (SleepingStopwatch stopwatch, long warmupPeriod, TimeUnit timeUnit, double coldFactor) {
    super (stopwatch);
    this.warmupPeriodMicros = timeUnit.toMicros (warmupPeriod);
    this.coldFactor = coldFactor;
}

void doSetRate (double permitsPerSecond, double stableIntervalMicros) {
    double oldMaxPermits = maxPermits;
    double coldIntervalMicros = stableIntervalMicros * coldFactor;
    thresholdPermits = 0.5 * warmupPeriodMicros / stableIntervalMicros;
    maxPermits = thresholdPermits + 2.0 * warmupPeriodMicros / (stableIntervalMicros + coldIntervalMicros);
    slope = (coldIntervalMicros - stableIntervalMicros) / (maxPermits - thresholdPermits);
    if (oldMaxPermits == Double.POSITIVE_INFINITY) {
        storedPermits = 0.0;
    } else {
        storedPermits = (oldMaxPermits == 0.0) ? maxPermits : storedPermits * maxPermits / oldMaxPermits;
    }
}

long storedPermitsToWaitTime (double storedPermits, double permitsToTake) {
    double availablePermitsAboveThreshold = storedPermits - thresholdPermits;
    long micros = 0;
    if (availablePermitsAboveThreshold > 0.0) {
        double permitsAboveThresholdToTake = min (availablePermitsAboveThreshold, permitsToTake);
        double length = permitsToTime (availablePermitsAboveThreshold) + permitsToTime (availablePermitsAboveThreshold - permitsAboveThresholdToTake);
        micros = (long) (permitsAboveThresholdToTake * length / 2.0);
        permitsToTake -= permitsAboveThresholdToTake;
    }
    micros += (stableIntervalMicros * permitsToTake);
    return micros;
}

private double permitsToTime (double permits) {
    return stableIntervalMicros + permits * slope;
}

double coolDownIntervalMicros () {
    return warmupPeriodMicros / maxPermits;
}

SmoothBursty (SleepingStopwatch stopwatch, double maxBurstSeconds) {
    super (stopwatch);
    this.maxBurstSeconds = maxBurstSeconds;
}

void doSetRate (double permitsPerSecond, double stableIntervalMicros) {
    double oldMaxPermits = this.maxPermits;
    maxPermits = maxBurstSeconds * permitsPerSecond;
    if (oldMaxPermits == Double.POSITIVE_INFINITY) {
        storedPermits = maxPermits;
    } else {
        storedPermits = (oldMaxPermits == 0.0) ? 0.0 : storedPermits * maxPermits / oldMaxPermits;
    }
}

long storedPermitsToWaitTime (double storedPermits, double permitsToTake) {
    return 0L;
}

double coolDownIntervalMicros () {
    return stableIntervalMicros;
}

private SmoothRateLimiter (SleepingStopwatch stopwatch) {
    super (stopwatch);
}

final void doSetRate (double permitsPerSecond, long nowMicros) {
    resync (nowMicros);
    double stableIntervalMicros = SECONDS.toMicros (1L) / permitsPerSecond;
    this.stableIntervalMicros = stableIntervalMicros;
    doSetRate (permitsPerSecond, stableIntervalMicros);
}

final double doGetRate () {
    return SECONDS.toMicros (1L) / stableIntervalMicros;
}

final long queryEarliestAvailable (long nowMicros) {
    return nextFreeTicketMicros;
}

final long reserveEarliestAvailable (int requiredPermits, long nowMicros) {
    resync (nowMicros);
    long returnValue = nextFreeTicketMicros;
    double storedPermitsToSpend = min (requiredPermits, this.storedPermits);
    double freshPermits = requiredPermits - storedPermitsToSpend;
    long waitMicros = storedPermitsToWaitTime (this.storedPermits, storedPermitsToSpend) + (long) (freshPermits * stableIntervalMicros);
    this.nextFreeTicketMicros = LongMath.saturatedAdd (nextFreeTicketMicros, waitMicros);
    this.storedPermits -= storedPermitsToSpend;
    return returnValue;
}

void resync (long nowMicros) {
    if (nowMicros > nextFreeTicketMicros) {
        double newPermits = (nowMicros - nextFreeTicketMicros) / coolDownIntervalMicros ();
        storedPermits = min (maxPermits, storedPermits + newPermits);
        nextFreeTicketMicros = nowMicros;
    }
}

