AbstractCatchingFuture (ListenableFuture < ? extends V > inputFuture, Class < X > exceptionType, F fallback) {
    this.inputFuture = checkNotNull (inputFuture);
    this.exceptionType = checkNotNull (exceptionType);
    this.fallback = checkNotNull (fallback);
}

public final void run () {
    ListenableFuture < ? extends V > localInputFuture = inputFuture;
    Class < X > localExceptionType = exceptionType;
    F localFallback = fallback;
    if (localInputFuture == null | localExceptionType == null | localFallback == null | isCancelled ()) {
        return;
    }
    inputFuture = null;
    exceptionType = null;
    fallback = null;
    V sourceResult = null;
    Throwable throwable = null;
    try {
        sourceResult = getDone (localInputFuture);
    } catch (ExecutionException e) {
        throwable = checkNotNull (e.getCause ());
    } catch (Throwable e) {
        throwable = e;
    }
    if (throwable == null) {
        set (sourceResult);
        return;
    }
    if (! isInstanceOfThrowableClass (throwable, localExceptionType)) {
        setException (throwable);
        return;
    }
    @SuppressWarnings("unchecked")
    X castThrowable = (X) throwable;
    T fallbackResult;
    try {
        fallbackResult = doFallback (localFallback, castThrowable);
    } catch (Throwable t) {
        setException (t);
        return;
    }
    setResult (fallbackResult);
}

protected final void afterDone () {
    maybePropagateCancellation (inputFuture);
    this.inputFuture = null;
    this.exceptionType = null;
    this.fallback = null;
}

AsyncCatchingFuture (ListenableFuture < ? extends V > input, Class < X > exceptionType, AsyncFunction < ? super X, ? extends V > fallback) {
    super (input, exceptionType, fallback);
}

ListenableFuture < ? extends V > doFallback (AsyncFunction < ? super X, ? extends V > fallback, X cause) throws Exception {
    ListenableFuture < ? extends V > replacement = fallback.apply (cause);
    checkNotNull (replacement, "AsyncFunction.apply returned null instead of a Future. " + "Did you mean to return immediateFuture(null)?");
    return replacement;
}

