public void run () {
    lock.lock ();
    try {
        if (runningTask.isCancelled ()) {
            return;
        }
        AbstractScheduledService.this.runOneIteration ();
    } catch (Throwable t) {
        try {
            shutDown ();
        } catch (Exception ignored) {
            logger.log (Level.WARNING, "Error while attempting to shut down the service after failure.", ignored);
        }
        notifyFailed (t);
        runningTask.cancel (false);
    } finally {
        lock.unlock ();
    }
}

protected final void doStart () {
    executorService = MoreExecutors.renamingDecorator (executor (), new Supplier < String > () {
        @Override
        public String get () {
            return serviceName () + " " + state ();
        }}

    );
    executorService.execute (new Runnable () {
        @Override
        public void run () {
            lock.lock ();
            try {
                startUp ();
                runningTask = scheduler ().schedule (delegate, executorService, task);
                notifyStarted ();
            } catch (Throwable t) {
                notifyFailed (t);
                if (runningTask != null) {
                    runningTask.cancel (false);
                }
            } finally {
                lock.unlock ();
            }
        }}

    );
}

public String get () {
    return serviceName () + " " + state ();
}

public void run () {
    lock.lock ();
    try {
        startUp ();
        runningTask = scheduler ().schedule (delegate, executorService, task);
        notifyStarted ();
    } catch (Throwable t) {
        notifyFailed (t);
        if (runningTask != null) {
            runningTask.cancel (false);
        }
    } finally {
        lock.unlock ();
    }
}

protected final void doStop () {
    runningTask.cancel (false);
    executorService.execute (new Runnable () {
        @Override
        public void run () {
            try {
                lock.lock ();
                try {
                    if (state () != State.STOPPING) {
                        return;
                    }
                    shutDown ();
                } finally {
                    lock.unlock ();
                }
                notifyStopped ();
            } catch (Throwable t) {
                notifyFailed (t);
            }
        }}

    );
}

