static < T > Callable < T > threadRenaming (final Callable < T > callable, final Supplier < String > nameSupplier) {
    checkNotNull (nameSupplier);
    checkNotNull (callable);
    return new Callable < T > () {
        @Override
        public T call () throws Exception {
            Thread currentThread = Thread.currentThread ();
            String oldName = currentThread.getName ();
            boolean restoreName = trySetName (nameSupplier.get (), currentThread);
            try {
                return callable.call ();
            } finally {
                if (restoreName) {
                    boolean unused = trySetName (oldName, currentThread);
                }
            }
        }}

    ;
}

public T call () throws Exception {
    Thread currentThread = Thread.currentThread ();
    String oldName = currentThread.getName ();
    boolean restoreName = trySetName (nameSupplier.get (), currentThread);
    try {
        return callable.call ();
    } finally {
        if (restoreName) {
            boolean unused = trySetName (oldName, currentThread);
        }
    }
}

static Runnable threadRenaming (final Runnable task, final Supplier < String > nameSupplier) {
    checkNotNull (nameSupplier);
    checkNotNull (task);
    return new Runnable () {
        @Override
        public void run () {
            Thread currentThread = Thread.currentThread ();
            String oldName = currentThread.getName ();
            boolean restoreName = trySetName (nameSupplier.get (), currentThread);
            try {
                task.run ();
            } finally {
                if (restoreName) {
                    boolean unused = trySetName (oldName, currentThread);
                }
            }
        }}

    ;
}

public void run () {
    Thread currentThread = Thread.currentThread ();
    String oldName = currentThread.getName ();
    boolean restoreName = trySetName (nameSupplier.get (), currentThread);
    try {
        task.run ();
    } finally {
        if (restoreName) {
            boolean unused = trySetName (oldName, currentThread);
        }
    }
}

private static boolean trySetName (final String threadName, Thread currentThread) {
    try {
        currentThread.setName (threadName);
        return true;
    } catch (SecurityException e) {
        return false;
    }
}

