public Monitor () {
    this (false);
}

public Monitor (boolean fair) {
    this.fair = fair;
    this.lock = new ReentrantLock (fair);
}

public void enter () {
    lock.lock ();
}

public void enterInterruptibly () throws InterruptedException {
    lock.lockInterruptibly ();
}

public boolean enter (long time, TimeUnit unit) {
    final long timeoutNanos = toSafeNanos (time, unit);
    final ReentrantLock lock = this.lock;
    if (! fair && lock.tryLock ()) {
        return true;
    }
    boolean interrupted = Thread.interrupted ();
    try {
        final long startTime = System.nanoTime ();
        for (long remainingNanos = timeoutNanos;
        ;) {
            try {
                return lock.tryLock (remainingNanos, TimeUnit.NANOSECONDS);
            } catch (InterruptedException interrupt) {
                interrupted = true;
                remainingNanos = remainingNanos (startTime, timeoutNanos);
            }
        }
    } finally {
        if (interrupted) {
            Thread.currentThread ().interrupt ();
        }
    }
}

public boolean enterInterruptibly (long time, TimeUnit unit) throws InterruptedException {
    return lock.tryLock (time, unit);
}

public boolean tryEnter () {
    return lock.tryLock ();
}

public void enterWhen (Guard guard) throws InterruptedException {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    boolean signalBeforeWaiting = lock.isHeldByCurrentThread ();
    lock.lockInterruptibly ();
    boolean satisfied = false;
    try {
        if (! guard.isSatisfied ()) {
            await (guard, signalBeforeWaiting);
        }
        satisfied = true;
    } finally {
        if (! satisfied) {
            leave ();
        }
    }
}

public void enterWhenUninterruptibly (Guard guard) {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    boolean signalBeforeWaiting = lock.isHeldByCurrentThread ();
    lock.lock ();
    boolean satisfied = false;
    try {
        if (! guard.isSatisfied ()) {
            awaitUninterruptibly (guard, signalBeforeWaiting);
        }
        satisfied = true;
    } finally {
        if (! satisfied) {
            leave ();
        }
    }
}

public boolean enterWhen (Guard guard, long time, TimeUnit unit) throws InterruptedException {
    final long timeoutNanos = toSafeNanos (time, unit);
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    boolean reentrant = lock.isHeldByCurrentThread ();
    long startTime = 0L;
    locked : {
        if (! fair) {
            if (Thread.interrupted ()) {
                throw new InterruptedException ();
            }
            if (lock.tryLock ()) {
                break locked;
            }
        }
        startTime = initNanoTime (timeoutNanos);
        if (! lock.tryLock (time, unit)) {
            return false;
        }
    } boolean satisfied = false;
    boolean threw = true;
    try {
        satisfied = guard.isSatisfied () || awaitNanos (guard, (startTime == 0L) ? timeoutNanos : remainingNanos (startTime, timeoutNanos), reentrant);
        threw = false;
        return satisfied;
    } finally {
        if (! satisfied) {
            try {
                if (threw && ! reentrant) {
                    signalNextWaiter ();
                }
            } finally {
                lock.unlock ();
            }
        }
    }
}

public boolean enterWhenUninterruptibly (Guard guard, long time, TimeUnit unit) {
    final long timeoutNanos = toSafeNanos (time, unit);
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    long startTime = 0L;
    boolean signalBeforeWaiting = lock.isHeldByCurrentThread ();
    boolean interrupted = Thread.interrupted ();
    try {
        if (fair || ! lock.tryLock ()) {
            startTime = initNanoTime (timeoutNanos);
            for (long remainingNanos = timeoutNanos;
            ;) {
                try {
                    if (lock.tryLock (remainingNanos, TimeUnit.NANOSECONDS)) {
                        break;
                    } else {
                        return false;
                    }
                } catch (InterruptedException interrupt) {
                    interrupted = true;
                    remainingNanos = remainingNanos (startTime, timeoutNanos);
                }
            }
        }
        boolean satisfied = false;
        try {
            while (true) {
                try {
                    if (guard.isSatisfied ()) {
                        satisfied = true;
                    } else {
                        final long remainingNanos;
                        if (startTime == 0L) {
                            startTime = initNanoTime (timeoutNanos);
                            remainingNanos = timeoutNanos;
                        } else {
                            remainingNanos = remainingNanos (startTime, timeoutNanos);
                        }
                        satisfied = awaitNanos (guard, remainingNanos, signalBeforeWaiting);
                    }
                    return satisfied;
                } catch (InterruptedException interrupt) {
                    interrupted = true;
                    signalBeforeWaiting = false;
                }
            }
        } finally {
            if (! satisfied) {
                lock.unlock ();
            }
        }
    } finally {
        if (interrupted) {
            Thread.currentThread ().interrupt ();
        }
    }
}

public boolean enterIf (Guard guard) {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    lock.lock ();
    boolean satisfied = false;
    try {
        return satisfied = guard.isSatisfied ();
    } finally {
        if (! satisfied) {
            lock.unlock ();
        }
    }
}

public boolean enterIfInterruptibly (Guard guard) throws InterruptedException {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    lock.lockInterruptibly ();
    boolean satisfied = false;
    try {
        return satisfied = guard.isSatisfied ();
    } finally {
        if (! satisfied) {
            lock.unlock ();
        }
    }
}

public boolean enterIf (Guard guard, long time, TimeUnit unit) {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    if (! enter (time, unit)) {
        return false;
    }
    boolean satisfied = false;
    try {
        return satisfied = guard.isSatisfied ();
    } finally {
        if (! satisfied) {
            lock.unlock ();
        }
    }
}

public boolean enterIfInterruptibly (Guard guard, long time, TimeUnit unit) throws InterruptedException {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    if (! lock.tryLock (time, unit)) {
        return false;
    }
    boolean satisfied = false;
    try {
        return satisfied = guard.isSatisfied ();
    } finally {
        if (! satisfied) {
            lock.unlock ();
        }
    }
}

public boolean tryEnterIf (Guard guard) {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    final ReentrantLock lock = this.lock;
    if (! lock.tryLock ()) {
        return false;
    }
    boolean satisfied = false;
    try {
        return satisfied = guard.isSatisfied ();
    } finally {
        if (! satisfied) {
            lock.unlock ();
        }
    }
}

public void waitFor (Guard guard) throws InterruptedException {
    if (! ((guard.monitor == this) & lock.isHeldByCurrentThread ())) {
        throw new IllegalMonitorStateException ();
    }
    if (! guard.isSatisfied ()) {
        await (guard, true);
    }
}

public void waitForUninterruptibly (Guard guard) {
    if (! ((guard.monitor == this) & lock.isHeldByCurrentThread ())) {
        throw new IllegalMonitorStateException ();
    }
    if (! guard.isSatisfied ()) {
        awaitUninterruptibly (guard, true);
    }
}

public boolean waitFor (Guard guard, long time, TimeUnit unit) throws InterruptedException {
    final long timeoutNanos = toSafeNanos (time, unit);
    if (! ((guard.monitor == this) & lock.isHeldByCurrentThread ())) {
        throw new IllegalMonitorStateException ();
    }
    if (guard.isSatisfied ()) {
        return true;
    }
    if (Thread.interrupted ()) {
        throw new InterruptedException ();
    }
    return awaitNanos (guard, timeoutNanos, true);
}

public boolean waitForUninterruptibly (Guard guard, long time, TimeUnit unit) {
    final long timeoutNanos = toSafeNanos (time, unit);
    if (! ((guard.monitor == this) & lock.isHeldByCurrentThread ())) {
        throw new IllegalMonitorStateException ();
    }
    if (guard.isSatisfied ()) {
        return true;
    }
    boolean signalBeforeWaiting = true;
    final long startTime = initNanoTime (timeoutNanos);
    boolean interrupted = Thread.interrupted ();
    try {
        for (long remainingNanos = timeoutNanos;
        ;) {
            try {
                return awaitNanos (guard, remainingNanos, signalBeforeWaiting);
            } catch (InterruptedException interrupt) {
                interrupted = true;
                if (guard.isSatisfied ()) {
                    return true;
                }
                signalBeforeWaiting = false;
                remainingNanos = remainingNanos (startTime, timeoutNanos);
            }
        }
    } finally {
        if (interrupted) {
            Thread.currentThread ().interrupt ();
        }
    }
}

public void leave () {
    final ReentrantLock lock = this.lock;
    try {
        if (lock.getHoldCount () == 1) {
            signalNextWaiter ();
        }
    } finally {
        lock.unlock ();
    }
}

public boolean isFair () {
    return fair;
}

public boolean isOccupied () {
    return lock.isLocked ();
}

public boolean isOccupiedByCurrentThread () {
    return lock.isHeldByCurrentThread ();
}

public int getOccupiedDepth () {
    return lock.getHoldCount ();
}

public int getQueueLength () {
    return lock.getQueueLength ();
}

public boolean hasQueuedThreads () {
    return lock.hasQueuedThreads ();
}

public boolean hasQueuedThread (Thread thread) {
    return lock.hasQueuedThread (thread);
}

public boolean hasWaiters (Guard guard) {
    return getWaitQueueLength (guard) > 0;
}

public int getWaitQueueLength (Guard guard) {
    if (guard.monitor != this) {
        throw new IllegalMonitorStateException ();
    }
    lock.lock ();
    try {
        return guard.waiterCount;
    } finally {
        lock.unlock ();
    }
}

private static long toSafeNanos (long time, TimeUnit unit) {
    long timeoutNanos = unit.toNanos (time);
    return (timeoutNanos <= 0L) ? 0L : (timeoutNanos > (Long.MAX_VALUE / 4) * 3) ? (Long.MAX_VALUE / 4) * 3 : timeoutNanos;
}

private static long initNanoTime (long timeoutNanos) {
    if (timeoutNanos <= 0L) {
        return 0L;
    } else {
        long startTime = System.nanoTime ();
        return (startTime == 0L) ? 1L : startTime;
    }
}

private static long remainingNanos (long startTime, long timeoutNanos) {
    return (timeoutNanos <= 0L) ? 0L : timeoutNanos - (System.nanoTime () - startTime);
}

private void signalNextWaiter () {
    for (Guard guard = activeGuards;
    guard != null; guard = guard.next) {
        if (isSatisfied (guard)) {
            guard.condition.signal ();
            break;
        }
    }
}

private boolean isSatisfied (Guard guard) {
    try {
        return guard.isSatisfied ();
    } catch (Throwable throwable) {
        signalAllWaiters ();
        throw Throwables.propagate (throwable);
    }
}

private void signalAllWaiters () {
    for (Guard guard = activeGuards;
    guard != null; guard = guard.next) {
        guard.condition.signalAll ();
    }
}

private void beginWaitingFor (Guard guard) {
    int waiters = guard.waiterCount ++;
    if (waiters == 0) {
        guard.next = activeGuards;
        activeGuards = guard;
    }
}

private void endWaitingFor (Guard guard) {
    int waiters = -- guard.waiterCount;
    if (waiters == 0) {
        for (Guard p = activeGuards, pred = null;
        ; pred = p, p = p.next) {
            if (p == guard) {
                if (pred == null) {
                    activeGuards = p.next;
                } else {
                    pred.next = p.next;
                }
                p.next = null;
                break;
            }
        }
    }
}

private void await (Guard guard, boolean signalBeforeWaiting) throws InterruptedException {
    if (signalBeforeWaiting) {
        signalNextWaiter ();
    }
    beginWaitingFor (guard);
    try {
        do {
            guard.condition.await ();
        } while (! guard.isSatisfied ());
    } finally {
        endWaitingFor (guard);
    }
}

private void awaitUninterruptibly (Guard guard, boolean signalBeforeWaiting) {
    if (signalBeforeWaiting) {
        signalNextWaiter ();
    }
    beginWaitingFor (guard);
    try {
        do {
            guard.condition.awaitUninterruptibly ();
        } while (! guard.isSatisfied ());
    } finally {
        endWaitingFor (guard);
    }
}

private boolean awaitNanos (Guard guard, long nanos, boolean signalBeforeWaiting) throws InterruptedException {
    boolean firstTime = true;
    try {
        do {
            if (nanos <= 0L) {
                return false;
            }
            if (firstTime) {
                if (signalBeforeWaiting) {
                    signalNextWaiter ();
                }
                beginWaitingFor (guard);
                firstTime = false;
            }
            nanos = guard.condition.awaitNanos (nanos);
        } while (! guard.isSatisfied ());
        return true;
    } finally {
        if (! firstTime) {
            endWaitingFor (guard);
        }
    }
}

void call (Listener listener) {
    listener.healthy ();
}

void call (Listener listener) {
    listener.stopped ();
}

public ServiceManager (Iterable < ? extends Service > services) {
    ImmutableList < Service > copy = ImmutableList.copyOf (services);
    if (copy.isEmpty ()) {
        logger.log (Level.WARNING, "ServiceManager configured with no services.  Is your application configured properly?", new EmptyServiceManagerWarning ());
        copy = ImmutableList.< Service > of (new NoOpService ());
    }
    this.state = new ServiceManagerState (copy);
    this.services = copy;
    WeakReference < ServiceManagerState > stateReference = new WeakReference < ServiceManagerState > (state);
    for (Service service : copy) {
        service.addListener (new ServiceListener (service, stateReference), directExecutor ());
        checkArgument (service.state () == NEW, "Can only manage NEW services, %s", service);
    }
    this.state.markReady ();
}

public void addListener (Listener listener, Executor executor) {
    state.addListener (listener, executor);
}

public void addListener (Listener listener) {
    state.addListener (listener, directExecutor ());
}

public ServiceManager startAsync () {
    for (Service service : services) {
        State state = service.state ();
        checkState (state == NEW, "Service %s is %s, cannot start it.", service, state);
    }
    for (Service service : services) {
        try {
            state.tryStartTiming (service);
            service.startAsync ();
        } catch (IllegalStateException e) {
            logger.log (Level.WARNING, "Unable to start Service " + service, e);
        }
    }
    return this;
}

public void awaitHealthy () {
    state.awaitHealthy ();
}

public void awaitHealthy (long timeout, TimeUnit unit) throws TimeoutException {
    state.awaitHealthy (timeout, unit);
}

public ServiceManager stopAsync () {
    for (Service service : services) {
        service.stopAsync ();
    }
    return this;
}

public void awaitStopped () {
    state.awaitStopped ();
}

public void awaitStopped (long timeout, TimeUnit unit) throws TimeoutException {
    state.awaitStopped (timeout, unit);
}

public boolean isHealthy () {
    for (Service service : services) {
        if (! service.isRunning ()) {
            return false;
        }
    }
    return true;
}

public ImmutableMultimap < State, Service > servicesByState () {
    return state.servicesByState ();
}

public ImmutableMap < Service, Long > startupTimes () {
    return state.startupTimes ();
}

public String toString () {
    return MoreObjects.toStringHelper (ServiceManager.class).add ("services", Collections2.filter (services, not (instanceOf (NoOpService.class)))).toString ();
}

AwaitHealthGuard () {
    super (ServiceManagerState.this.monitor);
}

public boolean isSatisfied () {
    return states.count (RUNNING) == numberOfServices || states.contains (STOPPING) || states.contains (TERMINATED) || states.contains (FAILED);
}

StoppedGuard () {
    super (ServiceManagerState.this.monitor);
}

public boolean isSatisfied () {
    return states.count (TERMINATED) + states.count (FAILED) == numberOfServices;
}

ServiceManagerState (ImmutableCollection < Service > services) {
    this.numberOfServices = services.size ();
    servicesByState.putAll (NEW, services);
}

void tryStartTiming (Service service) {
    monitor.enter ();
    try {
        Stopwatch stopwatch = startupTimers.get (service);
        if (stopwatch == null) {
            startupTimers.put (service, Stopwatch.createStarted ());
        }
    } finally {
        monitor.leave ();
    }
}

void markReady () {
    monitor.enter ();
    try {
        if (! transitioned) {
            ready = true;
        } else {
            List < Service > servicesInBadStates = Lists.newArrayList ();
            for (Service service : servicesByState ().values ()) {
                if (service.state () != NEW) {
                    servicesInBadStates.add (service);
                }
            }
            throw new IllegalArgumentException ("Services started transitioning asynchronously before " + "the ServiceManager was constructed: " + servicesInBadStates);
        }
    } finally {
        monitor.leave ();
    }
}

void addListener (Listener listener, Executor executor) {
    checkNotNull (listener, "listener");
    checkNotNull (executor, "executor");
    monitor.enter ();
    try {
        if (! stoppedGuard.isSatisfied ()) {
            listeners.add (new ListenerCallQueue < Listener > (listener, executor));
        }
    } finally {
        monitor.leave ();
    }
}

void awaitHealthy () {
    monitor.enterWhenUninterruptibly (awaitHealthGuard);
    try {
        checkHealthy ();
    } finally {
        monitor.leave ();
    }
}

void awaitHealthy (long timeout, TimeUnit unit) throws TimeoutException {
    monitor.enter ();
    try {
        if (! monitor.waitForUninterruptibly (awaitHealthGuard, timeout, unit)) {
            throw new TimeoutException ("Timeout waiting for the services to become healthy. The " + "following services have not started: " + Multimaps.filterKeys (servicesByState, in (ImmutableSet.of (NEW, STARTING))));
        }
        checkHealthy ();
    } finally {
        monitor.leave ();
    }
}

void awaitStopped () {
    monitor.enterWhenUninterruptibly (stoppedGuard);
    monitor.leave ();
}

void awaitStopped (long timeout, TimeUnit unit) throws TimeoutException {
    monitor.enter ();
    try {
        if (! monitor.waitForUninterruptibly (stoppedGuard, timeout, unit)) {
            throw new TimeoutException ("Timeout waiting for the services to stop. The following " + "services have not stopped: " + Multimaps.filterKeys (servicesByState, not (in (EnumSet.of (TERMINATED, FAILED)))));
        }
    } finally {
        monitor.leave ();
    }
}

ImmutableMultimap < State, Service > servicesByState () {
    ImmutableSetMultimap.Builder < State, Service > builder = ImmutableSetMultimap.builder ();
    monitor.enter ();
    try {
        for (Entry < State, Service > entry : servicesByState.entries ()) {
            if (! (entry.getValue () instanceof NoOpService)) {
                builder.put (entry);
            }
        }
    } finally {
        monitor.leave ();
    }
    return builder.build ();
}

ImmutableMap < Service, Long > startupTimes () {
    List < Entry < Service, Long > > loadTimes;
    monitor.enter ();
    try {
        loadTimes = Lists.newArrayListWithCapacity (startupTimers.size ());
        for (Entry < Service, Stopwatch > entry : startupTimers.entrySet ()) {
            Service service = entry.getKey ();
            Stopwatch stopWatch = entry.getValue ();
            if (! stopWatch.isRunning () && ! (service instanceof NoOpService)) {
                loadTimes.add (Maps.immutableEntry (service, stopWatch.elapsed (MILLISECONDS)));
            }
        }
    } finally {
        monitor.leave ();
    }
    Collections.sort (loadTimes, Ordering.natural ().onResultOf (new Function < Entry < Service, Long >, Long > () {
        @Override
        public Long apply (Map.Entry < Service, Long > input) {
            return input.getValue ();
        }}

    ));
    return ImmutableMap.copyOf (loadTimes);
}

public Long apply (Map.Entry < Service, Long > input) {
    return input.getValue ();
}

void transitionService (final Service service, State from, State to) {
    checkNotNull (service);
    checkArgument (from != to);
    monitor.enter ();
    try {
        transitioned = true;
        if (! ready) {
            return;
        }
        checkState (servicesByState.remove (from, service), "Service %s not at the expected location in the state map %s", service, from);
        checkState (servicesByState.put (to, service), "Service %s in the state map unexpectedly at %s", service, to);
        Stopwatch stopwatch = startupTimers.get (service);
        if (stopwatch == null) {
            stopwatch = Stopwatch.createStarted ();
            startupTimers.put (service, stopwatch);
        }
        if (to.compareTo (RUNNING) >= 0 && stopwatch.isRunning ()) {
            stopwatch.stop ();
            if (! (service instanceof NoOpService)) {
                logger.log (Level.FINE, "Started {0} in {1}.", new Object [] {service, stopwatch});
            }
        }
        if (to == FAILED) {
            fireFailedListeners (service);
        }
        if (states.count (RUNNING) == numberOfServices) {
            fireHealthyListeners ();
        } else if (states.count (TERMINATED) + states.count (FAILED) == numberOfServices) {
            fireStoppedListeners ();
        }

    } finally {
        monitor.leave ();
        executeListeners ();
    }
}

void fireStoppedListeners () {
    STOPPED_CALLBACK.enqueueOn (listeners);
}

void fireHealthyListeners () {
    HEALTHY_CALLBACK.enqueueOn (listeners);
}

void fireFailedListeners (final Service service) {
    new Callback < Listener > ("failed({service=" + service + "})") {
        @Override
        void call (Listener listener) {
            listener.failure (service);
        }}

    .enqueueOn (listeners);
}

void call (Listener listener) {
    listener.failure (service);
}

void executeListeners () {
    checkState (! monitor.isOccupiedByCurrentThread (), "It is incorrect to execute listeners with the monitor held.");
    for (int i = 0;
    i < listeners.size (); i ++) {
        listeners.get (i).execute ();
    }
}

void checkHealthy () {
    if (states.count (RUNNING) != numberOfServices) {
        IllegalStateException exception = new IllegalStateException ("Expected to be healthy after starting. The following services are not running: " + Multimaps.filterKeys (servicesByState, not (equalTo (RUNNING))));
        throw exception;
    }
}

ServiceListener (Service service, WeakReference < ServiceManagerState > state) {
    this.service = service;
    this.state = state;
}

public void starting () {
    ServiceManagerState state = this.state.get ();
    if (state != null) {
        state.transitionService (service, NEW, STARTING);
        if (! (service instanceof NoOpService)) {
            logger.log (Level.FINE, "Starting {0}.", service);
        }
    }
}

public void running () {
    ServiceManagerState state = this.state.get ();
    if (state != null) {
        state.transitionService (service, STARTING, RUNNING);
    }
}

public void stopping (State from) {
    ServiceManagerState state = this.state.get ();
    if (state != null) {
        state.transitionService (service, from, STOPPING);
    }
}

public void terminated (State from) {
    ServiceManagerState state = this.state.get ();
    if (state != null) {
        if (! (service instanceof NoOpService)) {
            logger.log (Level.FINE, "Service {0} has terminated. Previous state was: {1}", new Object [] {service, from});
        }
        state.transitionService (service, from, TERMINATED);
    }
}

public void failed (State from, Throwable failure) {
    ServiceManagerState state = this.state.get ();
    if (state != null) {
        boolean log = ! (service instanceof NoOpService);
        if (log) {
            logger.log (Level.SEVERE, "Service " + service + " has failed in the " + from + " state.", failure);
        }
        state.transitionService (service, from, FAILED);
    }
}

protected void doStart () {
    notifyStarted ();
}

protected void doStop () {
    notifyStopped ();
}

private AtomicLongMap (ConcurrentHashMap < K, AtomicLong > map) {
    this.map = checkNotNull (map);
}

public static < K > AtomicLongMap < K > create () {
    return new AtomicLongMap < K > (new ConcurrentHashMap < K, AtomicLong > ());
}

public static < K > AtomicLongMap < K > create (Map < ? extends K, ? extends Long > m) {
    AtomicLongMap < K > result = create ();
    result.putAll (m);
    return result;
}

public long get (K key) {
    AtomicLong atomic = map.get (key);
    return atomic == null ? 0L : atomic.get ();
}

public long incrementAndGet (K key) {
    return addAndGet (key, 1);
}

public long decrementAndGet (K key) {
    return addAndGet (key, - 1);
}

public long addAndGet (K key, long delta) {
    outer : while (true) {
        AtomicLong atomic = map.get (key);
        if (atomic == null) {
            atomic = map.putIfAbsent (key, new AtomicLong (delta));
            if (atomic == null) {
                return delta;
            }
        }
        while (true) {
            long oldValue = atomic.get ();
            if (oldValue == 0L) {
                if (map.replace (key, atomic, new AtomicLong (delta))) {
                    return delta;
                }
                continue outer;
            }
            long newValue = oldValue + delta;
            if (atomic.compareAndSet (oldValue, newValue)) {
                return newValue;
            }
        }
    }
}

public long getAndIncrement (K key) {
    return getAndAdd (key, 1);
}

public long getAndDecrement (K key) {
    return getAndAdd (key, - 1);
}

public long getAndAdd (K key, long delta) {
    outer : while (true) {
        AtomicLong atomic = map.get (key);
        if (atomic == null) {
            atomic = map.putIfAbsent (key, new AtomicLong (delta));
            if (atomic == null) {
                return 0L;
            }
        }
        while (true) {
            long oldValue = atomic.get ();
            if (oldValue == 0L) {
                if (map.replace (key, atomic, new AtomicLong (delta))) {
                    return 0L;
                }
                continue outer;
            }
            long newValue = oldValue + delta;
            if (atomic.compareAndSet (oldValue, newValue)) {
                return oldValue;
            }
        }
    }
}

public long put (K key, long newValue) {
    outer : while (true) {
        AtomicLong atomic = map.get (key);
        if (atomic == null) {
            atomic = map.putIfAbsent (key, new AtomicLong (newValue));
            if (atomic == null) {
                return 0L;
            }
        }
        while (true) {
            long oldValue = atomic.get ();
            if (oldValue == 0L) {
                if (map.replace (key, atomic, new AtomicLong (newValue))) {
                    return 0L;
                }
                continue outer;
            }
            if (atomic.compareAndSet (oldValue, newValue)) {
                return oldValue;
            }
        }
    }
}

public void putAll (Map < ? extends K, ? extends Long > m) {
    for (Map.Entry < ? extends K, ? extends Long > entry : m.entrySet ()) {
        put (entry.getKey (), entry.getValue ());
    }
}

public long remove (K key) {
    AtomicLong atomic = map.get (key);
    if (atomic == null) {
        return 0L;
    }
    while (true) {
        long oldValue = atomic.get ();
        if (oldValue == 0L || atomic.compareAndSet (oldValue, 0L)) {
            map.remove (key, atomic);
            return oldValue;
        }
    }
}

public boolean removeIfZero (K key) {
    return remove (key, 0);
}

public void removeAllZeros () {
    Iterator < Map.Entry < K, AtomicLong > > entryIterator = map.entrySet ().iterator ();
    while (entryIterator.hasNext ()) {
        Map.Entry < K, AtomicLong > entry = entryIterator.next ();
        AtomicLong atomic = entry.getValue ();
        if (atomic != null && atomic.get () == 0L) {
            entryIterator.remove ();
        }
    }
}

public long sum () {
    long sum = 0L;
    for (AtomicLong value : map.values ()) {
        sum = sum + value.get ();
    }
    return sum;
}

public Map < K, Long > asMap () {
    Map < K, Long > result = asMap;
    return (result == null) ? asMap = createAsMap () : result;
}

private Map < K, Long > createAsMap () {
    return Collections.unmodifiableMap (Maps.transformValues (map, new Function < AtomicLong, Long > () {
        @Override
        public Long apply (AtomicLong atomic) {
            return atomic.get ();
        }}

    ));
}

public Long apply (AtomicLong atomic) {
    return atomic.get ();
}

public boolean containsKey (Object key) {
    return map.containsKey (key);
}

public int size () {
    return map.size ();
}

public boolean isEmpty () {
    return map.isEmpty ();
}

public void clear () {
    map.clear ();
}

public String toString () {
    return map.toString ();
}

long putIfAbsent (K key, long newValue) {
    while (true) {
        AtomicLong atomic = map.get (key);
        if (atomic == null) {
            atomic = map.putIfAbsent (key, new AtomicLong (newValue));
            if (atomic == null) {
                return 0L;
            }
        }
        long oldValue = atomic.get ();
        if (oldValue == 0L) {
            if (map.replace (key, atomic, new AtomicLong (newValue))) {
                return 0L;
            }
            continue;
        }
        return oldValue;
    }
}

boolean replace (K key, long expectedOldValue, long newValue) {
    if (expectedOldValue == 0L) {
        return putIfAbsent (key, newValue) == 0L;
    } else {
        AtomicLong atomic = map.get (key);
        return (atomic == null) ? false : atomic.compareAndSet (expectedOldValue, newValue);
    }
}

boolean remove (K key, long value) {
    AtomicLong atomic = map.get (key);
    if (atomic == null) {
        return false;
    }
    long oldValue = atomic.get ();
    if (oldValue != value) {
        return false;
    }
    if (oldValue == 0L || atomic.compareAndSet (oldValue, 0L)) {
        map.remove (key, atomic);
        return true;
    }
    return false;
}

