public static long divide (long dividend, long divisor) {
    if (divisor < 0) {
        if (compare (dividend, divisor) < 0) {
            return 0;
        } else {
            return 1;
        }
    }
    if (dividend >= 0) {
        return dividend / divisor;
    }
    long quotient = ((dividend>>> 1) / divisor) << 1;
    long rem = dividend - quotient * divisor;
    return quotient + (compare (rem, divisor) >= 0 ? 1 : 0);
}

public static long remainder (long dividend, long divisor) {
    if (divisor < 0) {
        if (compare (dividend, divisor) < 0) {
            return dividend;
        } else {
            return dividend - divisor;
        }
    }
    if (dividend >= 0) {
        return dividend % divisor;
    }
    long quotient = ((dividend>>> 1) / divisor) << 1;
    long rem = dividend - quotient * divisor;
    return rem - (compare (rem, divisor) >= 0 ? divisor : 0);
}

public static long parseUnsignedLong (String string) {
    return parseUnsignedLong (string, 10);
}

public static long decode (String stringValue) {
    ParseRequest request = ParseRequest.fromString (stringValue);
    try {
        return parseUnsignedLong (request.rawValue, request.radix);
    } catch (NumberFormatException e) {
        NumberFormatException decodeException = new NumberFormatException ("Error parsing value: " + stringValue);
        decodeException.initCause (e);
        throw decodeException;
    }
}

public static long parseUnsignedLong (String string, int radix) {
    checkNotNull (string);
    if (string.length () == 0) {
        throw new NumberFormatException ("empty string");
    }
    if (radix < Character.MIN_RADIX || radix > Character.MAX_RADIX) {
        throw new NumberFormatException ("illegal radix: " + radix);
    }
    int maxSafePos = maxSafeDigits [radix] - 1;
    long value = 0;
    for (int pos = 0;
    pos < string.length (); pos ++) {
        int digit = Character.digit (string.charAt (pos), radix);
        if (digit == - 1) {
            throw new NumberFormatException (string);
        }
        if (pos > maxSafePos && overflowInParse (value, digit, radix)) {
            throw new NumberFormatException ("Too large for unsigned long: " + string);
        }
        value = (value * radix) + digit;
    }
    return value;
}

private static boolean overflowInParse (long current, int digit, int radix) {
    if (current >= 0) {
        if (current < maxValueDivs [radix]) {
            return false;
        }
        if (current > maxValueDivs [radix]) {
            return true;
        }
        return (digit > maxValueMods [radix]);
    }
    return true;
}

public static String toString (long x) {
    return toString (x, 10);
}

public static String toString (long x, int radix) {
    checkArgument (radix >= Character.MIN_RADIX && radix <= Character.MAX_RADIX, "radix (%s) must be between Character.MIN_RADIX and Character.MAX_RADIX", radix);
    if (x == 0) {
        return "0";
    } else if (x > 0) {
        return Long.toString (x, radix);
    } else {
        char [] buf = new char [64];
        int i = buf.length;
        if ((radix & (radix - 1)) == 0) {
            int shift = Integer.numberOfTrailingZeros (radix);
            int mask = radix - 1;
            do {
                buf [-- i] = Character.forDigit (((int) x) & mask, radix);
                x>>>= shift;
            } while (x != 0);
        } else {
            long quotient;
            if ((radix & 1) == 0) {
                quotient = (x>>> 1) / (radix>>> 1);
            } else {
                quotient = divide (x, radix);
            }
            long rem = x - quotient * radix;
            buf [-- i] = Character.forDigit ((int) rem, radix);
            x = quotient;
            while (x > 0) {
                buf [-- i] = Character.forDigit ((int) (x % radix), radix);
                x /= radix;
            }
        }
        return new String (buf, i, buf.length - i);
    }

}

