public static int indexOf (long [] array, long [] target) {
    checkNotNull (array, "array");
    checkNotNull (target, "target");
    if (target.length == 0) {
        return 0;
    }
    outer : for (int i = 0;
    i < array.length - target.length + 1; i ++) {
        for (int j = 0;
        j < target.length; j ++) {
            if (array [i + j] != target [j]) {
                continue outer;
            }
        }
        return i;
    }
    return - 1;
}

