public static byte [] toByteArray (long value) {
    byte [] result = new byte [8];
    for (int i = 7;
    i >= 0; i --) {
        result [i] = (byte) (value & 0xffL);
        value>>= 8;
    }
    return result;
}

public static long fromByteArray (byte [] bytes) {
    checkArgument (bytes.length >= BYTES, "array too small: %s < %s", bytes.length, BYTES);
    return fromBytes (bytes [0], bytes [1], bytes [2], bytes [3], bytes [4], bytes [5], bytes [6], bytes [7]);
}

public static long fromBytes (byte b1, byte b2, byte b3, byte b4, byte b5, byte b6, byte b7, byte b8) {
    return (b1 & 0xFFL) << 56 | (b2 & 0xFFL) << 48 | (b3 & 0xFFL) << 40 | (b4 & 0xFFL) << 32 | (b5 & 0xFFL) << 24 | (b6 & 0xFFL) << 16 | (b7 & 0xFFL) << 8 | (b8 & 0xFFL);
}

private static byte [] createAsciiDigits () {
    byte [] result = new byte [128];
    Arrays.fill (result, (byte) - 1);
    for (int i = 0;
    i <= 9; i ++) {
        result ['0' + i] = (byte) i;
    }
    for (int i = 0;
    i <= 26; i ++) {
        result ['A' + i] = (byte) (10 + i);
        result ['a' + i] = (byte) (10 + i);
    }
    return result;
}

private static int digit (char c) {
    return (c < 128) ? asciiDigits [c] : - 1;
}

public static Long tryParse (String string) {
    return tryParse (string, 10);
}

public static Long tryParse (String string, int radix) {
    if (checkNotNull (string).isEmpty ()) {
        return null;
    }
    if (radix < Character.MIN_RADIX || radix > Character.MAX_RADIX) {
        throw new IllegalArgumentException ("radix must be between MIN_RADIX and MAX_RADIX but was " + radix);
    }
    boolean negative = string.charAt (0) == '-';
    int index = negative ? 1 : 0;
    if (index == string.length ()) {
        return null;
    }
    int digit = digit (string.charAt (index ++));
    if (digit < 0 || digit >= radix) {
        return null;
    }
    long accum = - digit;
    long cap = Long.MIN_VALUE / radix;
    while (index < string.length ()) {
        digit = digit (string.charAt (index ++));
        if (digit < 0 || digit >= radix || accum < cap) {
            return null;
        }
        accum *= radix;
        if (accum < Long.MIN_VALUE + digit) {
            return null;
        }
        accum -= digit;
    }
    if (negative) {
        return accum;
    } else if (accum == Long.MIN_VALUE) {
        return null;
    } else {
        return - accum;
    }

}

