protected AbstractStreamingHasher (int chunkSize) {
    this (chunkSize, chunkSize);
}

protected AbstractStreamingHasher (int chunkSize, int bufferSize) {
    checkArgument (bufferSize % chunkSize == 0);
    this.buffer = ByteBuffer.allocate (bufferSize + 7).order (ByteOrder.LITTLE_ENDIAN);
    this.bufferSize = bufferSize;
    this.chunkSize = chunkSize;
}

protected void processRemaining (ByteBuffer bb) {
    bb.position (bb.limit ());
    bb.limit (chunkSize + 7);
    while (bb.position () < chunkSize) {
        bb.putLong (0);
    }
    bb.limit (chunkSize);
    bb.flip ();
    process (bb);
}

public final Hasher putBytes (byte [] bytes) {
    return putBytes (bytes, 0, bytes.length);
}

public final Hasher putBytes (byte [] bytes, int off, int len) {
    return putBytes (ByteBuffer.wrap (bytes, off, len).order (ByteOrder.LITTLE_ENDIAN));
}

private Hasher putBytes (ByteBuffer readBuffer) {
    if (readBuffer.remaining () <= buffer.remaining ()) {
        buffer.put (readBuffer);
        munchIfFull ();
        return this;
    }
    int bytesToCopy = bufferSize - buffer.position ();
    for (int i = 0;
    i < bytesToCopy; i ++) {
        buffer.put (readBuffer.get ());
    }
    munch ();
    while (readBuffer.remaining () >= chunkSize) {
        process (readBuffer);
    }
    buffer.put (readBuffer);
    return this;
}

public final Hasher putUnencodedChars (CharSequence charSequence) {
    for (int i = 0;
    i < charSequence.length (); i ++) {
        putChar (charSequence.charAt (i));
    }
    return this;
}

public final Hasher putByte (byte b) {
    buffer.put (b);
    munchIfFull ();
    return this;
}

public final Hasher putShort (short s) {
    buffer.putShort (s);
    munchIfFull ();
    return this;
}

public final Hasher putChar (char c) {
    buffer.putChar (c);
    munchIfFull ();
    return this;
}

public final Hasher putInt (int i) {
    buffer.putInt (i);
    munchIfFull ();
    return this;
}

public final Hasher putLong (long l) {
    buffer.putLong (l);
    munchIfFull ();
    return this;
}

public final < T > Hasher putObject (T instance, Funnel < ? super T > funnel) {
    funnel.funnel (instance, this);
    return this;
}

public final HashCode hash () {
    munch ();
    buffer.flip ();
    if (buffer.remaining () > 0) {
        processRemaining (buffer);
    }
    return makeHash ();
}

private void munchIfFull () {
    if (buffer.remaining () < 8) {
        munch ();
    }
}

private void munch () {
    buffer.flip ();
    while (buffer.remaining () >= chunkSize) {
        process (buffer);
    }
    buffer.compact ();
}

MessageDigestHashFunction (String algorithmName, String toString) {
    this.prototype = getMessageDigest (algorithmName);
    this.bytes = prototype.getDigestLength ();
    this.toString = checkNotNull (toString);
    this.supportsClone = supportsClone (prototype);
}

MessageDigestHashFunction (String algorithmName, int bytes, String toString) {
    this.toString = checkNotNull (toString);
    this.prototype = getMessageDigest (algorithmName);
    int maxLength = prototype.getDigestLength ();
    checkArgument (bytes >= 4 && bytes <= maxLength, "bytes (%s) must be >= 4 and < %s", bytes, maxLength);
    this.bytes = bytes;
    this.supportsClone = supportsClone (prototype);
}

private static boolean supportsClone (MessageDigest digest) {
    try {
        digest.clone ();
        return true;
    } catch (CloneNotSupportedException e) {
        return false;
    }
}

