}

public HashCode hashBytes (byte [] input, int off, int len) {
    checkPositionIndexes (off, off + len, input.length);
    return HashCode.fromLong (fingerprint (input, off, len));
}

public int bits () {
    return 64;
}

public String toString () {
    return "Hashing.farmHashFingerprint64()";
}

static long fingerprint (byte [] bytes, int offset, int length) {
    if (length <= 32) {
        if (length <= 16) {
            return hashLength0to16 (bytes, offset, length);
        } else {
            return hashLength17to32 (bytes, offset, length);
        }
    } else if (length <= 64) {
        return hashLength33To64 (bytes, offset, length);
    } else {
        return hashLength65Plus (bytes, offset, length);
    }

}

private static long shiftMix (long val) {
    return val ^ (val>>> 47);
}

private static long hashLength16 (long u, long v, long mul) {
    long a = (u ^ v) * mul;
    a ^= (a>>> 47);
    long b = (v ^ a) * mul;
    b ^= (b>>> 47);
    b *= mul;
    return b;
}

private static void weakHashLength32WithSeeds (byte [] bytes, int offset, long seedA, long seedB, long [] output) {
    long part1 = load64 (bytes, offset);
    long part2 = load64 (bytes, offset + 8);
    long part3 = load64 (bytes, offset + 16);
    long part4 = load64 (bytes, offset + 24);
    seedA += part1;
    seedB = rotateRight (seedB + seedA + part4, 21);
    long c = seedA;
    seedA += part2;
    seedA += part3;
    seedB += rotateRight (seedA, 44);
    output [0] = seedA + part4;
    output [1] = seedB + c;
}

private static long hashLength0to16 (byte [] bytes, int offset, int length) {
    if (length >= 8) {
        long mul = K2 + length * 2;
        long a = load64 (bytes, offset) + K2;
        long b = load64 (bytes, offset + length - 8);
        long c = rotateRight (b, 37) * mul + a;
        long d = (rotateRight (a, 25) + b) * mul;
        return hashLength16 (c, d, mul);
    }
    if (length >= 4) {
        long mul = K2 + length * 2;
        long a = load32 (bytes, offset) & 0xFFFFFFFFL;
        return hashLength16 (length + (a << 3), load32 (bytes, offset + length - 4) & 0xFFFFFFFFL, mul);
    }
    if (length > 0) {
        byte a = bytes [offset];
        byte b = bytes [offset + (length>> 1)];
        byte c = bytes [offset + (length - 1)];
        int y = (a & 0xFF) + ((b & 0xFF) << 8);
        int z = length + ((c & 0xFF) << 2);
        return shiftMix (y * K2 ^ z * K0) * K2;
    }
    return K2;
}

private static long hashLength17to32 (byte [] bytes, int offset, int length) {
    long mul = K2 + length * 2;
    long a = load64 (bytes, offset) * K1;
    long b = load64 (bytes, offset + 8);
    long c = load64 (bytes, offset + length - 8) * mul;
    long d = load64 (bytes, offset + length - 16) * K2;
    return hashLength16 (rotateRight (a + b, 43) + rotateRight (c, 30) + d, a + rotateRight (b + K2, 18) + c, mul);
}

private static long hashLength33To64 (byte [] bytes, int offset, int length) {
    long mul = K2 + length * 2;
    long a = load64 (bytes, offset) * K2;
    long b = load64 (bytes, offset + 8);
    long c = load64 (bytes, offset + length - 8) * mul;
    long d = load64 (bytes, offset + length - 16) * K2;
    long y = rotateRight (a + b, 43) + rotateRight (c, 30) + d;
    long z = hashLength16 (y, a + rotateRight (b + K2, 18) + c, mul);
    long e = load64 (bytes, offset + 16) * mul;
    long f = load64 (bytes, offset + 24);
    long g = (y + load64 (bytes, offset + length - 32)) * mul;
    long h = (z + load64 (bytes, offset + length - 24)) * mul;
    return hashLength16 (rotateRight (e + f, 43) + rotateRight (g, 30) + h, e + rotateRight (f + a, 18) + g, mul);
}

private static long hashLength65Plus (byte [] bytes, int offset, int length) {
    final int seed = 81;
    long x = seed;
    @SuppressWarnings("ConstantOverflow")
    long y = seed * K1 + 113;
    long z = shiftMix (y * K2 + 113) * K2;
    long [] v = new long [2], w = new long [2];
    x = x * K2 + load64 (bytes, offset);
    int end = offset + ((length - 1) / 64) * 64;
    int last64offset = end + ((length - 1) & 63) - 63;
    do {
        x = rotateRight (x + y + v [0] + load64 (bytes, offset + 8), 37) * K1;
        y = rotateRight (y + v [1] + load64 (bytes, offset + 48), 42) * K1;
        x ^= w [1];
        y += v [0] + load64 (bytes, offset + 40);
        z = rotateRight (z + w [0], 33) * K1;
        weakHashLength32WithSeeds (bytes, offset, v [1] * K1, x + w [0], v);
        weakHashLength32WithSeeds (bytes, offset + 32, z + w [1], y + load64 (bytes, offset + 16), w);
        long tmp = x;
        x = z;
        z = tmp;
        offset += 64;
    } while (offset != end);
    long mul = K1 + ((z & 0xFF) << 1);
    offset = last64offset;
    w [0] += ((length - 1) & 63);
    v [0] += w [0];
    w [0] += v [0];
    x = rotateRight (x + y + v [0] + load64 (bytes, offset + 8), 37) * mul;
    y = rotateRight (y + v [1] + load64 (bytes, offset + 48), 42) * mul;
    x ^= w [1] * 9;
    y += v [0] * 9 + load64 (bytes, offset + 40);
    z = rotateRight (z + w [0], 33) * mul;
    weakHashLength32WithSeeds (bytes, offset, v [1] * mul, x + w [0], v);
    weakHashLength32WithSeeds (bytes, offset + 32, z + w [1], y + load64 (bytes, offset + 16), w);
    return hashLength16 (hashLength16 (v [0], w [0], mul) + shiftMix (y) * K0 + x, hashLength16 (v [1], w [1], mul) + z, mul);
}

SipHashFunction (int c, int d, long k0, long k1) {
    checkArgument (c > 0, "The number of SipRound iterations (c=%s) during Compression must be positive.", c);
    checkArgument (d > 0, "The number of SipRound iterations (d=%s) during Finalization must be positive.", d);
    this.c = c;
    this.d = d;
    this.k0 = k0;
    this.k1 = k1;
}

public int bits () {
    return 64;
}

public Hasher newHasher () {
    return new SipHasher (c, d, k0, k1);
}

public String toString () {
    return "Hashing.sipHash" + c + "" + d + "(" + k0 + ", " + k1 + ")";
}

public boolean equals (@Nullable
Object object) {
    if (object instanceof SipHashFunction) {
        SipHashFunction other = (SipHashFunction) object;
        return (c == other.c) && (d == other.d) && (k0 == other.k0) && (k1 == other.k1);
    }
    return false;
}

public int hashCode () {
    return (int) (getClass ().hashCode () ^ c ^ d ^ k0 ^ k1);
}

SipHasher (int c, int d, long k0, long k1) {
    super (CHUNK_SIZE);
    this.c = c;
    this.d = d;
    this.v0 ^= k0;
    this.v1 ^= k1;
    this.v2 ^= k0;
    this.v3 ^= k1;
}

protected void process (ByteBuffer buffer) {
    b += CHUNK_SIZE;
    processM (buffer.getLong ());
}

protected void processRemaining (ByteBuffer buffer) {
    b += buffer.remaining ();
    for (int i = 0;
    buffer.hasRemaining (); i += 8) {
        finalM ^= (buffer.get () & 0xFFL) << i;
    }
}

public HashCode makeHash () {
    finalM ^= b << 56;
    processM (finalM);
    v2 ^= 0xFFL;
    sipRound (d);
    return HashCode.fromLong (v0 ^ v1 ^ v2 ^ v3);
}

private void processM (long m) {
    v3 ^= m;
    sipRound (c);
    v0 ^= m;
}

private void sipRound (int iterations) {
    for (int i = 0;
    i < iterations; i ++) {
        v0 += v1;
        v2 += v3;
        v1 = Long.rotateLeft (v1, 13);
        v3 = Long.rotateLeft (v3, 16);
        v1 ^= v0;
        v3 ^= v2;
        v0 = Long.rotateLeft (v0, 32);
        v2 += v1;
        v0 += v3;
        v1 = Long.rotateLeft (v1, 17);
        v3 = Long.rotateLeft (v3, 21);
        v1 ^= v2;
        v3 ^= v0;
        v2 = Long.rotateLeft (v2, 32);
    }
}

protected void update (byte [] b) {
    update (b, 0, b.length);
}

protected void update (byte [] b, int off, int len) {
    for (int i = off;
    i < off + len; i ++) {
        update (b [i]);
    }
}

public Hasher putByte (byte b) {
    update (b);
    return this;
}

public Hasher putBytes (byte [] bytes) {
    checkNotNull (bytes);
    update (bytes);
    return this;
}

public Hasher putBytes (byte [] bytes, int off, int len) {
    checkPositionIndexes (off, off + len, bytes.length);
    update (bytes, off, len);
    return this;
}

private Hasher update (int bytes) {
    try {
        update (scratch.array (), 0, bytes);
    } finally {
        scratch.clear ();
    }
    return this;
}

public Hasher putShort (short s) {
    scratch.putShort (s);
    return update (Shorts.BYTES);
}

public Hasher putInt (int i) {
    scratch.putInt (i);
    return update (Ints.BYTES);
}

public Hasher putLong (long l) {
    scratch.putLong (l);
    return update (Longs.BYTES);
}

public Hasher putChar (char c) {
    scratch.putChar (c);
    return update (Chars.BYTES);
}

public < T > Hasher putObject (T instance, Funnel < ? super T > funnel) {
    funnel.funnel (instance, this);
    return this;
}

MacHashFunction (String algorithmName, Key key, String toString) {
    this.prototype = getMac (algorithmName, key);
    this.key = checkNotNull (key);
    this.toString = checkNotNull (toString);
    this.bits = prototype.getMacLength () * Byte.SIZE;
    this.supportsClone = supportsClone (prototype);
}

public int bits () {
    return bits;
}

private static boolean supportsClone (Mac mac) {
    try {
        mac.clone ();
        return true;
    } catch (CloneNotSupportedException e) {
        return false;
    }
}

private static Mac getMac (String algorithmName, Key key) {
    try {
        Mac mac = Mac.getInstance (algorithmName);
        mac.init (key);
        return mac;
    } catch (NoSuchAlgorithmException e) {
        throw new IllegalStateException (e);
    } catch (InvalidKeyException e) {
        throw new IllegalArgumentException (e);
    }
}

public Hasher newHasher () {
    if (supportsClone) {
        try {
            return new MacHasher ((Mac) prototype.clone ());
        } catch (CloneNotSupportedException e) {
        }
    }
    return new MacHasher (getMac (prototype.getAlgorithm (), key));
}

public String toString () {
    return toString;
}

private MacHasher (Mac mac) {
    this.mac = mac;
}

protected void update (byte b) {
    checkNotDone ();
    mac.update (b);
}

protected void update (byte [] b) {
    checkNotDone ();
    mac.update (b);
}

protected void update (byte [] b, int off, int len) {
    checkNotDone ();
    mac.update (b, off, len);
}

private void checkNotDone () {
    checkState (! done, "Cannot re-use a Hasher after calling hash() on it");
}

public HashCode hash () {
    checkNotDone ();
    done = true;
    return HashCode.fromBytesNoCopy (mac.doFinal ());
}

