static HashCode fromBytesNoCopy (byte [] bytes) {
    return new BytesHashCode (bytes);
}

BytesHashCode (byte [] bytes) {
    this.bytes = checkNotNull (bytes);
}

public int bits () {
    return bytes.length * 8;
}

public byte [] asBytes () {
    return bytes.clone ();
}

public int asInt () {
    checkState (bytes.length >= 4, "HashCode#asInt() requires >= 4 bytes (it only has %s bytes).", bytes.length);
    return (bytes [0] & 0xFF) | ((bytes [1] & 0xFF) << 8) | ((bytes [2] & 0xFF) << 16) | ((bytes [3] & 0xFF) << 24);
}

public long asLong () {
    checkState (bytes.length >= 8, "HashCode#asLong() requires >= 8 bytes (it only has %s bytes).", bytes.length);
    return padToLong ();
}

public long padToLong () {
    long retVal = (bytes [0] & 0xFF);
    for (int i = 1;
    i < Math.min (bytes.length, 8); i ++) {
        retVal |= (bytes [i] & 0xFFL) << (i * 8);
    }
    return retVal;
}

void writeBytesToImpl (byte [] dest, int offset, int maxLength) {
    System.arraycopy (bytes, 0, dest, offset, maxLength);
}

byte [] getBytesInternal () {
    return bytes;
}

boolean equalsSameBits (HashCode that) {
    if (this.bytes.length != that.getBytesInternal ().length) {
        return false;
    }
    boolean areEqual = true;
    for (int i = 0;
    i < this.bytes.length; i ++) {
        areEqual &= (this.bytes [i] == that.getBytesInternal () [i]);
    }
    return areEqual;
}

public static HashCode fromString (String string) {
    checkArgument (string.length () >= 2, "input string (%s) must have at least 2 characters", string);
    checkArgument (string.length () % 2 == 0, "input string (%s) must have an even number of characters", string);
    byte [] bytes = new byte [string.length () / 2];
    for (int i = 0;
    i < string.length (); i += 2) {
        int ch1 = decode (string.charAt (i)) << 4;
        int ch2 = decode (string.charAt (i + 1));
        bytes [i / 2] = (byte) (ch1 + ch2);
    }
    return fromBytesNoCopy (bytes);
}

private static int decode (char ch) {
    if (ch >= '0' && ch <= '9') {
        return ch - '0';
    }
    if (ch >= 'a' && ch <= 'f') {
        return ch - 'a' + 10;
    }
    throw new IllegalArgumentException ("Illegal hexadecimal character: " + ch);
}

public final boolean equals (@Nullable
Object object) {
    if (object instanceof HashCode) {
        HashCode that = (HashCode) object;
        return bits () == that.bits () && equalsSameBits (that);
    }
    return false;
}

public final int hashCode () {
    if (bits () >= 32) {
        return asInt ();
    }
    byte [] bytes = getBytesInternal ();
    int val = (bytes [0] & 0xFF);
    for (int i = 1;
    i < bytes.length; i ++) {
        val |= ((bytes [i] & 0xFF) << (i * 8));
    }
    return val;
}

public final String toString () {
    byte [] bytes = getBytesInternal ();
    StringBuilder sb = new StringBuilder (2 * bytes.length);
    for (byte b : bytes) {
        sb.append (hexDigits [(b>> 4) & 0xf]).append (hexDigits [b & 0xf]);
    }
    return sb.toString ();
}

private BloomFilter (BitArray bits, int numHashFunctions, Funnel < ? super T > funnel, Strategy strategy) {
    checkArgument (numHashFunctions > 0, "numHashFunctions (%s) must be > 0", numHashFunctions);
    checkArgument (numHashFunctions <= 255, "numHashFunctions (%s) must be <= 255", numHashFunctions);
    this.bits = checkNotNull (bits);
    this.numHashFunctions = numHashFunctions;
    this.funnel = checkNotNull (funnel);
    this.strategy = checkNotNull (strategy);
}

public BloomFilter < T > copy () {
    return new BloomFilter < T > (bits.copy (), numHashFunctions, funnel, strategy);
}

public boolean mightContain (T object) {
    return strategy.mightContain (object, funnel, numHashFunctions, bits);
}

public boolean apply (T input) {
    return mightContain (input);
}

public boolean put (T object) {
    return strategy.put (object, funnel, numHashFunctions, bits);
}

public double expectedFpp () {
    return Math.pow ((double) bits.bitCount () / bitSize (), numHashFunctions);
}

long bitSize () {
    return bits.bitSize ();
}

public boolean isCompatible (BloomFilter < T > that) {
    checkNotNull (that);
    return (this != that) && (this.numHashFunctions == that.numHashFunctions) && (this.bitSize () == that.bitSize ()) && (this.strategy.equals (that.strategy)) && (this.funnel.equals (that.funnel));
}

public void putAll (BloomFilter < T > that) {
    checkNotNull (that);
    checkArgument (this != that, "Cannot combine a BloomFilter with itself.");
    checkArgument (this.numHashFunctions == that.numHashFunctions, "BloomFilters must have the same number of hash functions (%s != %s)", this.numHashFunctions, that.numHashFunctions);
    checkArgument (this.bitSize () == that.bitSize (), "BloomFilters must have the same size underlying bit arrays (%s != %s)", this.bitSize (), that.bitSize ());
    checkArgument (this.strategy.equals (that.strategy), "BloomFilters must have equal strategies (%s != %s)", this.strategy, that.strategy);
    checkArgument (this.funnel.equals (that.funnel), "BloomFilters must have equal funnels (%s != %s)", this.funnel, that.funnel);
    this.bits.putAll (that.bits);
}

public boolean equals (@Nullable
Object object) {
    if (object == this) {
        return true;
    }
    if (object instanceof BloomFilter) {
        BloomFilter < ? > that = (BloomFilter < ? >) object;
        return this.numHashFunctions == that.numHashFunctions && this.funnel.equals (that.funnel) && this.bits.equals (that.bits) && this.strategy.equals (that.strategy);
    }
    return false;
}

public int hashCode () {
    return Objects.hashCode (numHashFunctions, funnel, strategy, bits);
}

public static < T > BloomFilter < T > create (Funnel < ? super T > funnel, int expectedInsertions, double fpp) {
    return create (funnel, (long) expectedInsertions, fpp);
}

public static < T > BloomFilter < T > create (Funnel < ? super T > funnel, long expectedInsertions, double fpp) {
    return create (funnel, expectedInsertions, fpp, BloomFilterStrategies.MURMUR128_MITZ_64);
}

static < T > BloomFilter < T > create (Funnel < ? super T > funnel, long expectedInsertions, double fpp, Strategy strategy) {
    checkNotNull (funnel);
    checkArgument (expectedInsertions >= 0, "Expected insertions (%s) must be >= 0", expectedInsertions);
    checkArgument (fpp > 0.0, "False positive probability (%s) must be > 0.0", fpp);
    checkArgument (fpp < 1.0, "False positive probability (%s) must be < 1.0", fpp);
    checkNotNull (strategy);
    if (expectedInsertions == 0) {
        expectedInsertions = 1;
    }
    long numBits = optimalNumOfBits (expectedInsertions, fpp);
    int numHashFunctions = optimalNumOfHashFunctions (expectedInsertions, numBits);
    try {
        return new BloomFilter < T > (new BitArray (numBits), numHashFunctions, funnel, strategy);
    } catch (IllegalArgumentException e) {
        throw new IllegalArgumentException ("Could not create BloomFilter of " + numBits + " bits", e);
    }
}

public static < T > BloomFilter < T > create (Funnel < ? super T > funnel, int expectedInsertions) {
    return create (funnel, (long) expectedInsertions);
}

public static < T > BloomFilter < T > create (Funnel < ? super T > funnel, long expectedInsertions) {
    return create (funnel, expectedInsertions, 0.03);
}

static int optimalNumOfHashFunctions (long n, long m) {
    return Math.max (1, (int) Math.round ((double) m / n * Math.log (2)));
}

static long optimalNumOfBits (long n, double p) {
    if (p == 0) {
        p = Double.MIN_VALUE;
    }
    return (long) (- n * Math.log (p) / (Math.log (2) * Math.log (2)));
}

private Object writeReplace () {
    return new SerialForm < T > (this);
}

SerialForm (BloomFilter < T > bf) {
    this.data = bf.bits.data;
    this.numHashFunctions = bf.numHashFunctions;
    this.funnel = bf.funnel;
    this.strategy = bf.strategy;
}

Object readResolve () {
    return new BloomFilter < T > (new BitArray (data), numHashFunctions, funnel, strategy);
}

public void writeTo (OutputStream out) throws IOException {
    DataOutputStream dout = new DataOutputStream (out);
    dout.writeByte (SignedBytes.checkedCast (strategy.ordinal ()));
    dout.writeByte (UnsignedBytes.checkedCast (numHashFunctions));
    dout.writeInt (bits.data.length);
    for (long value : bits.data) {
        dout.writeLong (value);
    }
}

public static < T > BloomFilter < T > readFrom (InputStream in, Funnel < T > funnel) throws IOException {
    checkNotNull (in, "InputStream");
    checkNotNull (funnel, "Funnel");
    int strategyOrdinal = - 1;
    int numHashFunctions = - 1;
    int dataLength = - 1;
    try {
        DataInputStream din = new DataInputStream (in);
        strategyOrdinal = din.readByte ();
        numHashFunctions = UnsignedBytes.toInt (din.readByte ());
        dataLength = din.readInt ();
        Strategy strategy = BloomFilterStrategies.values () [strategyOrdinal];
        long [] data = new long [dataLength];
        for (int i = 0;
        i < data.length; i ++) {
            data [i] = din.readLong ();
        }
        return new BloomFilter < T > (new BitArray (data), numHashFunctions, funnel, strategy);
    } catch (RuntimeException e) {
        String message = "Unable to deserialize BloomFilter from InputStream." + " strategyOrdinal: " + strategyOrdinal + " numHashFunctions: " + numHashFunctions + " dataLength: " + dataLength;
        throw new IOException (message, e);
    }
}

ChecksumHashFunction (Supplier < ? extends Checksum > checksumSupplier, int bits, String toString) {
    this.checksumSupplier = checkNotNull (checksumSupplier);
    checkArgument (bits == 32 || bits == 64, "bits (%s) must be either 32 or 64", bits);
    this.bits = bits;
    this.toString = checkNotNull (toString);
}

