Murmur3_32HashFunction (int seed) {
    this.seed = seed;
}

public int bits () {
    return 32;
}

public Hasher newHasher () {
    return new Murmur3_32Hasher (seed);
}

public String toString () {
    return "Hashing.murmur3_32(" + seed + ")";
}

public boolean equals (@Nullable
Object object) {
    if (object instanceof Murmur3_32HashFunction) {
        Murmur3_32HashFunction other = (Murmur3_32HashFunction) object;
        return seed == other.seed;
    }
    return false;
}

public int hashCode () {
    return getClass ().hashCode () ^ seed;
}

public HashCode hashInt (int input) {
    int k1 = mixK1 (input);
    int h1 = mixH1 (seed, k1);
    return fmix (h1, Ints.BYTES);
}

public HashCode hashLong (long input) {
    int low = (int) input;
    int high = (int) (input>>> 32);
    int k1 = mixK1 (low);
    int h1 = mixH1 (seed, k1);
    k1 = mixK1 (high);
    h1 = mixH1 (h1, k1);
    return fmix (h1, Longs.BYTES);
}

public HashCode hashUnencodedChars (CharSequence input) {
    int h1 = seed;
    for (int i = 1;
    i < input.length (); i += 2) {
        int k1 = input.charAt (i - 1) | (input.charAt (i) << 16);
        k1 = mixK1 (k1);
        h1 = mixH1 (h1, k1);
    }
    if ((input.length () & 1) == 1) {
        int k1 = input.charAt (input.length () - 1);
        k1 = mixK1 (k1);
        h1 ^= k1;
    }
    return fmix (h1, Chars.BYTES * input.length ());
}

private static int mixK1 (int k1) {
    k1 *= C1;
    k1 = Integer.rotateLeft (k1, 15);
    k1 *= C2;
    return k1;
}

private static int mixH1 (int h1, int k1) {
    h1 ^= k1;
    h1 = Integer.rotateLeft (h1, 13);
    h1 = h1 * 5 + 0xe6546b64;
    return h1;
}

private static HashCode fmix (int h1, int length) {
    h1 ^= length;
    h1 ^= h1>>> 16;
    h1 *= 0x85ebca6b;
    h1 ^= h1>>> 13;
    h1 *= 0xc2b2ae35;
    h1 ^= h1>>> 16;
    return HashCode.fromInt (h1);
}

Murmur3_32Hasher (int seed) {
    super (CHUNK_SIZE);
    this.h1 = seed;
    this.length = 0;
}

protected void process (ByteBuffer bb) {
    int k1 = Murmur3_32HashFunction.mixK1 (bb.getInt ());
    h1 = Murmur3_32HashFunction.mixH1 (h1, k1);
    length += CHUNK_SIZE;
}

protected void processRemaining (ByteBuffer bb) {
    length += bb.remaining ();
    int k1 = 0;
    for (int i = 0;
    bb.hasRemaining (); i += 8) {
        k1 ^= toInt (bb.get ()) << i;
    }
    h1 ^= Murmur3_32HashFunction.mixK1 (k1);
}

public HashCode makeHash () {
    return Murmur3_32HashFunction.fmix (h1, length);
}

