public long count () {
    return count;
}

public double mean () {
    checkState (count != 0);
    return mean;
}

public double sum () {
    return mean * count;
}

public double populationVariance () {
    checkState (count > 0);
    if (isNaN (sumOfSquaresOfDeltas)) {
        return NaN;
    }
    if (count == 1) {
        return 0.0;
    }
    return ensureNonNegative (sumOfSquaresOfDeltas) / count ();
}

public double populationStandardDeviation () {
    return Math.sqrt (populationVariance ());
}

public double sampleVariance () {
    checkState (count > 1);
    if (isNaN (sumOfSquaresOfDeltas)) {
        return NaN;
    }
    return ensureNonNegative (sumOfSquaresOfDeltas) / (count - 1);
}

public double sampleStandardDeviation () {
    return Math.sqrt (sampleVariance ());
}

public double min () {
    checkState (count != 0);
    return min;
}

public double max () {
    checkState (count != 0);
    return max;
}

public boolean equals (@Nullable
Object obj) {
    if (obj == null) {
        return false;
    }
    if (getClass () != obj.getClass ()) {
        return false;
    }
    Stats other = (Stats) obj;
    return (count == other.count) && (doubleToLongBits (mean) == doubleToLongBits (other.mean)) && (doubleToLongBits (sumOfSquaresOfDeltas) == doubleToLongBits (other.sumOfSquaresOfDeltas)) && (doubleToLongBits (min) == doubleToLongBits (other.min)) && (doubleToLongBits (max) == doubleToLongBits (other.max));
}

public int hashCode () {
    return Objects.hashCode (count, mean, sumOfSquaresOfDeltas, min, max);
}

public String toString () {
    if (count () > 0) {
        return MoreObjects.toStringHelper (this).add ("count", count).add ("mean", mean).add ("populationStandardDeviation", populationStandardDeviation ()).add ("min", min).add ("max", max).toString ();
    } else {
        return MoreObjects.toStringHelper (this).add ("count", count).toString ();
    }
}

double sumOfSquaresOfDeltas () {
    return sumOfSquaresOfDeltas;
}

public static double meanOf (Iterable < ? extends Number > values) {
    return meanOf (values.iterator ());
}

public static double meanOf (Iterator < ? extends Number > values) {
    checkArgument (values.hasNext ());
    long count = 1;
    double mean = values.next ().doubleValue ();
    while (values.hasNext ()) {
        double value = values.next ().doubleValue ();
        count ++;
        if (isFinite (value) && isFinite (mean)) {
            mean += (value - mean) / count;
        } else {
            mean = calculateNewMeanNonFinite (mean, value);
        }
    }
    return mean;
}

public static double meanOf (double...values) {
    checkArgument (values.length > 0);
    double mean = values [0];
    for (int index = 1;
    index < values.length; index ++) {
        double value = values [index];
        if (isFinite (value) && isFinite (mean)) {
            mean += (value - mean) / (index + 1);
        } else {
            mean = calculateNewMeanNonFinite (mean, value);
        }
    }
    return mean;
}

