static double roundIntermediate (double x, RoundingMode mode) {
    if (! isFinite (x)) {
        throw new ArithmeticException ("input is infinite or NaN");
    }
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (isMathematicalInteger (x));
            return x;
        case FLOOR :
            if (x >= 0.0 || isMathematicalInteger (x)) {
                return x;
            } else {
                return (long) x - 1;
            }
        case CEILING :
            if (x <= 0.0 || isMathematicalInteger (x)) {
                return x;
            } else {
                return (long) x + 1;
            }
        case DOWN :
            return x;
        case UP :
            if (isMathematicalInteger (x)) {
                return x;
            } else {
                return (long) x + (x > 0 ? 1 : - 1);
            }
        case HALF_EVEN :
            return rint (x);
        case HALF_UP :
            {
                double z = rint (x);
                if (abs (x - z) == 0.5) {
                    return x + copySign (0.5, x);
                } else {
                    return z;
                }
            } case HALF_DOWN :
            {
                double z = rint (x);
                if (abs (x - z) == 0.5) {
                    return x;
                } else {
                    return z;
                }
            } default :
            throw new AssertionError ();
    }
}

public static int roundToInt (double x, RoundingMode mode) {
    double z = roundIntermediate (x, mode);
    checkInRange (z > MIN_INT_AS_DOUBLE - 1.0 & z < MAX_INT_AS_DOUBLE + 1.0);
    return (int) z;
}

public static long roundToLong (double x, RoundingMode mode) {
    double z = roundIntermediate (x, mode);
    checkInRange (MIN_LONG_AS_DOUBLE - z < 1.0 & z < MAX_LONG_AS_DOUBLE_PLUS_ONE);
    return (long) z;
}

public static BigInteger roundToBigInteger (double x, RoundingMode mode) {
    x = roundIntermediate (x, mode);
    if (MIN_LONG_AS_DOUBLE - x < 1.0 & x < MAX_LONG_AS_DOUBLE_PLUS_ONE) {
        return BigInteger.valueOf ((long) x);
    }
    int exponent = getExponent (x);
    long significand = getSignificand (x);
    BigInteger result = BigInteger.valueOf (significand).shiftLeft (exponent - SIGNIFICAND_BITS);
    return (x < 0) ? result.negate () : result;
}

public static boolean isPowerOfTwo (double x) {
    return x > 0.0 && isFinite (x) && LongMath.isPowerOfTwo (getSignificand (x));
}

public static double log2 (double x) {
    return log (x) / LN_2;
}

public static int log2 (double x, RoundingMode mode) {
    checkArgument (x > 0.0 && isFinite (x), "x must be positive and finite");
    int exponent = getExponent (x);
    if (! isNormal (x)) {
        return log2 (x * IMPLICIT_BIT, mode) - SIGNIFICAND_BITS;
    }
    boolean increment;
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (isPowerOfTwo (x));
        case FLOOR :
            increment = false;
            break;
        case CEILING :
            increment = ! isPowerOfTwo (x);
            break;
        case DOWN :
            increment = exponent < 0 & ! isPowerOfTwo (x);
            break;
        case UP :
            increment = exponent >= 0 & ! isPowerOfTwo (x);
            break;
        case HALF_DOWN :
        case HALF_EVEN :
        case HALF_UP :
            double xScaled = scaleNormalize (x);
            increment = (xScaled * xScaled) > 2.0;
            break;
        default :
            throw new AssertionError ();
    }
    return increment ? exponent + 1 : exponent;
}

public static boolean isMathematicalInteger (double x) {
    return isFinite (x) && (x == 0.0 || SIGNIFICAND_BITS - Long.numberOfTrailingZeros (getSignificand (x)) <= getExponent (x));
}

public static double factorial (int n) {
    checkNonNegative ("n", n);
    if (n > MAX_FACTORIAL) {
        return Double.POSITIVE_INFINITY;
    } else {
        double accum = 1.0;
        for (int i = 1 + (n & ~ 0xf);
        i <= n; i ++) {
            accum *= i;
        }
        return accum * everySixteenthFactorial [n>> 4];
    }
}

public static boolean fuzzyEquals (double a, double b, double tolerance) {
    MathPreconditions.checkNonNegative ("tolerance", tolerance);
    return Math.copySign (a - b, 1.0) <= tolerance || (a == b) || (Double.isNaN (a) && Double.isNaN (b));
}

public static int fuzzyCompare (double a, double b, double tolerance) {
    if (fuzzyEquals (a, b, tolerance)) {
        return 0;
    } else if (a < b) {
        return - 1;
    } else if (a > b) {
        return 1;
    } else {
        return Booleans.compare (Double.isNaN (a), Double.isNaN (b));
    }

}

public static double mean (double...values) {
    checkArgument (values.length > 0, "Cannot take mean of 0 values");
    long count = 1;
    double mean = checkFinite (values [0]);
    for (int index = 1;
    index < values.length; ++ index) {
        checkFinite (values [index]);
        count ++;
        mean += (values [index] - mean) / count;
    }
    return mean;
}

public static double mean (int...values) {
    checkArgument (values.length > 0, "Cannot take mean of 0 values");
    long sum = 0;
    for (int index = 0;
    index < values.length; ++ index) {
        sum += values [index];
    }
    return (double) sum / values.length;
}

public static double mean (long...values) {
    checkArgument (values.length > 0, "Cannot take mean of 0 values");
    long count = 1;
    double mean = values [0];
    for (int index = 1;
    index < values.length; ++ index) {
        count ++;
        mean += (values [index] - mean) / count;
    }
    return mean;
}

public static double mean (Iterable < ? extends Number > values) {
    return mean (values.iterator ());
}

public static double mean (Iterator < ? extends Number > values) {
    checkArgument (values.hasNext (), "Cannot take mean of 0 values");
    long count = 1;
    double mean = checkFinite (values.next ().doubleValue ());
    while (values.hasNext ()) {
        double value = checkFinite (values.next ().doubleValue ());
        count ++;
        mean += (value - mean) / count;
    }
    return mean;
}

private static double checkFinite (double argument) {
    checkArgument (isFinite (argument));
    return argument;
}

PairedStats (Stats xStats, Stats yStats, double sumOfProductsOfDeltas) {
    this.xStats = xStats;
    this.yStats = yStats;
    this.sumOfProductsOfDeltas = sumOfProductsOfDeltas;
}

public long count () {
    return xStats.count ();
}

public Stats xStats () {
    return xStats;
}

public Stats yStats () {
    return yStats;
}

public double populationCovariance () {
    checkState (count () != 0);
    return sumOfProductsOfDeltas / count ();
}

public double sampleCovariance () {
    checkState (count () > 1);
    return sumOfProductsOfDeltas / (count () - 1);
}

public double pearsonsCorrelationCoefficient () {
    checkState (count () > 1);
    if (isNaN (sumOfProductsOfDeltas)) {
        return NaN;
    }
    double xSumOfSquaresOfDeltas = xStats ().sumOfSquaresOfDeltas ();
    double ySumOfSquaresOfDeltas = yStats ().sumOfSquaresOfDeltas ();
    checkState (xSumOfSquaresOfDeltas > 0.0);
    checkState (ySumOfSquaresOfDeltas > 0.0);
    double productOfSumsOfSquaresOfDeltas = ensurePositive (xSumOfSquaresOfDeltas * ySumOfSquaresOfDeltas);
    return ensureInUnitRange (sumOfProductsOfDeltas / Math.sqrt (productOfSumsOfSquaresOfDeltas));
}

public LinearTransformation leastSquaresFit () {
    checkState (count () > 1);
    if (isNaN (sumOfProductsOfDeltas)) {
        return LinearTransformation.forNaN ();
    }
    double xSumOfSquaresOfDeltas = xStats.sumOfSquaresOfDeltas ();
    if (xSumOfSquaresOfDeltas > 0.0) {
        if (yStats.sumOfSquaresOfDeltas () > 0.0) {
            return LinearTransformation.mapping (xStats.mean (), yStats.mean ()).withSlope (sumOfProductsOfDeltas / xSumOfSquaresOfDeltas);
        } else {
            return LinearTransformation.horizontal (yStats.mean ());
        }
    } else {
        checkState (yStats.sumOfSquaresOfDeltas () > 0.0);
        return LinearTransformation.vertical (xStats.mean ());
    }
}

public boolean equals (@Nullable
Object obj) {
    if (obj == null) {
        return false;
    }
    if (getClass () != obj.getClass ()) {
        return false;
    }
    PairedStats other = (PairedStats) obj;
    return (xStats.equals (other.xStats)) && (yStats.equals (other.yStats)) && (doubleToLongBits (sumOfProductsOfDeltas) == doubleToLongBits (other.sumOfProductsOfDeltas));
}

public int hashCode () {
    return Objects.hashCode (xStats, yStats, sumOfProductsOfDeltas);
}

public String toString () {
    if (count () > 0) {
        return MoreObjects.toStringHelper (this).add ("xStats", xStats).add ("yStats", yStats).add ("populationCovariance", populationCovariance ()).toString ();
    } else {
        return MoreObjects.toStringHelper (this).add ("xStats", xStats).add ("yStats", yStats).toString ();
    }
}

double sumOfProductsOfDeltas () {
    return sumOfProductsOfDeltas;
}

private static double ensurePositive (double value) {
    if (value > 0.0) {
        return value;
    } else {
        return Double.MIN_VALUE;
    }
}

private static double ensureInUnitRange (double value) {
    if (value >= 1.0) {
        return 1.0;
    }
    if (value <= - 1.0) {
        return - 1.0;
    }
    return value;
}

