    ByteBuffer buffer = ByteBuffer.allocate (BYTES).order (ByteOrder.LITTLE_ENDIAN);
    xStats.writeTo (buffer);
    yStats.writeTo (buffer);
    buffer.putDouble (sumOfProductsOfDeltas);
    return buffer.array ();
}

public static PairedStats fromByteArray (byte [] byteArray) {
    checkNotNull (byteArray);
    checkArgument (byteArray.length == BYTES, "Expected PairedStats.BYTES = %s, got %s", BYTES, byteArray.length);
    ByteBuffer buffer = ByteBuffer.wrap (byteArray).order (ByteOrder.LITTLE_ENDIAN);
    Stats xStats = Stats.readFrom (buffer);
    Stats yStats = Stats.readFrom (buffer);
    double sumOfProductsOfDeltas = buffer.getDouble ();
    return new PairedStats (xStats, yStats, sumOfProductsOfDeltas);
}

public void add (double value) {
    if (count == 0) {
        count = 1;
        mean = value;
        min = value;
        max = value;
        if (! isFinite (value)) {
            sumOfSquaresOfDeltas = NaN;
        }
    } else {
        count ++;
        if (isFinite (value) && isFinite (mean)) {
            double delta = value - mean;
            mean += delta / count;
            sumOfSquaresOfDeltas += delta * (value - mean);
        } else {
            mean = calculateNewMeanNonFinite (mean, value);
            sumOfSquaresOfDeltas = NaN;
        }
        min = Math.min (min, value);
        max = Math.max (max, value);
    }
}

public void addAll (Iterable < ? extends Number > values) {
    for (Number value : values) {
        add (value.doubleValue ());
    }
}

public void addAll (Iterator < ? extends Number > values) {
    while (values.hasNext ()) {
        add (values.next ().doubleValue ());
    }
}

public void addAll (double...values) {
    for (double value : values) {
        add (value);
    }
}

public void addAll (int...values) {
    for (int value : values) {
        add (value);
    }
}

public void addAll (long...values) {
    for (long value : values) {
        add (value);
    }
}

public void addAll (Stats values) {
    if (values.count () == 0) {
        return;
    }
    if (count == 0) {
        count = values.count ();
        mean = values.mean ();
        sumOfSquaresOfDeltas = values.sumOfSquaresOfDeltas ();
        min = values.min ();
        max = values.max ();
    } else {
        count += values.count ();
        if (isFinite (mean) && isFinite (values.mean ())) {
            double delta = values.mean () - mean;
            mean += delta * values.count () / count;
            sumOfSquaresOfDeltas += values.sumOfSquaresOfDeltas () + delta * (values.mean () - mean) * values.count ();
        } else {
            mean = calculateNewMeanNonFinite (mean, values.mean ());
            sumOfSquaresOfDeltas = NaN;
        }
        min = Math.min (min, values.min ());
        max = Math.max (max, values.max ());
    }
}

public Stats snapshot () {
    return new Stats (count, mean, sumOfSquaresOfDeltas, min, max);
}

