    return new ScaleAndIndexes (scale, Ints.toArray (indexes));
}

private ScaleAndIndex (int scale, int index) {
    checkIndex (index, scale);
    this.scale = scale;
    this.index = index;
}

public double compute (Collection < ? extends Number > dataset) {
    return computeInPlace (Doubles.toArray (dataset));
}

public double compute (double...dataset) {
    return computeInPlace (dataset.clone ());
}

public double compute (long...dataset) {
    return computeInPlace (longsToDoubles (dataset));
}

public double compute (int...dataset) {
    return computeInPlace (intsToDoubles (dataset));
}

public double computeInPlace (double...dataset) {
    checkArgument (dataset.length > 0, "Cannot calculate quantiles of an empty dataset");
    if (containsNaN (dataset)) {
        return NaN;
    }
    long numerator = (long) index * (dataset.length - 1);
    int quotient = (int) LongMath.divide (numerator, scale, RoundingMode.DOWN);
    int remainder = (int) (numerator - (long) quotient * scale);
    selectInPlace (quotient, dataset, 0, dataset.length - 1);
    if (remainder == 0) {
        return dataset [quotient];
    } else {
        selectInPlace (quotient + 1, dataset, quotient + 1, dataset.length - 1);
        return interpolate (dataset [quotient], dataset [quotient + 1], remainder, scale);
    }
}

private ScaleAndIndexes (int scale, int [] indexes) {
    for (int index : indexes) {
        checkIndex (index, scale);
    }
    this.scale = scale;
    this.indexes = indexes;
}

public Map < Integer, Double > compute (Collection < ? extends Number > dataset) {
    return computeInPlace (Doubles.toArray (dataset));
}

public Map < Integer, Double > compute (double...dataset) {
    return computeInPlace (dataset.clone ());
}

public Map < Integer, Double > compute (long...dataset) {
    return computeInPlace (longsToDoubles (dataset));
}

public Map < Integer, Double > compute (int...dataset) {
    return computeInPlace (intsToDoubles (dataset));
}

public Map < Integer, Double > computeInPlace (double...dataset) {
    checkArgument (dataset.length > 0, "Cannot calculate quantiles of an empty dataset");
    if (containsNaN (dataset)) {
        Map < Integer, Double > nanMap = new HashMap < Integer, Double > ();
        for (int index : indexes) {
            nanMap.put (index, NaN);
        }
        return unmodifiableMap (nanMap);
    }
    int [] quotients = new int [indexes.length];
    int [] remainders = new int [indexes.length];
    int [] requiredSelections = new int [indexes.length * 2];
    int requiredSelectionsCount = 0;
    for (int i = 0;
    i < indexes.length; i ++) {
        long numerator = (long) indexes [i] * (dataset.length - 1);
        int quotient = (int) LongMath.divide (numerator, scale, RoundingMode.DOWN);
        int remainder = (int) (numerator - (long) quotient * scale);
        quotients [i] = quotient;
        remainders [i] = remainder;
        requiredSelections [requiredSelectionsCount] = quotient;
        requiredSelectionsCount ++;
        if (remainder != 0) {
            requiredSelections [requiredSelectionsCount] = quotient + 1;
            requiredSelectionsCount ++;
        }
    }
    sort (requiredSelections, 0, requiredSelectionsCount);
    selectAllInPlace (requiredSelections, 0, requiredSelectionsCount - 1, dataset, 0, dataset.length - 1);
    Map < Integer, Double > ret = new HashMap < Integer, Double > ();
    for (int i = 0;
    i < indexes.length; i ++) {
        int quotient = quotients [i];
        int remainder = remainders [i];
        if (remainder == 0) {
            ret.put (indexes [i], dataset [quotient]);
        } else {
            ret.put (indexes [i], interpolate (dataset [quotient], dataset [quotient + 1], remainder, scale));
        }
    }
    return unmodifiableMap (ret);
}

private static boolean containsNaN (double...dataset) {
    for (double value : dataset) {
        if (Double.isNaN (value)) {
            return true;
        }
    }
    return false;
}

private static double interpolate (double lower, double upper, double remainder, double scale) {
    if (lower == NEGATIVE_INFINITY) {
        if (upper == POSITIVE_INFINITY) {
            return NaN;
        }
        return NEGATIVE_INFINITY;
    }
    if (upper == POSITIVE_INFINITY) {
        return POSITIVE_INFINITY;
    }
    return lower + (upper - lower) * remainder / scale;
}

private static void checkIndex (int index, int scale) {
    if (index < 0 || index > scale) {
        throw new IllegalArgumentException ("Quantile indexes must be between 0 and the scale, which is " + scale);
    }
}

private static double [] longsToDoubles (long [] longs) {
    int len = longs.length;
    double [] doubles = new double [len];
    for (int i = 0;
    i < len; i ++) {
        doubles [i] = longs [i];
    }
    return doubles;
}

private static double [] intsToDoubles (int [] ints) {
    int len = ints.length;
    double [] doubles = new double [len];
    for (int i = 0;
    i < len; i ++) {
        doubles [i] = ints [i];
    }
    return doubles;
}

private static void selectInPlace (int required, double [] array, int from, int to) {
    if (required == from) {
        int min = from;
        for (int index = from + 1;
        index <= to; index ++) {
            if (array [min] > array [index]) {
                min = index;
            }
        }
        if (min != from) {
            swap (array, min, from);
        }
        return;
    }
    while (to > from) {
        int partitionPoint = partition (array, from, to);
        if (partitionPoint >= required) {
            to = partitionPoint - 1;
        }
        if (partitionPoint <= required) {
            from = partitionPoint + 1;
        }
    }
}

private static int partition (double [] array, int from, int to) {
    movePivotToStartOfSlice (array, from, to);
    double pivot = array [from];
    int partitionPoint = to;
    for (int i = to;
    i > from; i --) {
        if (array [i] > pivot) {
            swap (array, partitionPoint, i);
            partitionPoint --;
        }
    }
    swap (array, from, partitionPoint);
    return partitionPoint;
}

private static void movePivotToStartOfSlice (double [] array, int from, int to) {
    int mid = (from + to)>>> 1;
    boolean toLessThanMid = (array [to] < array [mid]);
    boolean midLessThanFrom = (array [mid] < array [from]);
    boolean toLessThanFrom = (array [to] < array [from]);
    if (toLessThanMid == midLessThanFrom) {
        swap (array, mid, from);
    } else if (toLessThanMid != toLessThanFrom) {
        swap (array, from, to);
    }

}

private static void selectAllInPlace (int [] allRequired, int requiredFrom, int requiredTo, double [] array, int from, int to) {
    int requiredChosen = chooseNextSelection (allRequired, requiredFrom, requiredTo, from, to);
    int required = allRequired [requiredChosen];
    selectInPlace (required, array, from, to);
    int requiredBelow = requiredChosen - 1;
    while (requiredBelow >= requiredFrom && allRequired [requiredBelow] == required) {
        requiredBelow --;
    }
    if (requiredBelow >= requiredFrom) {
        selectAllInPlace (allRequired, requiredFrom, requiredBelow, array, from, required - 1);
    }
    int requiredAbove = requiredChosen + 1;
    while (requiredAbove <= requiredTo && allRequired [requiredAbove] == required) {
        requiredAbove ++;
    }
    if (requiredAbove <= requiredTo) {
        selectAllInPlace (allRequired, requiredAbove, requiredTo, array, required + 1, to);
    }
}

private static int chooseNextSelection (int [] allRequired, int requiredFrom, int requiredTo, int from, int to) {
    if (requiredFrom == requiredTo) {
        return requiredFrom;
    }
    int centerFloor = (from + to)>>> 1;
    int low = requiredFrom;
    int high = requiredTo;
    while (high > low + 1) {
        int mid = (low + high)>>> 1;
        if (allRequired [mid] > centerFloor) {
            high = mid;
        } else if (allRequired [mid] < centerFloor) {
            low = mid;
        } else {
            return mid;
        }

    }
    if (from + to - allRequired [low] - allRequired [high] > 0) {
        return high;
    } else {
        return low;
    }
}

private static void swap (double [] array, int i, int j) {
    double temp = array [i];
    array [i] = array [j];
    array [j] = temp;
}

public void add (double x, double y) {
    xStats.add (x);
    if (isFinite (x) && isFinite (y)) {
        if (xStats.count () > 1) {
            sumOfProductsOfDeltas += (x - xStats.mean ()) * (y - yStats.mean ());
        }
    } else {
        sumOfProductsOfDeltas = NaN;
    }
    yStats.add (y);
}

public void addAll (PairedStats values) {
    if (values.count () == 0) {
        return;
    }
    xStats.addAll (values.xStats ());
    if (yStats.count () == 0) {
        sumOfProductsOfDeltas = values.sumOfProductsOfDeltas ();
    } else {
        sumOfProductsOfDeltas += values.sumOfProductsOfDeltas () + (values.xStats ().mean () - xStats.mean ()) * (values.yStats ().mean () - yStats.mean ()) * values.count ();
    }
    yStats.addAll (values.yStats ());
}

public PairedStats snapshot () {
    return new PairedStats (xStats.snapshot (), yStats.snapshot (), sumOfProductsOfDeltas);
}

public long count () {
    return xStats.count ();
}

public Stats xStats () {
    return xStats.snapshot ();
}

public Stats yStats () {
    return yStats.snapshot ();
}

public double populationCovariance () {
    checkState (count () != 0);
    return sumOfProductsOfDeltas / count ();
}

public final double sampleCovariance () {
    checkState (count () > 1);
    return sumOfProductsOfDeltas / (count () - 1);
}

public final double pearsonsCorrelationCoefficient () {
    checkState (count () > 1);
    if (isNaN (sumOfProductsOfDeltas)) {
        return NaN;
    }
    double xSumOfSquaresOfDeltas = xStats.sumOfSquaresOfDeltas ();
    double ySumOfSquaresOfDeltas = yStats.sumOfSquaresOfDeltas ();
    checkState (xSumOfSquaresOfDeltas > 0.0);
    checkState (ySumOfSquaresOfDeltas > 0.0);
    double productOfSumsOfSquaresOfDeltas = ensurePositive (xSumOfSquaresOfDeltas * ySumOfSquaresOfDeltas);
    return ensureInUnitRange (sumOfProductsOfDeltas / Math.sqrt (productOfSumsOfSquaresOfDeltas));
}

public final LinearTransformation leastSquaresFit () {
    checkState (count () > 1);
    if (isNaN (sumOfProductsOfDeltas)) {
        return LinearTransformation.forNaN ();
    }
    double xSumOfSquaresOfDeltas = xStats.sumOfSquaresOfDeltas ();
    if (xSumOfSquaresOfDeltas > 0.0) {
        if (yStats.sumOfSquaresOfDeltas () > 0.0) {
            return LinearTransformation.mapping (xStats.mean (), yStats.mean ()).withSlope (sumOfProductsOfDeltas / xSumOfSquaresOfDeltas);
        } else {
            return LinearTransformation.horizontal (yStats.mean ());
        }
    } else {
        checkState (yStats.sumOfSquaresOfDeltas () > 0.0);
        return LinearTransformation.vertical (xStats.mean ());
    }
}

private double ensurePositive (double value) {
    if (value > 0.0) {
        return value;
    } else {
        return Double.MIN_VALUE;
    }
}

private static double ensureInUnitRange (double value) {
    if (value >= 1.0) {
        return 1.0;
    }
    if (value <= - 1.0) {
        return - 1.0;
    }
    return value;
}

static double nextDown (double d) {
    return - Math.nextUp (- d);
}

static long getSignificand (double d) {
    checkArgument (isFinite (d), "not a normal value");
    int exponent = getExponent (d);
    long bits = doubleToRawLongBits (d);
    bits &= SIGNIFICAND_MASK;
    return (exponent == MIN_EXPONENT - 1) ? bits << 1 : bits | IMPLICIT_BIT;
}

static boolean isFinite (double d) {
    return getExponent (d) <= MAX_EXPONENT;
}

static boolean isNormal (double d) {
    return getExponent (d) >= MIN_EXPONENT;
}

static double scaleNormalize (double x) {
    long significand = doubleToRawLongBits (x) & SIGNIFICAND_MASK;
    return longBitsToDouble (significand | ONE_BITS);
}

static double bigToDouble (BigInteger x) {
    BigInteger absX = x.abs ();
    int exponent = absX.bitLength () - 1;
    if (exponent < Long.SIZE - 1) {
        return x.longValue ();
    } else if (exponent > MAX_EXPONENT) {
        return x.signum () * POSITIVE_INFINITY;
    }

    int shift = exponent - SIGNIFICAND_BITS - 1;
    long twiceSignifFloor = absX.shiftRight (shift).longValue ();
    long signifFloor = twiceSignifFloor>> 1;
    signifFloor &= SIGNIFICAND_MASK;
    boolean increment = (twiceSignifFloor & 1) != 0 && ((signifFloor & 1) != 0 || absX.getLowestSetBit () < shift);
    long signifRounded = increment ? signifFloor + 1 : signifFloor;
    long bits = (long) ((exponent + EXPONENT_BIAS)) << SIGNIFICAND_BITS;
    bits += signifRounded;
    bits |= x.signum () & SIGN_MASK;
    return longBitsToDouble (bits);
}

static double ensureNonNegative (double value) {
    checkArgument (! isNaN (value));
    if (value > 0.0) {
        return value;
    } else {
        return 0.0;
    }
}

public static int ceilingPowerOfTwo (int x) {
    checkPositive ("x", x);
    if (x > MAX_SIGNED_POWER_OF_TWO) {
        throw new ArithmeticException ("ceilingPowerOfTwo(" + x + ") not representable as an int");
    }
    return 1 << - Integer.numberOfLeadingZeros (x - 1);
}

public static int floorPowerOfTwo (int x) {
    checkPositive ("x", x);
    return Integer.highestOneBit (x);
}

public static boolean isPowerOfTwo (int x) {
    return x > 0 & (x & (x - 1)) == 0;
}

static int lessThanBranchFree (int x, int y) {
    return ~ ~ (x - y)>>> (Integer.SIZE - 1);
}

public static int log2 (int x, RoundingMode mode) {
    checkPositive ("x", x);
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (isPowerOfTwo (x));
        case DOWN :
        case FLOOR :
            return (Integer.SIZE - 1) - Integer.numberOfLeadingZeros (x);
        case UP :
        case CEILING :
            return Integer.SIZE - Integer.numberOfLeadingZeros (x - 1);
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            int leadingZeros = Integer.numberOfLeadingZeros (x);
            int cmp = MAX_POWER_OF_SQRT2_UNSIGNED>>> leadingZeros;
            int logFloor = (Integer.SIZE - 1) - leadingZeros;
            return logFloor + lessThanBranchFree (cmp, x);
        default :
            throw new AssertionError ();
    }
}

public static int log10 (int x, RoundingMode mode) {
    checkPositive ("x", x);
    int logFloor = log10Floor (x);
    int floorPow = powersOf10 [logFloor];
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (x == floorPow);
        case FLOOR :
        case DOWN :
            return logFloor;
        case CEILING :
        case UP :
            return logFloor + lessThanBranchFree (floorPow, x);
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            return logFloor + lessThanBranchFree (halfPowersOf10 [logFloor], x);
        default :
            throw new AssertionError ();
    }
}

private static int log10Floor (int x) {
    int y = maxLog10ForLeadingZeros [Integer.numberOfLeadingZeros (x)];
    return y - lessThanBranchFree (x, powersOf10 [y]);
}

public static int pow (int b, int k) {
    checkNonNegative ("exponent", k);
    switch (b) {
        case 0 :
            return (k == 0) ? 1 : 0;
        case 1 :
            return 1;
        case (- 1) :
            return ((k & 1) == 0) ? 1 : - 1;
        case 2 :
            return (k < Integer.SIZE) ? (1 << k) : 0;
        case (- 2) :
            if (k < Integer.SIZE) {
                return ((k & 1) == 0) ? (1 << k) : - (1 << k);
            } else {
                return 0;
            }
        default :
    }
    for (int accum = 1;
    ; k>>= 1) {
        switch (k) {
            case 0 :
                return accum;
            case 1 :
                return b * accum;
            default :
                accum *= ((k & 1) == 0) ? 1 : b;
                b *= b;
        }
    }
}

public static int sqrt (int x, RoundingMode mode) {
    checkNonNegative ("x", x);
    int sqrtFloor = sqrtFloor (x);
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (sqrtFloor * sqrtFloor == x);
        case FLOOR :
        case DOWN :
            return sqrtFloor;
        case CEILING :
        case UP :
            return sqrtFloor + lessThanBranchFree (sqrtFloor * sqrtFloor, x);
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            int halfSquare = sqrtFloor * sqrtFloor + sqrtFloor;
            return sqrtFloor + lessThanBranchFree (halfSquare, x);
        default :
            throw new AssertionError ();
    }
}

private static int sqrtFloor (int x) {
    return (int) Math.sqrt (x);
}

public static int divide (int p, int q, RoundingMode mode) {
    checkNotNull (mode);
    if (q == 0) {
        throw new ArithmeticException ("/ by zero");
    }
    int div = p / q;
    int rem = p - q * div;
    if (rem == 0) {
        return div;
    }
    int signum = 1 | ((p ^ q)>> (Integer.SIZE - 1));
    boolean increment;
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (rem == 0);
        case DOWN :
            increment = false;
            break;
        case UP :
            increment = true;
            break;
        case CEILING :
            increment = signum > 0;
            break;
        case FLOOR :
            increment = signum < 0;
            break;
        case HALF_EVEN :
        case HALF_DOWN :
        case HALF_UP :
            int absRem = abs (rem);
            int cmpRemToHalfDivisor = absRem - (abs (q) - absRem);
            if (cmpRemToHalfDivisor == 0) {
                increment = (mode == HALF_UP || (mode == HALF_EVEN & (div & 1) != 0));
            } else {
                increment = cmpRemToHalfDivisor > 0;
            }
            break;
        default :
            throw new AssertionError ();
    }
    return increment ? div + signum : div;
}

public static int mod (int x, int m) {
    if (m <= 0) {
        throw new ArithmeticException ("Modulus " + m + " must be > 0");
    }
    int result = x % m;
    return (result >= 0) ? result : result + m;
}

public static int gcd (int a, int b) {
    checkNonNegative ("a", a);
    checkNonNegative ("b", b);
    if (a == 0) {
        return b;
    } else if (b == 0) {
        return a;
    }

    int aTwos = Integer.numberOfTrailingZeros (a);
    a>>= aTwos;
    int bTwos = Integer.numberOfTrailingZeros (b);
    b>>= bTwos;
    while (a != b) {
        int delta = a - b;
        int minDeltaOrZero = delta & (delta>> (Integer.SIZE - 1));
        a = delta - minDeltaOrZero - minDeltaOrZero;
        b += minDeltaOrZero;
        a>>= Integer.numberOfTrailingZeros (a);
    }
    return a << min (aTwos, bTwos);
}

public static int checkedAdd (int a, int b) {
    long result = (long) a + b;
    checkNoOverflow (result == (int) result);
    return (int) result;
}

public static int checkedSubtract (int a, int b) {
    long result = (long) a - b;
    checkNoOverflow (result == (int) result);
    return (int) result;
}

public static int checkedMultiply (int a, int b) {
    long result = (long) a * b;
    checkNoOverflow (result == (int) result);
    return (int) result;
}

public static int checkedPow (int b, int k) {
    checkNonNegative ("exponent", k);
    switch (b) {
        case 0 :
            return (k == 0) ? 1 : 0;
        case 1 :
            return 1;
        case (- 1) :
            return ((k & 1) == 0) ? 1 : - 1;
        case 2 :
            checkNoOverflow (k < Integer.SIZE - 1);
            return 1 << k;
        case (- 2) :
            checkNoOverflow (k < Integer.SIZE);
            return ((k & 1) == 0) ? 1 << k : - 1 << k;
        default :
    }
    int accum = 1;
    while (true) {
        switch (k) {
            case 0 :
                return accum;
            case 1 :
                return checkedMultiply (accum, b);
            default :
                if ((k & 1) != 0) {
                    accum = checkedMultiply (accum, b);
                }
                k>>= 1;
                if (k > 0) {
                    checkNoOverflow (- FLOOR_SQRT_MAX_INT <= b & b <= FLOOR_SQRT_MAX_INT);
                    b *= b;
                }
        }
    }
}

public static int saturatedAdd (int a, int b) {
    return Ints.saturatedCast ((long) a + b);
}

public static int saturatedSubtract (int a, int b) {
    return Ints.saturatedCast ((long) a - b);
}

public static int saturatedMultiply (int a, int b) {
    return Ints.saturatedCast ((long) a * b);
}

public static int saturatedPow (int b, int k) {
    checkNonNegative ("exponent", k);
    switch (b) {
        case 0 :
            return (k == 0) ? 1 : 0;
        case 1 :
            return 1;
        case (- 1) :
            return ((k & 1) == 0) ? 1 : - 1;
        case 2 :
            if (k >= Integer.SIZE - 1) {
                return Integer.MAX_VALUE;
            }
            return 1 << k;
        case (- 2) :
            if (k >= Integer.SIZE) {
                return Integer.MAX_VALUE + (k & 1);
            }
            return ((k & 1) == 0) ? 1 << k : - 1 << k;
        default :
    }
    int accum = 1;
    int limit = Integer.MAX_VALUE + ((b>>> Integer.SIZE - 1) & (k & 1));
    while (true) {
        switch (k) {
            case 0 :
                return accum;
            case 1 :
                return saturatedMultiply (accum, b);
            default :
                if ((k & 1) != 0) {
                    accum = saturatedMultiply (accum, b);
                }
                k>>= 1;
                if (k > 0) {
                    if (- FLOOR_SQRT_MAX_INT > b | b > FLOOR_SQRT_MAX_INT) {
                        return limit;
                    }
                    b *= b;
                }
        }
    }
}

public static int factorial (int n) {
    checkNonNegative ("n", n);
    return (n < factorials.length) ? factorials [n] : Integer.MAX_VALUE;
}

public static int binomial (int n, int k) {
    checkNonNegative ("n", n);
    checkNonNegative ("k", k);
    checkArgument (k <= n, "k (%s) > n (%s)", k, n);
    if (k > (n>> 1)) {
        k = n - k;
    }
    if (k >= biggestBinomials.length || n > biggestBinomials [k]) {
        return Integer.MAX_VALUE;
    }
    switch (k) {
        case 0 :
            return 1;
        case 1 :
            return n;
        default :
            long result = 1;
            for (int i = 0;
            i < k; i ++) {
                result *= n - i;
                result /= i + 1;
            }
            return (int) result;
    }
}

public static int mean (int x, int y) {
    return (x & y) + ((x ^ y)>> 1);
}

public static boolean isPrime (int n) {
    return LongMath.isPrime (n);
}

public static BigInteger ceilingPowerOfTwo (BigInteger x) {
    return BigInteger.ZERO.setBit (log2 (x, RoundingMode.CEILING));
}

public static BigInteger floorPowerOfTwo (BigInteger x) {
    return BigInteger.ZERO.setBit (log2 (x, RoundingMode.FLOOR));
}

public static boolean isPowerOfTwo (BigInteger x) {
    checkNotNull (x);
    return x.signum () > 0 && x.getLowestSetBit () == x.bitLength () - 1;
}

public static int log2 (BigInteger x, RoundingMode mode) {
    checkPositive ("x", checkNotNull (x));
    int logFloor = x.bitLength () - 1;
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (isPowerOfTwo (x));
        case DOWN :
        case FLOOR :
            return logFloor;
        case UP :
        case CEILING :
            return isPowerOfTwo (x) ? logFloor : logFloor + 1;
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            if (logFloor < SQRT2_PRECOMPUTE_THRESHOLD) {
                BigInteger halfPower = SQRT2_PRECOMPUTED_BITS.shiftRight (SQRT2_PRECOMPUTE_THRESHOLD - logFloor);
                if (x.compareTo (halfPower) <= 0) {
                    return logFloor;
                } else {
                    return logFloor + 1;
                }
            }
            BigInteger x2 = x.pow (2);
            int logX2Floor = x2.bitLength () - 1;
            return (logX2Floor < 2 * logFloor + 1) ? logFloor : logFloor + 1;
        default :
            throw new AssertionError ();
    }
}

public static int log10 (BigInteger x, RoundingMode mode) {
    checkPositive ("x", x);
    if (fitsInLong (x)) {
        return LongMath.log10 (x.longValue (), mode);
    }
    int approxLog10 = (int) (log2 (x, FLOOR) * LN_2 / LN_10);
    BigInteger approxPow = BigInteger.TEN.pow (approxLog10);
    int approxCmp = approxPow.compareTo (x);
    if (approxCmp > 0) {
        do {
            approxLog10 --;
            approxPow = approxPow.divide (BigInteger.TEN);
            approxCmp = approxPow.compareTo (x);
        } while (approxCmp > 0);
    } else {
        BigInteger nextPow = BigInteger.TEN.multiply (approxPow);
        int nextCmp = nextPow.compareTo (x);
        while (nextCmp <= 0) {
            approxLog10 ++;
            approxPow = nextPow;
            approxCmp = nextCmp;
            nextPow = BigInteger.TEN.multiply (approxPow);
            nextCmp = nextPow.compareTo (x);
        }
    }
    int floorLog = approxLog10;
    BigInteger floorPow = approxPow;
    int floorCmp = approxCmp;
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (floorCmp == 0);
        case FLOOR :
        case DOWN :
            return floorLog;
        case CEILING :
        case UP :
            return floorPow.equals (x) ? floorLog : floorLog + 1;
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            BigInteger x2 = x.pow (2);
            BigInteger halfPowerSquared = floorPow.pow (2).multiply (BigInteger.TEN);
            return (x2.compareTo (halfPowerSquared) <= 0) ? floorLog : floorLog + 1;
        default :
            throw new AssertionError ();
    }
}

public static BigInteger sqrt (BigInteger x, RoundingMode mode) {
    checkNonNegative ("x", x);
    if (fitsInLong (x)) {
        return BigInteger.valueOf (LongMath.sqrt (x.longValue (), mode));
    }
    BigInteger sqrtFloor = sqrtFloor (x);
    switch (mode) {
        case UNNECESSARY :
            checkRoundingUnnecessary (sqrtFloor.pow (2).equals (x));
        case FLOOR :
        case DOWN :
            return sqrtFloor;
        case CEILING :
        case UP :
            int sqrtFloorInt = sqrtFloor.intValue ();
            boolean sqrtFloorIsExact = (sqrtFloorInt * sqrtFloorInt == x.intValue ()) && sqrtFloor.pow (2).equals (x);
            return sqrtFloorIsExact ? sqrtFloor : sqrtFloor.add (BigInteger.ONE);
        case HALF_DOWN :
        case HALF_UP :
        case HALF_EVEN :
            BigInteger halfSquare = sqrtFloor.pow (2).add (sqrtFloor);
            return (halfSquare.compareTo (x) >= 0) ? sqrtFloor : sqrtFloor.add (BigInteger.ONE);
        default :
            throw new AssertionError ();
    }
}

private static BigInteger sqrtFloor (BigInteger x) {
    BigInteger sqrt0;
    int log2 = log2 (x, FLOOR);
    if (log2 < Double.MAX_EXPONENT) {
        sqrt0 = sqrtApproxWithDoubles (x);
    } else {
        int shift = (log2 - DoubleUtils.SIGNIFICAND_BITS) & ~ 1;
        sqrt0 = sqrtApproxWithDoubles (x.shiftRight (shift)).shiftLeft (shift>> 1);
    }
    BigInteger sqrt1 = sqrt0.add (x.divide (sqrt0)).shiftRight (1);
    if (sqrt0.equals (sqrt1)) {
        return sqrt0;
    }
    do {
        sqrt0 = sqrt1;
        sqrt1 = sqrt0.add (x.divide (sqrt0)).shiftRight (1);
    } while (sqrt1.compareTo (sqrt0) < 0);
    return sqrt0;
}

private static BigInteger sqrtApproxWithDoubles (BigInteger x) {
    return DoubleMath.roundToBigInteger (Math.sqrt (DoubleUtils.bigToDouble (x)), HALF_EVEN);
}

public static BigInteger divide (BigInteger p, BigInteger q, RoundingMode mode) {
    BigDecimal pDec = new BigDecimal (p);
    BigDecimal qDec = new BigDecimal (q);
    return pDec.divide (qDec, 0, mode).toBigIntegerExact ();
}

public static BigInteger factorial (int n) {
    checkNonNegative ("n", n);
    if (n < LongMath.factorials.length) {
        return BigInteger.valueOf (LongMath.factorials [n]);
    }
    int approxSize = IntMath.divide (n * IntMath.log2 (n, CEILING), Long.SIZE, CEILING);
    ArrayList < BigInteger > bignums = new ArrayList < BigInteger > (approxSize);
    int startingNumber = LongMath.factorials.length;
    long product = LongMath.factorials [startingNumber - 1];
    int shift = Long.numberOfTrailingZeros (product);
    product>>= shift;
    int productBits = LongMath.log2 (product, FLOOR) + 1;
    int bits = LongMath.log2 (startingNumber, FLOOR) + 1;
    int nextPowerOfTwo = 1 << (bits - 1);
    for (long num = startingNumber;
    num <= n; num ++) {
        if ((num & nextPowerOfTwo) != 0) {
            nextPowerOfTwo <<= 1;
            bits ++;
        }
        int tz = Long.numberOfTrailingZeros (num);
        long normalizedNum = num>> tz;
        shift += tz;
        int normalizedBits = bits - tz;
        if (normalizedBits + productBits >= Long.SIZE) {
            bignums.add (BigInteger.valueOf (product));
            product = 1;
            productBits = 0;
        }
        product *= normalizedNum;
        productBits = LongMath.log2 (product, FLOOR) + 1;
    }
    if (product > 1) {
        bignums.add (BigInteger.valueOf (product));
    }
    return listProduct (bignums).shiftLeft (shift);
}

static BigInteger listProduct (List < BigInteger > nums) {
    return listProduct (nums, 0, nums.size ());
}

static BigInteger listProduct (List < BigInteger > nums, int start, int end) {
    switch (end - start) {
        case 0 :
            return BigInteger.ONE;
        case 1 :
            return nums.get (start);
        case 2 :
            return nums.get (start).multiply (nums.get (start + 1));
        case 3 :
            return nums.get (start).multiply (nums.get (start + 1)).multiply (nums.get (start + 2));
        default :
            int m = (end + start)>>> 1;
            return listProduct (nums, start, m).multiply (listProduct (nums, m, end));
    }
}

public static BigInteger binomial (int n, int k) {
    checkNonNegative ("n", n);
    checkNonNegative ("k", k);
    checkArgument (k <= n, "k (%s) > n (%s)", k, n);
    if (k > (n>> 1)) {
        k = n - k;
    }
    if (k < LongMath.biggestBinomials.length && n <= LongMath.biggestBinomials [k]) {
        return BigInteger.valueOf (LongMath.binomial (n, k));
    }
    BigInteger accum = BigInteger.ONE;
    long numeratorAccum = n;
    long denominatorAccum = 1;
    int bits = LongMath.log2 (n, RoundingMode.CEILING);
    int numeratorBits = bits;
    for (int i = 1;
    i < k; i ++) {
        int p = n - i;
        int q = i + 1;
        if (numeratorBits + bits >= Long.SIZE - 1) {
            accum = accum.multiply (BigInteger.valueOf (numeratorAccum)).divide (BigInteger.valueOf (denominatorAccum));
            numeratorAccum = p;
            denominatorAccum = q;
            numeratorBits = bits;
        } else {
            numeratorAccum *= p;
            denominatorAccum *= q;
            numeratorBits += bits;
        }
    }
    return accum.multiply (BigInteger.valueOf (numeratorAccum)).divide (BigInteger.valueOf (denominatorAccum));
}

static boolean fitsInLong (BigInteger x) {
    return x.bitLength () <= Long.SIZE - 1;
}

PredAndSucc (Object successorValue) {
    this.successorValue = successorValue;
}

private DirectedGraphConnections (Map < N, Object > adjacentNodeValues, int predecessorCount, int successorCount) {
    this.adjacentNodeValues = checkNotNull (adjacentNodeValues);
    this.predecessorCount = checkNonNegative (predecessorCount);
    this.successorCount = checkNonNegative (successorCount);
    checkState (predecessorCount <= adjacentNodeValues.size () && successorCount <= adjacentNodeValues.size ());
}

static < N, V > DirectedGraphConnections < N, V > of () {
    int initialCapacity = INNER_CAPACITY * 2;
    return new DirectedGraphConnections < N, V > (new HashMap < N, Object > (initialCapacity, INNER_LOAD_FACTOR), 0, 0);
}

static < N, V > DirectedGraphConnections < N, V > ofImmutable (Set < N > predecessors, Map < N, V > successorValues) {
    Map < N, Object > adjacentNodeValues = new HashMap < N, Object > ();
    adjacentNodeValues.putAll (successorValues);
    for (N predecessor : predecessors) {
        Object value = adjacentNodeValues.put (predecessor, PRED);
        if (value != null) {
            adjacentNodeValues.put (predecessor, new PredAndSucc (value));
        }
    }
    return new DirectedGraphConnections < N, V > (ImmutableMap.copyOf (adjacentNodeValues), predecessors.size (), successorValues.size ());
}

public Set < N > adjacentNodes () {
    return Collections.unmodifiableSet (adjacentNodeValues.keySet ());
}

public Set < N > predecessors () {
    return new AbstractSet < N > () {
        @Override
        public UnmodifiableIterator < N > iterator () {
            final Iterator < Entry < N, Object > > entries = adjacentNodeValues.entrySet ().iterator ();
            return new AbstractIterator < N > () {
                @Override
                protected N computeNext () {
                    while (entries.hasNext ()) {
                        Entry < N, Object > entry = entries.next ();
                        if (isPredecessor (entry.getValue ())) {
                            return entry.getKey ();
                        }
                    }
                    return endOfData ();
                }}

            ;
        }@Override
        public int size () {
            return predecessorCount;
        }@Override
        public boolean contains (@Nullable
        Object obj) {
            return isPredecessor (adjacentNodeValues.get (obj));
        }}

    ;
}

public UnmodifiableIterator < N > iterator () {
    final Iterator < Entry < N, Object > > entries = adjacentNodeValues.entrySet ().iterator ();
    return new AbstractIterator < N > () {
        @Override
        protected N computeNext () {
            while (entries.hasNext ()) {
                Entry < N, Object > entry = entries.next ();
                if (isPredecessor (entry.getValue ())) {
                    return entry.getKey ();
                }
            }
            return endOfData ();
        }}

    ;
}

protected N computeNext () {
    while (entries.hasNext ()) {
        Entry < N, Object > entry = entries.next ();
        if (isPredecessor (entry.getValue ())) {
            return entry.getKey ();
        }
    }
    return endOfData ();
}

public int size () {
    return predecessorCount;
}

public boolean contains (@Nullable
Object obj) {
    return isPredecessor (adjacentNodeValues.get (obj));
}

public Set < N > successors () {
    return new AbstractSet < N > () {
        @Override
        public UnmodifiableIterator < N > iterator () {
            final Iterator < Entry < N, Object > > entries = adjacentNodeValues.entrySet ().iterator ();
            return new AbstractIterator < N > () {
                @Override
                protected N computeNext () {
                    while (entries.hasNext ()) {
                        Entry < N, Object > entry = entries.next ();
                        if (isSuccessor (entry.getValue ())) {
                            return entry.getKey ();
                        }
                    }
                    return endOfData ();
                }}

            ;
        }@Override
        public int size () {
            return successorCount;
        }@Override
        public boolean contains (@Nullable
        Object obj) {
            return isSuccessor (adjacentNodeValues.get (obj));
        }}

    ;
}

public UnmodifiableIterator < N > iterator () {
    final Iterator < Entry < N, Object > > entries = adjacentNodeValues.entrySet ().iterator ();
    return new AbstractIterator < N > () {
        @Override
        protected N computeNext () {
            while (entries.hasNext ()) {
                Entry < N, Object > entry = entries.next ();
                if (isSuccessor (entry.getValue ())) {
                    return entry.getKey ();
                }
            }
            return endOfData ();
        }}

    ;
}

protected N computeNext () {
    while (entries.hasNext ()) {
        Entry < N, Object > entry = entries.next ();
        if (isSuccessor (entry.getValue ())) {
            return entry.getKey ();
        }
    }
    return endOfData ();
}

public int size () {
    return successorCount;
}

public boolean contains (@Nullable
Object obj) {
    return isSuccessor (adjacentNodeValues.get (obj));
}

public V value (Object node) {
    Object value = adjacentNodeValues.get (node);
    if (value == PRED) {
        return null;
    }
    if (value instanceof PredAndSucc) {
        return (V) ((PredAndSucc) value).successorValue;
    }
    return (V) value;
}

public void removePredecessor (Object node) {
    Object previousValue = adjacentNodeValues.get (node);
    if (previousValue == PRED) {
        adjacentNodeValues.remove (node);
        checkNonNegative (-- predecessorCount);
    } else if (previousValue instanceof PredAndSucc) {
        adjacentNodeValues.put ((N) node, ((PredAndSucc) previousValue).successorValue);
        checkNonNegative (-- predecessorCount);
    }

}

public V removeSuccessor (Object node) {
    Object previousValue = adjacentNodeValues.get (node);
    if (previousValue == null || previousValue == PRED) {
        return null;
    } else if (previousValue instanceof PredAndSucc) {
        adjacentNodeValues.put ((N) node, PRED);
        checkNonNegative (-- successorCount);
        return (V) ((PredAndSucc) previousValue).successorValue;
    } else {
        adjacentNodeValues.remove (node);
        checkNonNegative (-- successorCount);
        return (V) previousValue;
    }

}

public void addPredecessor (N node, V unused) {
    Object previousValue = adjacentNodeValues.put (node, PRED);
    if (previousValue == null) {
        checkPositive (++ predecessorCount);
    } else if (previousValue instanceof PredAndSucc) {
        adjacentNodeValues.put (node, previousValue);
    } else if (previousValue != PRED) {
        adjacentNodeValues.put (node, new PredAndSucc (previousValue));
        checkPositive (++ predecessorCount);
    }

}

public V addSuccessor (N node, V value) {
    Object previousValue = adjacentNodeValues.put (node, value);
    if (previousValue == null) {
        checkPositive (++ successorCount);
        return null;
    } else if (previousValue instanceof PredAndSucc) {
        adjacentNodeValues.put (node, new PredAndSucc (value));
        return (V) ((PredAndSucc) previousValue).successorValue;
    } else if (previousValue == PRED) {
        adjacentNodeValues.put (node, new PredAndSucc (value));
        checkPositive (++ successorCount);
        return null;
    } else {
        return (V) previousValue;
    }

}

private static boolean isPredecessor (@Nullable
Object value) {
    return (value == PRED) || (value instanceof PredAndSucc);
}

private static boolean isSuccessor (@Nullable
Object value) {
    return (value != PRED) && (value != null);
}

static < N > EndpointPairIterator < N > of (Graph < N > graph) {
    return graph.isDirected () ? new Directed < N > (graph) : new Undirected < N > (graph);
}

private EndpointPairIterator (Graph < N > graph) {
    this.graph = graph;
    this.nodeIterator = graph.nodes ().iterator ();
}

protected final boolean advance () {
    checkState (! successorIterator.hasNext ());
    if (! nodeIterator.hasNext ()) {
        return false;
    }
    node = nodeIterator.next ();
    successorIterator = graph.successors (node).iterator ();
    return true;
}

private Directed (Graph < N > graph) {
    super (graph);
}

protected EndpointPair < N > computeNext () {
    while (true) {
        if (successorIterator.hasNext ()) {
            return EndpointPair.ordered (node, successorIterator.next ());
        }
        if (! advance ()) {
            return endOfData ();
        }
    }
}

private Undirected (Graph < N > graph) {
    super (graph);
    this.visitedNodes = Sets.newHashSetWithExpectedSize (graph.nodes ().size ());
}

protected EndpointPair < N > computeNext () {
    while (true) {
        while (successorIterator.hasNext ()) {
            N otherNode = successorIterator.next ();
            if (! visitedNodes.contains (otherNode)) {
                return EndpointPair.unordered (node, otherNode);
            }
        }
        visitedNodes.add (node);
        if (! advance ()) {
            visitedNodes = null;
            return endOfData ();
        }
    }
}

