public static boolean hasCycle (Graph < ? > graph) {
    int numEdges = graph.edges ().size ();
    if (numEdges == 0) {
        return false;
    }
    if (! graph.isDirected () && numEdges >= graph.nodes ().size ()) {
        return true;
    }
    Map < Object, NodeVisitState > visitedNodes = Maps.newHashMapWithExpectedSize (graph.nodes ().size ());
    for (Object node : graph.nodes ()) {
        if (subgraphHasCycle (graph, visitedNodes, node, null)) {
            return true;
        }
    }
    return false;
}

public static boolean hasCycle (Network < ?, ? > network) {
    if (! network.isDirected () && network.allowsParallelEdges () && network.edges ().size () > network.asGraph ().edges ().size ()) {
        return true;
    }
    return hasCycle (network.asGraph ());
}

private static boolean subgraphHasCycle (Graph < ? > graph, Map < Object, NodeVisitState > visitedNodes, Object node,@Nullable
Object previousNode) {
    NodeVisitState state = visitedNodes.get (node);
    if (state == NodeVisitState.COMPLETE) {
        return false;
    }
    if (state == NodeVisitState.PENDING) {
        return true;
    }
    visitedNodes.put (node, NodeVisitState.PENDING);
    for (Object nextNode : graph.successors (node)) {
        if (canTraverseWithoutReusingEdge (graph, nextNode, previousNode) && subgraphHasCycle (graph, visitedNodes, nextNode, node)) {
            return true;
        }
    }
    visitedNodes.put (node, NodeVisitState.COMPLETE);
    return false;
}

private static boolean canTraverseWithoutReusingEdge (Graph < ? > graph, Object nextNode,@Nullable
Object previousNode) {
    if (graph.isDirected () || ! Objects.equal (previousNode, nextNode)) {
        return true;
    }
    return false;
}

public static < N > Graph < N > transitiveClosure (Graph < N > graph) {
    MutableGraph < N > transitiveClosure = GraphBuilder.from (graph).allowsSelfLoops (true).build ();
    if (graph.isDirected ()) {
        for (N node : graph.nodes ()) {
            for (N reachableNode : reachableNodes (graph, node)) {
                transitiveClosure.putEdge (node, reachableNode);
            }
        }
    } else {
        Set < N > visitedNodes = new HashSet < N > ();
        for (N node : graph.nodes ()) {
            if (! visitedNodes.contains (node)) {
                Set < N > reachableNodes = reachableNodes (graph, node);
                visitedNodes.addAll (reachableNodes);
                int pairwiseMatch = 1;
                for (N nodeU : reachableNodes) {
                    for (N nodeV : Iterables.limit (reachableNodes, pairwiseMatch ++)) {
                        transitiveClosure.putEdge (nodeU, nodeV);
                    }
                }
            }
        }
    }
    return transitiveClosure;
}

public static < N > Set < N > reachableNodes (Graph < N > graph, Object node) {
    checkArgument (graph.nodes ().contains (node), NODE_NOT_IN_GRAPH, node);
    Set < N > visitedNodes = new LinkedHashSet < N > ();
    Queue < N > queuedNodes = new ArrayDeque < N > ();
    visitedNodes.add ((N) node);
    queuedNodes.add ((N) node);
    while (! queuedNodes.isEmpty ()) {
        N currentNode = queuedNodes.remove ();
        for (N successor : graph.successors (currentNode)) {
            if (visitedNodes.add (successor)) {
                queuedNodes.add (successor);
            }
        }
    }
    return Collections.unmodifiableSet (visitedNodes);
}

public static boolean equivalent (@Nullable
Graph < ? > graphA,@Nullable
Graph < ? > graphB) {
    if (graphA == graphB) {
        return true;
    }
    if (graphA == null || graphB == null) {
        return false;
    }
    return graphA.isDirected () == graphB.isDirected () && graphA.nodes ().equals (graphB.nodes ()) && graphA.edges ().equals (graphB.edges ());
}

public static boolean equivalent (@Nullable
ValueGraph < ?, ? > graphA,@Nullable
ValueGraph < ?, ? > graphB) {
    if (graphA == graphB) {
        return true;
    }
    if (graphA == null || graphB == null) {
        return false;
    }
    if (graphA.isDirected () != graphB.isDirected () || ! graphA.nodes ().equals (graphB.nodes ()) || ! graphA.edges ().equals (graphB.edges ())) {
        return false;
    }
    for (EndpointPair < ? > edge : graphA.edges ()) {
        if (! graphA.edgeValue (edge.nodeU (), edge.nodeV ()).equals (graphB.edgeValue (edge.nodeU (), edge.nodeV ()))) {
            return false;
        }
    }
    return true;
}

public static boolean equivalent (@Nullable
Network < ?, ? > networkA,@Nullable
Network < ?, ? > networkB) {
    if (networkA == networkB) {
        return true;
    }
    if (networkA == null || networkB == null) {
        return false;
    }
    if (networkA.isDirected () != networkB.isDirected () || ! networkA.nodes ().equals (networkB.nodes ()) || ! networkA.edges ().equals (networkB.edges ())) {
        return false;
    }
    for (Object edge : networkA.edges ()) {
        if (! networkA.incidentNodes (edge).equals (networkB.incidentNodes (edge))) {
            return false;
        }
    }
    return true;
}

