static < N, E > UndirectedMultiNetworkConnections < N, E > of () {
    return new UndirectedMultiNetworkConnections < N, E > (new HashMap < E, N > (INNER_CAPACITY, INNER_LOAD_FACTOR));
}

static < N, E > UndirectedMultiNetworkConnections < N, E > ofImmutable (Map < E, N > incidentEdges) {
    return new UndirectedMultiNetworkConnections < N, E > (ImmutableMap.copyOf (incidentEdges));
}

public Set < N > adjacentNodes () {
    return Collections.unmodifiableSet (adjacentNodesMultiset ().elementSet ());
}

private Multiset < N > adjacentNodesMultiset () {
    Multiset < N > adjacentNodes = getReference (adjacentNodesReference);
    if (adjacentNodes == null) {
        adjacentNodes = HashMultiset.create (incidentEdgeMap.values ());
        adjacentNodesReference = new SoftReference < Multiset < N > > (adjacentNodes);
    }
    return adjacentNodes;
}

public Set < E > edgesConnecting (final Object node) {
    return new MultiEdgesConnecting < E > (incidentEdgeMap, node) {
        @Override
        public int size () {
            return adjacentNodesMultiset ().count (node);
        }}

    ;
}

public int size () {
    return adjacentNodesMultiset ().count (node);
}

public N removeInEdge (Object edge, boolean isSelfLoop) {
    if (! isSelfLoop) {
        return removeOutEdge (edge);
    }
    return null;
}

public N removeOutEdge (Object edge) {
    N node = super.removeOutEdge (edge);
    Multiset < N > adjacentNodes = getReference (adjacentNodesReference);
    if (adjacentNodes != null) {
        checkState (adjacentNodes.remove (node));
    }
    return node;
}

public void addInEdge (E edge, N node, boolean isSelfLoop) {
    if (! isSelfLoop) {
        addOutEdge (edge, node);
    }
}

public void addOutEdge (E edge, N node) {
    super.addOutEdge (edge, node);
    Multiset < N > adjacentNodes = getReference (adjacentNodesReference);
    if (adjacentNodes != null) {
        checkState (adjacentNodes.add (node));
    }
}

private static < T > T getReference (@Nullable
Reference < T > reference) {
    return (reference == null) ? null : reference.get ();
}

public static < N > ImmutableGraph < N > copyOf (Graph < N > graph) {
    return (graph instanceof ImmutableGraph) ? (ImmutableGraph < N >) graph : new ValueBackedImpl < N, Presence > (GraphBuilder.from (graph), getNodeConnections (graph), graph.edges ().size ());
}

public static < N > ImmutableGraph < N > copyOf (ImmutableGraph < N > graph) {
    return checkNotNull (graph);
}

private static < N > ImmutableMap < N, GraphConnections < N, Presence > > getNodeConnections (Graph < N > graph) {
    ImmutableMap.Builder < N, GraphConnections < N, Presence > > nodeConnections = ImmutableMap.builder ();
    for (N node : graph.nodes ()) {
        nodeConnections.put (node, connectionsOf (graph, node));
    }
    return nodeConnections.build ();
}

private static < N > GraphConnections < N, Presence > connectionsOf (Graph < N > graph, N node) {
    Function < Object, Presence > edgeValueFn = Functions.constant (Presence.EDGE_EXISTS);
    return graph.isDirected () ? DirectedGraphConnections.ofImmutable (graph.predecessors (node), Maps.asMap (graph.successors (node), edgeValueFn)) : UndirectedGraphConnections.ofImmutable (Maps.asMap (graph.adjacentNodes (node), edgeValueFn));
}

