ConfigurableValueGraph (AbstractGraphBuilder < ? super N > builder) {
    this (builder, builder.nodeOrder.< N, GraphConnections < N, V > > createMap (builder.expectedNodeCount.or (DEFAULT_NODE_COUNT)), 0L);
