ConfigurableValueGraph (AbstractGraphBuilder < ? super N > builder, Map < N, GraphConnections < N, V > > nodeConnections, long edgeCount) {
    this.isDirected = builder.directed;
    this.allowsSelfLoops = builder.allowsSelfLoops;
    this.nodeOrder = builder.nodeOrder.cast ();
    this.nodeConnections = (nodeConnections instanceof TreeMap) ? new MapRetrievalCache < N, GraphConnections < N, V > > (nodeConnections) : new MapIteratorCache < N, GraphConnections < N, V > > (nodeConnections);
    this.edgeCount = checkNonNegative (edgeCount);
}

public Set < N > nodes () {
    return nodeConnections.unmodifiableKeySet ();
}

public boolean isDirected () {
    return isDirected;
}

public boolean allowsSelfLoops () {
    return allowsSelfLoops;
}

public ElementOrder < N > nodeOrder () {
    return nodeOrder;
}

public Set < N > adjacentNodes (Object node) {
    return checkedConnections (node).adjacentNodes ();
}

public Set < N > predecessors (Object node) {
    return checkedConnections (node).predecessors ();
}

public Set < N > successors (Object node) {
    return checkedConnections (node).successors ();
}

public V edgeValueOrDefault (Object nodeU, Object nodeV,@Nullable
V defaultValue) {
    GraphConnections < N, V > connectionsU = nodeConnections.get (nodeU);
    if (connectionsU == null) {
        return defaultValue;
    }
    V value = connectionsU.value (nodeV);
    if (value == null) {
        return defaultValue;
    }
    return value;
}

protected long edgeCount () {
    return edgeCount;
}

protected final GraphConnections < N, V > checkedConnections (Object node) {
    GraphConnections < N, V > connections = nodeConnections.get (node);
    if (connections == null) {
        checkNotNull (node);
        throw new IllegalArgumentException (String.format (NODE_NOT_IN_GRAPH, node));
    }
    return connections;
}

protected final boolean containsNode (@Nullable
Object node) {
    return nodeConnections.containsKey (node);
}

public V edgeValue (Object nodeU, Object nodeV) {
    V value = edgeValueOrDefault (nodeU, nodeV, null);
    if (value == null) {
        checkArgument (nodes ().contains (nodeU), NODE_NOT_IN_GRAPH, nodeU);
        checkArgument (nodes ().contains (nodeV), NODE_NOT_IN_GRAPH, nodeV);
        throw new IllegalArgumentException (String.format (EDGE_CONNECTING_NOT_IN_GRAPH, nodeU, nodeV));
    }
    return value;
}

public String toString () {
    String propertiesString = String.format ("isDirected: %s, allowsSelfLoops: %s", isDirected (), allowsSelfLoops ());
    return String.format (GRAPH_STRING_FORMAT, propertiesString, nodes (), edgeValueMap ());
}

private Map < EndpointPair < N >, V > edgeValueMap () {
    Function < EndpointPair < N >, V > edgeToValueFn = new Function < EndpointPair < N >, V > () {
        @Override
        public V apply (EndpointPair < N > edge) {
            return edgeValue (edge.nodeU (), edge.nodeV ());
        }}

    ;
    return Maps.asMap (edges (), edgeToValueFn);
}

public V apply (EndpointPair < N > edge) {
    return edgeValue (edge.nodeU (), edge.nodeV ());
}

private EndpointPair (N nodeU, N nodeV) {
    this.nodeU = checkNotNull (nodeU);
    this.nodeV = checkNotNull (nodeV);
}

public static < N > EndpointPair < N > ordered (N source, N target) {
    return new Ordered < N > (source, target);
}

public static < N > EndpointPair < N > unordered (N nodeU, N nodeV) {
    return new Unordered < N > (nodeV, nodeU);
}

static < N > EndpointPair < N > of (Graph < ? > graph, N nodeU, N nodeV) {
    return graph.isDirected () ? ordered (nodeU, nodeV) : unordered (nodeU, nodeV);
}

static < N > EndpointPair < N > of (Network < ?, ? > network, N nodeU, N nodeV) {
    return network.isDirected () ? ordered (nodeU, nodeV) : unordered (nodeU, nodeV);
}

public final N nodeU () {
    return nodeU;
}

public final N nodeV () {
    return nodeV;
}

public final N adjacentNode (Object node) {
    if (node.equals (nodeU)) {
        return nodeV;
    } else if (node.equals (nodeV)) {
        return nodeU;
    } else {
        throw new IllegalArgumentException (String.format ("EndpointPair %s does not contain node %s", this, node));
    }

}

public final UnmodifiableIterator < N > iterator () {
    return Iterators.forArray (nodeU, nodeV);
}

private Ordered (N source, N target) {
    super (source, target);
}

public N source () {
    return nodeU ();
}

public N target () {
    return nodeV ();
}

public boolean isOrdered () {
    return true;
}

public boolean equals (@Nullable
Object obj) {
    if (obj == this) {
        return true;
    }
    if (! (obj instanceof EndpointPair)) {
        return false;
    }
    EndpointPair < ? > other = (EndpointPair < ? >) obj;
    if (isOrdered () != other.isOrdered ()) {
        return false;
    }
    return source ().equals (other.source ()) && target ().equals (other.target ());
}

public int hashCode () {
    return Objects.hashCode (source (), target ());
}

public String toString () {
    return String.format ("<%s -> %s>", source (), target ());
}

private Unordered (N nodeU, N nodeV) {
    super (nodeU, nodeV);
}

public N source () {
    throw new UnsupportedOperationException (NOT_AVAILABLE_ON_UNDIRECTED);
}

public N target () {
    throw new UnsupportedOperationException (NOT_AVAILABLE_ON_UNDIRECTED);
}

public boolean isOrdered () {
    return false;
}

public boolean equals (@Nullable
Object obj) {
    if (obj == this) {
        return true;
    }
    if (! (obj instanceof EndpointPair)) {
        return false;
    }
    EndpointPair < ? > other = (EndpointPair < ? >) obj;
    if (isOrdered () != other.isOrdered ()) {
        return false;
    }
    if (nodeU ().equals (other.nodeU ())) {
        return nodeV ().equals (other.nodeV ());
    }
    return nodeU ().equals (other.nodeV ()) && nodeV ().equals (other.nodeU ());
}

public int hashCode () {
    return nodeU ().hashCode () + nodeV ().hashCode ();
}

public String toString () {
    return String.format ("[%s, %s]", nodeU (), nodeV ());
}

protected AbstractDirectedNetworkConnections (Map < E, N > inEdgeMap, Map < E, N > outEdgeMap, int selfLoopCount) {
    this.inEdgeMap = checkNotNull (inEdgeMap);
    this.outEdgeMap = checkNotNull (outEdgeMap);
    this.selfLoopCount = checkNonNegative (selfLoopCount);
    checkState (selfLoopCount <= inEdgeMap.size () && selfLoopCount <= outEdgeMap.size ());
}

public Set < N > adjacentNodes () {
    return Sets.union (predecessors (), successors ());
}

public Set < E > incidentEdges () {
    return new AbstractSet < E > () {
        @Override
        public UnmodifiableIterator < E > iterator () {
            Iterable < E > incidentEdges = (selfLoopCount == 0) ? Iterables.concat (inEdgeMap.keySet (), outEdgeMap.keySet ()) : Sets.union (inEdgeMap.keySet (), outEdgeMap.keySet ());
            return Iterators.unmodifiableIterator (incidentEdges.iterator ());
        }@Override
        public int size () {
            return IntMath.saturatedAdd (inEdgeMap.size (), outEdgeMap.size () - selfLoopCount);
        }@Override
        public boolean contains (@Nullable
        Object obj) {
            return inEdgeMap.containsKey (obj) || outEdgeMap.containsKey (obj);
        }}

    ;
}

public UnmodifiableIterator < E > iterator () {
    Iterable < E > incidentEdges = (selfLoopCount == 0) ? Iterables.concat (inEdgeMap.keySet (), outEdgeMap.keySet ()) : Sets.union (inEdgeMap.keySet (), outEdgeMap.keySet ());
    return Iterators.unmodifiableIterator (incidentEdges.iterator ());
}

public int size () {
    return IntMath.saturatedAdd (inEdgeMap.size (), outEdgeMap.size () - selfLoopCount);
}

public boolean contains (@Nullable
Object obj) {
    return inEdgeMap.containsKey (obj) || outEdgeMap.containsKey (obj);
}

public Set < E > inEdges () {
    return Collections.unmodifiableSet (inEdgeMap.keySet ());
}

public Set < E > outEdges () {
    return Collections.unmodifiableSet (outEdgeMap.keySet ());
}

public N oppositeNode (Object edge) {
    return checkNotNull (outEdgeMap.get (edge));
}

public N removeInEdge (Object edge, boolean isSelfLoop) {
    if (isSelfLoop) {
        checkNonNegative (-- selfLoopCount);
    }
    N previousNode = inEdgeMap.remove (edge);
    return checkNotNull (previousNode);
}

public N removeOutEdge (Object edge) {
    N previousNode = outEdgeMap.remove (edge);
    return checkNotNull (previousNode);
}

public void addInEdge (E edge, N node, boolean isSelfLoop) {
    if (isSelfLoop) {
        checkPositive (++ selfLoopCount);
    }
    N previousNode = inEdgeMap.put (edge, node);
    checkState (previousNode == null);
}

public void addOutEdge (E edge, N node) {
    N previousNode = outEdgeMap.put (edge, node);
    checkState (previousNode == null);
}

ConfigurableNetwork (NetworkBuilder < ? super N, ? super E > builder) {
    this (builder, builder.nodeOrder.< N, NetworkConnections < N, E > > createMap (builder.expectedNodeCount.or (DEFAULT_NODE_COUNT)), builder.edgeOrder.< E, N > createMap (builder.expectedEdgeCount.or (DEFAULT_EDGE_COUNT)));
}

ConfigurableNetwork (NetworkBuilder < ? super N, ? super E > builder, Map < N, NetworkConnections < N, E > > nodeConnections, Map < E, N > edgeToReferenceNode) {
    this.isDirected = builder.directed;
    this.allowsParallelEdges = builder.allowsParallelEdges;
    this.allowsSelfLoops = builder.allowsSelfLoops;
    this.nodeOrder = builder.nodeOrder.cast ();
    this.edgeOrder = builder.edgeOrder.cast ();
    this.nodeConnections = (nodeConnections instanceof TreeMap) ? new MapRetrievalCache < N, NetworkConnections < N, E > > (nodeConnections) : new MapIteratorCache < N, NetworkConnections < N, E > > (nodeConnections);
    this.edgeToReferenceNode = new MapIteratorCache < E, N > (edgeToReferenceNode);
}

