public boolean addNode (N node) {
    checkNotNull (node, "node");
    if (containsNode (node)) {
        return false;
    }
    addNodeInternal (node);
    return true;
}

private NetworkConnections < N, E > addNodeInternal (N node) {
    NetworkConnections < N, E > connections = newConnections ();
    checkState (nodeConnections.put (node, connections) == null);
    return connections;
}

public boolean addEdge (N nodeU, N nodeV, E edge) {
    checkNotNull (nodeU, "nodeU");
    checkNotNull (nodeV, "nodeV");
    checkNotNull (edge, "edge");
    if (containsEdge (edge)) {
        EndpointPair < N > existingIncidentNodes = incidentNodes (edge);
        EndpointPair < N > newIncidentNodes = EndpointPair.of (this, nodeU, nodeV);
        checkArgument (existingIncidentNodes.equals (newIncidentNodes), REUSING_EDGE, edge, existingIncidentNodes, newIncidentNodes);
        return false;
    }
    NetworkConnections < N, E > connectionsU = nodeConnections.get (nodeU);
    if (! allowsParallelEdges ()) {
        checkArgument (! (connectionsU != null && connectionsU.successors ().contains (nodeV)), PARALLEL_EDGES_NOT_ALLOWED, nodeU, nodeV);
    }
    boolean isSelfLoop = nodeU.equals (nodeV);
    if (! allowsSelfLoops ()) {
        checkArgument (! isSelfLoop, SELF_LOOPS_NOT_ALLOWED, nodeU);
    }
    if (connectionsU == null) {
        connectionsU = addNodeInternal (nodeU);
    }
    connectionsU.addOutEdge (edge, nodeV);
    NetworkConnections < N, E > connectionsV = nodeConnections.get (nodeV);
    if (connectionsV == null) {
        connectionsV = addNodeInternal (nodeV);
    }
    connectionsV.addInEdge (edge, nodeU, isSelfLoop);
    edgeToReferenceNode.put (edge, nodeU);
    return true;
}

public boolean removeNode (Object node) {
    checkNotNull (node, "node");
    NetworkConnections < N, E > connections = nodeConnections.get (node);
    if (connections == null) {
        return false;
    }
    for (E edge : ImmutableList.copyOf (connections.incidentEdges ())) {
        removeEdge (edge);
    }
    nodeConnections.remove (node);
    return true;
}

public boolean removeEdge (Object edge) {
    checkNotNull (edge, "edge");
    N nodeU = edgeToReferenceNode.get (edge);
    if (nodeU == null) {
        return false;
    }
    NetworkConnections < N, E > connectionsU = nodeConnections.get (nodeU);
    N nodeV = connectionsU.oppositeNode (edge);
    NetworkConnections < N, E > connectionsV = nodeConnections.get (nodeV);
    connectionsU.removeOutEdge (edge);
    connectionsV.removeInEdge (edge, allowsSelfLoops () && nodeU.equals (nodeV));
    edgeToReferenceNode.remove (edge);
    return true;
}

private NetworkConnections < N, E > newConnections () {
    return isDirected () ? allowsParallelEdges () ? DirectedMultiNetworkConnections.< N, E > of () : DirectedNetworkConnections.< N, E > of () : allowsParallelEdges () ? UndirectedMultiNetworkConnections.< N, E > of () : UndirectedNetworkConnections.< N, E > of ();
}

protected long edgeCount () {
    long degreeSum = 0L;
    for (N node : nodes ()) {
        degreeSum += degree (node);
    }
    checkState ((degreeSum & 1) == 0);
    return degreeSum>>> 1;
}

public Set < EndpointPair < N > > edges () {
    return new AbstractSet < EndpointPair < N > > () {
        @Override
        public UnmodifiableIterator < EndpointPair < N > > iterator () {
            return EndpointPairIterator.of (AbstractGraph.this);
        }@Override
        public int size () {
            return Ints.saturatedCast (edgeCount ());
        }@Override
        public boolean contains (@Nullable
        Object obj) {
            if (! (obj instanceof EndpointPair)) {
                return false;
            }
            EndpointPair < ? > endpointPair = (EndpointPair < ? >) obj;
            return isDirected () == endpointPair.isOrdered () && nodes ().contains (endpointPair.nodeU ()) && successors (endpointPair.nodeU ()).contains (endpointPair.nodeV ());
        }}

    ;
}

public UnmodifiableIterator < EndpointPair < N > > iterator () {
    return EndpointPairIterator.of (AbstractGraph.this);
}

public int size () {
    return Ints.saturatedCast (edgeCount ());
}

public boolean contains (@Nullable
Object obj) {
    if (! (obj instanceof EndpointPair)) {
        return false;
    }
    EndpointPair < ? > endpointPair = (EndpointPair < ? >) obj;
    return isDirected () == endpointPair.isOrdered () && nodes ().contains (endpointPair.nodeU ()) && successors (endpointPair.nodeU ()).contains (endpointPair.nodeV ());
}

public int degree (Object node) {
    if (isDirected ()) {
        return IntMath.saturatedAdd (predecessors (node).size (), successors (node).size ());
    } else {
        Set < N > neighbors = adjacentNodes (node);
        int selfLoopCount = (allowsSelfLoops () && neighbors.contains (node)) ? 1 : 0;
        return IntMath.saturatedAdd (neighbors.size (), selfLoopCount);
    }
}

public int inDegree (Object node) {
    return isDirected () ? predecessors (node).size () : degree (node);
}

public int outDegree (Object node) {
    return isDirected () ? successors (node).size () : degree (node);
}

public String toString () {
    String propertiesString = String.format ("isDirected: %s, allowsSelfLoops: %s", isDirected (), allowsSelfLoops ());
    return String.format (GRAPH_STRING_FORMAT, propertiesString, nodes (), edges ());
}

