MapRetrievalCache (Map < K, V > backingMap) {
    super (backingMap);
}

public V get (@Nullable
Object key) {
    V value = getIfCached (key);
    if (value != null) {
        return value;
    }
    value = getWithoutCaching (key);
    if (value != null) {
        addToCache ((K) key, value);
    }
    return value;
}

protected V getIfCached (@Nullable
Object key) {
    V value = super.getIfCached (key);
    if (value != null) {
        return value;
    }
    CacheEntry < K, V > entry;
    entry = cacheEntry1;
    if (entry != null && entry.key == key) {
        return entry.value;
    }
    entry = cacheEntry2;
    if (entry != null && entry.key == key) {
        addToCache (entry);
        return entry.value;
    }
    return null;
}

protected void clearCache () {
    super.clearCache ();
    cacheEntry1 = null;
    cacheEntry2 = null;
}

private void addToCache (K key, V value) {
    addToCache (new CacheEntry < K, V > (key, value));
}

private void addToCache (CacheEntry < K, V > entry) {
    cacheEntry2 = cacheEntry1;
    cacheEntry1 = entry;
}

CacheEntry (K key, V value) {
    this.key = key;
    this.value = value;
}

MultiEdgesConnecting (Map < E, ? > outEdgeToNode, Object targetNode) {
    this.outEdgeToNode = checkNotNull (outEdgeToNode);
    this.targetNode = checkNotNull (targetNode);
}

public UnmodifiableIterator < E > iterator () {
    final Iterator < ? extends Entry < E, ? > > entries = outEdgeToNode.entrySet ().iterator ();
    return new AbstractIterator < E > () {
        @Override
        protected E computeNext () {
            while (entries.hasNext ()) {
                Entry < E, ? > entry = entries.next ();
                if (targetNode.equals (entry.getValue ())) {
                    return entry.getKey ();
                }
            }
            return endOfData ();
        }}

    ;
}

protected E computeNext () {
    while (entries.hasNext ()) {
        Entry < E, ? > entry = entries.next ();
        if (targetNode.equals (entry.getValue ())) {
            return entry.getKey ();
        }
    }
    return endOfData ();
}

public boolean contains (@Nullable
Object edge) {
    return targetNode.equals (outEdgeToNode.get (edge));
}

