    long result = 0L;
    for (ByteSource source : sources) {
        Optional < Long > sizeIfKnown = source.sizeIfKnown ();
        if (! sizeIfKnown.isPresent ()) {
            return Optional.absent ();
        }
        result += sizeIfKnown.get ();
    }
    return Optional.of (result);
}

