LimitedInputStream (InputStream in, long limit) {
    super (in);
    checkNotNull (in);
    checkArgument (limit >= 0, "limit must be non-negative");
    left = limit;
}

public int available () throws IOException {
    return (int) Math.min (in.available (), left);
}

public synchronized void mark (int readLimit) {
    in.mark (readLimit);
    mark = left;
}

public int read () throws IOException {
    if (left == 0) {
        return - 1;
    }
    int result = in.read ();
    if (result != - 1) {
        -- left;
    }
    return result;
}

public int read (byte [] b, int off, int len) throws IOException {
    if (left == 0) {
        return - 1;
    }
    len = (int) Math.min (len, left);
    int result = in.read (b, off, len);
    if (result != - 1) {
        left -= result;
    }
    return result;
}

public synchronized void reset () throws IOException {
    if (! in.markSupported ()) {
        throw new IOException ("Mark not supported");
    }
    if (mark == - 1) {
        throw new IOException ("Mark not set");
    }
    in.reset ();
    left = mark;
}

public long skip (long n) throws IOException {
    n = Math.min (n, left);
    long skipped = in.skip (n);
    left -= skipped;
    return skipped;
}

public static void readFully (InputStream in, byte [] b) throws IOException {
    readFully (in, b, 0, b.length);
}

public static void readFully (InputStream in, byte [] b, int off, int len) throws IOException {
    int read = read (in, b, off, len);
    if (read != len) {
        throw new EOFException ("reached end of stream after reading " + read + " bytes; " + len + " bytes expected");
    }
}

public static void skipFully (InputStream in, long n) throws IOException {
    long skipped = skipUpTo (in, n);
    if (skipped < n) {
        throw new EOFException ("reached end of stream after skipping " + skipped + " bytes; " + n + " bytes expected");
    }
}

static long skipUpTo (InputStream in, final long n) throws IOException {
    long totalSkipped = 0;
    byte [] buf = createBuffer ();
    while (totalSkipped < n) {
        long remaining = n - totalSkipped;
        long skipped = skipSafely (in, remaining);
        if (skipped == 0) {
            int skip = (int) Math.min (remaining, buf.length);
            if ((skipped = in.read (buf, 0, skip)) == - 1) {
                break;
            }
        }
        totalSkipped += skipped;
    }
    return totalSkipped;
}

private static long skipSafely (InputStream in, long n) throws IOException {
    int available = in.available ();
    return available == 0 ? 0 : in.skip (Math.min (available, n));
}

public static < T > T readBytes (InputStream input, ByteProcessor < T > processor) throws IOException {
    checkNotNull (input);
    checkNotNull (processor);
    byte [] buf = createBuffer ();
    int read;
    do {
        read = input.read (buf);
    } while (read != - 1 && processor.processBytes (buf, 0, read));
    return processor.getResult ();
}

public static int read (InputStream in, byte [] b, int off, int len) throws IOException {
    checkNotNull (in);
    checkNotNull (b);
    if (len < 0) {
        throw new IndexOutOfBoundsException ("len is negative");
    }
    int total = 0;
    while (total < len) {
        int result = in.read (b, off + total, len - total);
        if (result == - 1) {
            break;
        }
        total += result;
    }
    return total;
}

public CharSequenceReader (CharSequence seq) {
    this.seq = checkNotNull (seq);
}

private void checkOpen () throws IOException {
    if (seq == null) {
        throw new IOException ("reader closed");
    }
}

private boolean hasRemaining () {
    return remaining () > 0;
}

private int remaining () {
    return seq.length () - pos;
}

public synchronized int read (CharBuffer target) throws IOException {
    checkNotNull (target);
    checkOpen ();
    if (! hasRemaining ()) {
        return - 1;
    }
    int charsToRead = Math.min (target.remaining (), remaining ());
    for (int i = 0;
    i < charsToRead; i ++) {
        target.put (seq.charAt (pos ++));
    }
    return charsToRead;
}

public synchronized int read () throws IOException {
    checkOpen ();
    return hasRemaining () ? seq.charAt (pos ++) : - 1;
}

public synchronized int read (char [] cbuf, int off, int len) throws IOException {
    checkPositionIndexes (off, off + len, cbuf.length);
    checkOpen ();
    if (! hasRemaining ()) {
        return - 1;
    }
    int charsToRead = Math.min (len, remaining ());
    for (int i = 0;
    i < charsToRead; i ++) {
        cbuf [off + i] = seq.charAt (pos ++);
    }
    return charsToRead;
}

public synchronized long skip (long n) throws IOException {
    checkArgument (n >= 0, "n (%s) may not be negative", n);
    checkOpen ();
    int charsToSkip = (int) Math.min (remaining (), n);
    pos += charsToSkip;
    return charsToSkip;
}

public synchronized boolean ready () throws IOException {
    checkOpen ();
    return true;
}

public boolean markSupported () {
    return true;
}

public synchronized void mark (int readAheadLimit) throws IOException {
    checkArgument (readAheadLimit >= 0, "readAheadLimit (%s) may not be negative", readAheadLimit);
    checkOpen ();
    mark = pos;
}

public synchronized void reset () throws IOException {
    checkOpen ();
    pos = mark;
}

public synchronized void close () throws IOException {
    seq = null;
}

public MultiInputStream (Iterator < ? extends ByteSource > it) throws IOException {
    this.it = checkNotNull (it);
    advance ();
}

public void close () throws IOException {
    if (in != null) {
        try {
            in.close ();
        } finally {
            in = null;
        }
    }
}

private void advance () throws IOException {
    close ();
    if (it.hasNext ()) {
        in = it.next ().openStream ();
    }
}

public int available () throws IOException {
    if (in == null) {
        return 0;
    }
    return in.available ();
}

public boolean markSupported () {
    return false;
}

public int read () throws IOException {
    if (in == null) {
        return - 1;
    }
    int result = in.read ();
    if (result == - 1) {
        advance ();
        return read ();
    }
    return result;
}

public int read (@Nullable
byte [] b, int off, int len) throws IOException {
    if (in == null) {
        return - 1;
    }
    int result = in.read (b, off, len);
    if (result == - 1) {
        advance ();
        return read (b, off, len);
    }
    return result;
}

public long skip (long n) throws IOException {
    if (in == null || n <= 0) {
        return 0;
    }
    long result = in.skip (n);
    if (result != 0) {
        return result;
    }
    if (read () == - 1) {
        return 0;
    }
    return 1 + in.skip (n - 1);
}

MultiReader (Iterator < ? extends CharSource > readers) throws IOException {
    this.it = readers;
    advance ();
}

private void advance () throws IOException {
    close ();
    if (it.hasNext ()) {
        current = it.next ().openStream ();
    }
}

public int read (@Nullable
char cbuf [], int off, int len) throws IOException {
    if (current == null) {
        return - 1;
    }
    int result = current.read (cbuf, off, len);
    if (result == - 1) {
        advance ();
        return read (cbuf, off, len);
    }
    return result;
}

public long skip (long n) throws IOException {
    Preconditions.checkArgument (n >= 0, "n is negative");
    if (n > 0) {
        while (current != null) {
            long result = current.skip (n);
            if (result > 0) {
                return result;
            }
            advance ();
        }
    }
    return 0;
}

public boolean ready () throws IOException {
    return (current != null) && current.ready ();
}

public void close () throws IOException {
    if (current != null) {
        try {
            current.close ();
        } finally {
            current = null;
        }
    }
}

public static Closer create () {
    return new Closer (SUPPRESSOR);
}

Closer (Suppressor suppressor) {
    this.suppressor = checkNotNull (suppressor);
}

public < C extends Closeable > C register (@Nullable
C closeable) {
    if (closeable != null) {
        stack.addFirst (closeable);
    }
    return closeable;
}

public RuntimeException rethrow (Throwable e) throws IOException {
    checkNotNull (e);
    thrown = e;
    Throwables.propagateIfPossible (e, IOException.class);
    throw new RuntimeException (e);
}

public < X extends Exception > RuntimeException rethrow (Throwable e, Class < X > declaredType) throws IOException, X {
    checkNotNull (e);
    thrown = e;
    Throwables.propagateIfPossible (e, IOException.class);
    Throwables.propagateIfPossible (e, declaredType);
    throw new RuntimeException (e);
}

public < X1 extends Exception, X2 extends Exception > RuntimeException rethrow (Throwable e, Class < X1 > declaredType1, Class < X2 > declaredType2) throws IOException, X1, X2 {
    checkNotNull (e);
    thrown = e;
    Throwables.propagateIfPossible (e, IOException.class);
    Throwables.propagateIfPossible (e, declaredType1, declaredType2);
    throw new RuntimeException (e);
}

public void close () throws IOException {
    Throwable throwable = thrown;
    while (! stack.isEmpty ()) {
        Closeable closeable = stack.removeFirst ();
        try {
            closeable.close ();
        } catch (Throwable e) {
            if (throwable == null) {
                throwable = e;
            } else {
                suppressor.suppress (closeable, throwable, e);
            }
        }
    }
    if (thrown == null && throwable != null) {
        Throwables.propagateIfPossible (throwable, IOException.class);
        throw new AssertionError (throwable);
    }
}

public void suppress (Closeable closeable, Throwable thrown, Throwable suppressed) {
    Closeables.logger.log (Level.WARNING, "Suppressing exception thrown when closing " + closeable, suppressed);
}

static boolean isAvailable () {
    return addSuppressed != null;
}

private static Method getAddSuppressed () {
    try {
        return Throwable.class.getMethod ("addSuppressed", Throwable.class);
    } catch (Throwable e) {
        return null;
    }
}

public void suppress (Closeable closeable, Throwable thrown, Throwable suppressed) {
    if (thrown == suppressed) {
        return;
    }
    try {
        addSuppressed.invoke (thrown, suppressed);
    } catch (Throwable e) {
        LoggingSuppressor.INSTANCE.suppress (closeable, thrown, suppressed);
    }
}

