    return specification;
}

public String toString () {
    return MoreObjects.toStringHelper (this).addValue (toParsableString ()).toString ();
}

public int hashCode () {
    return Objects.hashCode (initialCapacity, maximumSize, maximumWeight, concurrencyLevel, keyStrength, valueStrength, recordStats, durationInNanos (writeExpirationDuration, writeExpirationTimeUnit), durationInNanos (accessExpirationDuration, accessExpirationTimeUnit), durationInNanos (refreshDuration, refreshTimeUnit));
}

public boolean equals (@Nullable
Object obj) {
    if (this == obj) {
        return true;
    }
    if (! (obj instanceof CacheBuilderSpec)) {
        return false;
    }
    CacheBuilderSpec that = (CacheBuilderSpec) obj;
    return Objects.equal (initialCapacity, that.initialCapacity) && Objects.equal (maximumSize, that.maximumSize) && Objects.equal (maximumWeight, that.maximumWeight) && Objects.equal (concurrencyLevel, that.concurrencyLevel) && Objects.equal (keyStrength, that.keyStrength) && Objects.equal (valueStrength, that.valueStrength) && Objects.equal (recordStats, that.recordStats) && Objects.equal (durationInNanos (writeExpirationDuration, writeExpirationTimeUnit), durationInNanos (that.writeExpirationDuration, that.writeExpirationTimeUnit)) && Objects.equal (durationInNanos (accessExpirationDuration, accessExpirationTimeUnit), durationInNanos (that.accessExpirationDuration, that.accessExpirationTimeUnit)) && Objects.equal (durationInNanos (refreshDuration, refreshTimeUnit), durationInNanos (that.refreshDuration, that.refreshTimeUnit));
}

private static Long durationInNanos (long duration,@Nullable
TimeUnit unit) {
    return (unit == null) ? null : unit.toNanos (duration);
}

public void parse (CacheBuilderSpec spec, String key, String value) {
    checkArgument (value != null && ! value.isEmpty (), "value of key %s omitted", key);
    try {
        parseInteger (spec, Integer.parseInt (value));
    } catch (NumberFormatException e) {
        throw new IllegalArgumentException (format ("key %s value set to %s, must be integer", key, value), e);
    }
}

public void parse (CacheBuilderSpec spec, String key, String value) {
    checkArgument (value != null && ! value.isEmpty (), "value of key %s omitted", key);
    try {
        parseLong (spec, Long.parseLong (value));
    } catch (NumberFormatException e) {
        throw new IllegalArgumentException (format ("key %s value set to %s, must be integer", key, value), e);
    }
}

protected void parseInteger (CacheBuilderSpec spec, int value) {
    checkArgument (spec.initialCapacity == null, "initial capacity was already set to ", spec.initialCapacity);
    spec.initialCapacity = value;
}

protected void parseLong (CacheBuilderSpec spec, long value) {
    checkArgument (spec.maximumSize == null, "maximum size was already set to ", spec.maximumSize);
    checkArgument (spec.maximumWeight == null, "maximum weight was already set to ", spec.maximumWeight);
    spec.maximumSize = value;
}

protected void parseLong (CacheBuilderSpec spec, long value) {
    checkArgument (spec.maximumWeight == null, "maximum weight was already set to ", spec.maximumWeight);
    checkArgument (spec.maximumSize == null, "maximum size was already set to ", spec.maximumSize);
    spec.maximumWeight = value;
}

protected void parseInteger (CacheBuilderSpec spec, int value) {
    checkArgument (spec.concurrencyLevel == null, "concurrency level was already set to ", spec.concurrencyLevel);
    spec.concurrencyLevel = value;
}

