final boolean cas (long cmp, long val) {
    return UNSAFE.compareAndSwapLong (this, valueOffset, cmp, val);
}

final boolean casBase (long cmp, long val) {
    return UNSAFE.compareAndSwapLong (this, baseOffset, cmp, val);
}

final boolean casBusy () {
    return UNSAFE.compareAndSwapInt (this, busyOffset, 0, 1);
}

final void retryUpdate (long x, int [] hc, boolean wasUncontended) {
    int h;
    if (hc == null) {
        threadHashCode.set (hc = new int [1]);
        int r = rng.nextInt ();
        h = hc [0] = (r == 0) ? 1 : r;
    } else h = hc [0];

    boolean collide = false;
    for (;;) {
        Cell [] as;
        Cell a;
        int n;
        long v;
        if ((as = cells) != null && (n = as.length) > 0) {
            if ((a = as [(n - 1) & h]) == null) {
                if (busy == 0) {
                    Cell r = new Cell (x);
                    if (busy == 0 && casBusy ()) {
                        boolean created = false;
                        try {
                            Cell [] rs;
                            int m, j;
                            if ((rs = cells) != null && (m = rs.length) > 0 && rs [j = (m - 1) & h] == null) {
                                rs [j] = r;
                                created = true;
                            }
                        } finally {
                            busy = 0;
                        }
                        if (created) break;

                        continue;
                    }
                }
                collide = false;
            } else if (! wasUncontended) wasUncontended = true;
            else if (a.cas (v = a.value, fn (v, x))) break;
            else if (n >= NCPU || cells != as) collide = false;
            else if (! collide) collide = true;
            else if (busy == 0 && casBusy ()) {
                try {
                    if (cells == as) {
                        Cell [] rs = new Cell [n << 1];
                        for (int i = 0;
                        i < n; ++ i) rs [i] = as [i];

                        cells = rs;
                    }
                } finally {
                    busy = 0;
                }
                collide = false;
                continue;
            }

            h ^= h << 13;
            h ^= h>>> 17;
            h ^= h << 5;
            hc [0] = h;
        } else if (busy == 0 && cells == as && casBusy ()) {
            boolean init = false;
            try {
                if (cells == as) {
                    Cell [] rs = new Cell [2];
                    rs [h & 1] = new Cell (x);
                    cells = rs;
                    init = true;
                }
            } finally {
                busy = 0;
            }
            if (init) break;

        } else if (casBase (v = base, fn (v, x))) break;

    }
}

final void internalReset (long initialValue) {
    Cell [] as = cells;
    base = initialValue;
    if (as != null) {
        int n = as.length;
        for (int i = 0;
        i < n; ++ i) {
            Cell a = as [i];
            if (a != null) a.value = initialValue;

        }
    }
}

private static sun.misc.Unsafe getUnsafe () {
    try {
        return sun.misc.Unsafe.getUnsafe ();
    } catch (SecurityException tryReflectionInstead) {
    }
    try {
        return java.security.AccessController.doPrivileged (new java.security.PrivilegedExceptionAction < sun.misc.Unsafe > () {
            public sun.misc.Unsafe run () throws Exception {
                Class < sun.misc.Unsafe > k = sun.misc.Unsafe.class;
                for (java.lang.reflect.Field f : k.getDeclaredFields ()) {
                    f.setAccessible (true);
                    Object x = f.get (null);
                    if (k.isInstance (x)) return k.cast (x);

                }
                throw new NoSuchFieldError ("the Unsafe");
            }}

        );
    } catch (java.security.PrivilegedActionException e) {
        throw new RuntimeException ("Could not initialize intrinsics", e.getCause ());
    }
}

public sun.misc.Unsafe run () throws Exception {
    Class < sun.misc.Unsafe > k = sun.misc.Unsafe.class;
    for (java.lang.reflect.Field f : k.getDeclaredFields ()) {
        f.setAccessible (true);
        Object x = f.get (null);
        if (k.isInstance (x)) return k.cast (x);

    }
    throw new NoSuchFieldError ("the Unsafe");
}

public CacheStats (long hitCount, long missCount, long loadSuccessCount, long loadExceptionCount, long totalLoadTime, long evictionCount) {
    checkArgument (hitCount >= 0);
    checkArgument (missCount >= 0);
    checkArgument (loadSuccessCount >= 0);
    checkArgument (loadExceptionCount >= 0);
    checkArgument (totalLoadTime >= 0);
    checkArgument (evictionCount >= 0);
    this.hitCount = hitCount;
    this.missCount = missCount;
    this.loadSuccessCount = loadSuccessCount;
    this.loadExceptionCount = loadExceptionCount;
    this.totalLoadTime = totalLoadTime;
    this.evictionCount = evictionCount;
}

public long requestCount () {
    return hitCount + missCount;
}

public long hitCount () {
    return hitCount;
}

public double hitRate () {
    long requestCount = requestCount ();
    return (requestCount == 0) ? 1.0 : (double) hitCount / requestCount;
}

public long missCount () {
    return missCount;
}

public double missRate () {
    long requestCount = requestCount ();
    return (requestCount == 0) ? 0.0 : (double) missCount / requestCount;
}

public long loadCount () {
    return loadSuccessCount + loadExceptionCount;
}

public long loadSuccessCount () {
    return loadSuccessCount;
}

public long loadExceptionCount () {
    return loadExceptionCount;
}

public double loadExceptionRate () {
    long totalLoadCount = loadSuccessCount + loadExceptionCount;
    return (totalLoadCount == 0) ? 0.0 : (double) loadExceptionCount / totalLoadCount;
}

public long totalLoadTime () {
    return totalLoadTime;
}

public double averageLoadPenalty () {
    long totalLoadCount = loadSuccessCount + loadExceptionCount;
    return (totalLoadCount == 0) ? 0.0 : (double) totalLoadTime / totalLoadCount;
}

public long evictionCount () {
    return evictionCount;
}

public CacheStats minus (CacheStats other) {
    return new CacheStats (Math.max (0, hitCount - other.hitCount), Math.max (0, missCount - other.missCount), Math.max (0, loadSuccessCount - other.loadSuccessCount), Math.max (0, loadExceptionCount - other.loadExceptionCount), Math.max (0, totalLoadTime - other.totalLoadTime), Math.max (0, evictionCount - other.evictionCount));
}

public CacheStats plus (CacheStats other) {
    return new CacheStats (hitCount + other.hitCount, missCount + other.missCount, loadSuccessCount + other.loadSuccessCount, loadExceptionCount + other.loadExceptionCount, totalLoadTime + other.totalLoadTime, evictionCount + other.evictionCount);
}

public int hashCode () {
    return Objects.hashCode (hitCount, missCount, loadSuccessCount, loadExceptionCount, totalLoadTime, evictionCount);
}

public boolean equals (@Nullable
Object object) {
    if (object instanceof CacheStats) {
        CacheStats other = (CacheStats) object;
        return hitCount == other.hitCount && missCount == other.missCount && loadSuccessCount == other.loadSuccessCount && loadExceptionCount == other.loadExceptionCount && totalLoadTime == other.totalLoadTime && evictionCount == other.evictionCount;
    }
    return false;
}

