public TypeResolver where (Type formal, Type actual) {
    Map < TypeVariableKey, Type > mappings = Maps.newHashMap ();
    populateTypeMappings (mappings, checkNotNull (formal), checkNotNull (actual));
    return where (mappings);
}

TypeResolver where (Map < TypeVariableKey, ? extends Type > mappings) {
    return new TypeResolver (typeTable.where (mappings));
}

private static void populateTypeMappings (final Map < TypeVariableKey, Type > mappings, Type from, final Type to) {
    if (from.equals (to)) {
        return;
    }
    new TypeVisitor () {
        @Override
        void visitTypeVariable (TypeVariable < ? > typeVariable) {
            mappings.put (new TypeVariableKey (typeVariable), to);
        }@Override
        void visitWildcardType (WildcardType fromWildcardType) {
            if (! (to instanceof WildcardType)) {
                return;
            }
            WildcardType toWildcardType = (WildcardType) to;
            Type [] fromUpperBounds = fromWildcardType.getUpperBounds ();
            Type [] toUpperBounds = toWildcardType.getUpperBounds ();
            Type [] fromLowerBounds = fromWildcardType.getLowerBounds ();
            Type [] toLowerBounds = toWildcardType.getLowerBounds ();
            checkArgument (fromUpperBounds.length == toUpperBounds.length && fromLowerBounds.length == toLowerBounds.length, "Incompatible type: %s vs. %s", fromWildcardType, to);
            for (int i = 0;
            i < fromUpperBounds.length; i ++) {
                populateTypeMappings (mappings, fromUpperBounds [i], toUpperBounds [i]);
            }
            for (int i = 0;
            i < fromLowerBounds.length; i ++) {
                populateTypeMappings (mappings, fromLowerBounds [i], toLowerBounds [i]);
            }
        }@Override
        void visitParameterizedType (ParameterizedType fromParameterizedType) {
            if (to instanceof WildcardType) {
                return;
            }
            ParameterizedType toParameterizedType = expectArgument (ParameterizedType.class, to);
            if (fromParameterizedType.getOwnerType () != null && toParameterizedType.getOwnerType () != null) {
                populateTypeMappings (mappings, fromParameterizedType.getOwnerType (), toParameterizedType.getOwnerType ());
            }
            checkArgument (fromParameterizedType.getRawType ().equals (toParameterizedType.getRawType ()), "Inconsistent raw type: %s vs. %s", fromParameterizedType, to);
            Type [] fromArgs = fromParameterizedType.getActualTypeArguments ();
            Type [] toArgs = toParameterizedType.getActualTypeArguments ();
            checkArgument (fromArgs.length == toArgs.length, "%s not compatible with %s", fromParameterizedType, toParameterizedType);
            for (int i = 0;
            i < fromArgs.length; i ++) {
                populateTypeMappings (mappings, fromArgs [i], toArgs [i]);
            }
        }@Override
        void visitGenericArrayType (GenericArrayType fromArrayType) {
            if (to instanceof WildcardType) {
                return;
            }
            Type componentType = Types.getComponentType (to);
            checkArgument (componentType != null, "%s is not an array type.", to);
            populateTypeMappings (mappings, fromArrayType.getGenericComponentType (), componentType);
        }@Override
        void visitClass (Class < ? > fromClass) {
            if (to instanceof WildcardType) {
                return;
            }
            throw new IllegalArgumentException ("No type mapping from " + fromClass + " to " + to);
        }}

    .visit (from);
}

void visitTypeVariable (TypeVariable < ? > typeVariable) {
    mappings.put (new TypeVariableKey (typeVariable), to);
}

void visitWildcardType (WildcardType fromWildcardType) {
    if (! (to instanceof WildcardType)) {
        return;
    }
    WildcardType toWildcardType = (WildcardType) to;
    Type [] fromUpperBounds = fromWildcardType.getUpperBounds ();
    Type [] toUpperBounds = toWildcardType.getUpperBounds ();
    Type [] fromLowerBounds = fromWildcardType.getLowerBounds ();
    Type [] toLowerBounds = toWildcardType.getLowerBounds ();
    checkArgument (fromUpperBounds.length == toUpperBounds.length && fromLowerBounds.length == toLowerBounds.length, "Incompatible type: %s vs. %s", fromWildcardType, to);
    for (int i = 0;
    i < fromUpperBounds.length; i ++) {
        populateTypeMappings (mappings, fromUpperBounds [i], toUpperBounds [i]);
    }
    for (int i = 0;
    i < fromLowerBounds.length; i ++) {
        populateTypeMappings (mappings, fromLowerBounds [i], toLowerBounds [i]);
    }
}

void visitParameterizedType (ParameterizedType fromParameterizedType) {
    if (to instanceof WildcardType) {
        return;
    }
    ParameterizedType toParameterizedType = expectArgument (ParameterizedType.class, to);
    if (fromParameterizedType.getOwnerType () != null && toParameterizedType.getOwnerType () != null) {
        populateTypeMappings (mappings, fromParameterizedType.getOwnerType (), toParameterizedType.getOwnerType ());
    }
    checkArgument (fromParameterizedType.getRawType ().equals (toParameterizedType.getRawType ()), "Inconsistent raw type: %s vs. %s", fromParameterizedType, to);
    Type [] fromArgs = fromParameterizedType.getActualTypeArguments ();
    Type [] toArgs = toParameterizedType.getActualTypeArguments ();
    checkArgument (fromArgs.length == toArgs.length, "%s not compatible with %s", fromParameterizedType, toParameterizedType);
    for (int i = 0;
    i < fromArgs.length; i ++) {
        populateTypeMappings (mappings, fromArgs [i], toArgs [i]);
    }
}

void visitGenericArrayType (GenericArrayType fromArrayType) {
    if (to instanceof WildcardType) {
        return;
    }
    Type componentType = Types.getComponentType (to);
    checkArgument (componentType != null, "%s is not an array type.", to);
    populateTypeMappings (mappings, fromArrayType.getGenericComponentType (), componentType);
}

void visitClass (Class < ? > fromClass) {
    if (to instanceof WildcardType) {
        return;
    }
    throw new IllegalArgumentException ("No type mapping from " + fromClass + " to " + to);
}

public Type resolveType (Type type) {
    checkNotNull (type);
    if (type instanceof TypeVariable) {
        return typeTable.resolve ((TypeVariable < ? >) type);
    } else if (type instanceof ParameterizedType) {
        return resolveParameterizedType ((ParameterizedType) type);
    } else if (type instanceof GenericArrayType) {
        return resolveGenericArrayType ((GenericArrayType) type);
    } else if (type instanceof WildcardType) {
        return resolveWildcardType ((WildcardType) type);
    } else {
        return type;
    }

}

private Type [] resolveTypes (Type [] types) {
    Type [] result = new Type [types.length];
    for (int i = 0;
    i < types.length; i ++) {
        result [i] = resolveType (types [i]);
    }
    return result;
}

private WildcardType resolveWildcardType (WildcardType type) {
    Type [] lowerBounds = type.getLowerBounds ();
    Type [] upperBounds = type.getUpperBounds ();
    return new Types.WildcardTypeImpl (resolveTypes (lowerBounds), resolveTypes (upperBounds));
}

private Type resolveGenericArrayType (GenericArrayType type) {
    Type componentType = type.getGenericComponentType ();
    Type resolvedComponentType = resolveType (componentType);
    return Types.newArrayType (resolvedComponentType);
}

private ParameterizedType resolveParameterizedType (ParameterizedType type) {
    Type owner = type.getOwnerType ();
    Type resolvedOwner = (owner == null) ? null : resolveType (owner);
    Type resolvedRawType = resolveType (type.getRawType ());
    Type [] args = type.getActualTypeArguments ();
    Type [] resolvedArgs = resolveTypes (args);
    return Types.newParameterizedTypeWithOwner (resolvedOwner, (Class < ? >) resolvedRawType, resolvedArgs);
}

private static < T > T expectArgument (Class < T > type, Object arg) {
    try {
        return type.cast (arg);
    } catch (ClassCastException e) {
        throw new IllegalArgumentException (arg + " is not a " + type.getSimpleName ());
    }
}

TypeTable () {
    this.map = ImmutableMap.of ();
}

private TypeTable (ImmutableMap < TypeVariableKey, Type > map) {
    this.map = map;
}

final TypeTable where (Map < TypeVariableKey, ? extends Type > mappings) {
    ImmutableMap.Builder < TypeVariableKey, Type > builder = ImmutableMap.builder ();
    builder.putAll (map);
    for (Map.Entry < TypeVariableKey, ? extends Type > mapping : mappings.entrySet ()) {
        TypeVariableKey variable = mapping.getKey ();
        Type type = mapping.getValue ();
        checkArgument (! variable.equalsType (type), "Type variable %s bound to itself", variable);
        builder.put (variable, type);
    }
    return new TypeTable (builder.build ());
}

final Type resolve (final TypeVariable < ? > var) {
    final TypeTable unguarded = this;
    TypeTable guarded = new TypeTable () {
        @Override
        public Type resolveInternal (TypeVariable < ? > intermediateVar, TypeTable forDependent) {
            if (intermediateVar.getGenericDeclaration ().equals (var.getGenericDeclaration ())) {
                return intermediateVar;
            }
            return unguarded.resolveInternal (intermediateVar, forDependent);
        }}

    ;
    return resolveInternal (var, guarded);
}

public Type resolveInternal (TypeVariable < ? > intermediateVar, TypeTable forDependent) {
    if (intermediateVar.getGenericDeclaration ().equals (var.getGenericDeclaration ())) {
        return intermediateVar;
    }
    return unguarded.resolveInternal (intermediateVar, forDependent);
}

Type resolveInternal (TypeVariable < ? > var, TypeTable forDependants) {
    Type type = map.get (new TypeVariableKey (var));
    if (type == null) {
        Type [] bounds = var.getBounds ();
        if (bounds.length == 0) {
            return var;
        }
        Type [] resolvedBounds = new TypeResolver (forDependants).resolveTypes (bounds);
        if (Types.NativeTypeVariableEquals.NATIVE_TYPE_VARIABLE_ONLY && Arrays.equals (bounds, resolvedBounds)) {
            return var;
        }
        return Types.newArtificialTypeVariable (var.getGenericDeclaration (), var.getName (), resolvedBounds);
    }
    return new TypeResolver (forDependants).resolveType (type);
}

static ImmutableMap < TypeVariableKey, Type > getTypeMappings (Type contextType) {
    TypeMappingIntrospector introspector = new TypeMappingIntrospector ();
    introspector.visit (wildcardCapturer.capture (contextType));
    return ImmutableMap.copyOf (introspector.mappings);
}

void visitClass (Class < ? > clazz) {
    visit (clazz.getGenericSuperclass ());
    visit (clazz.getGenericInterfaces ());
}

void visitParameterizedType (ParameterizedType parameterizedType) {
    Class < ? > rawClass = (Class < ? >) parameterizedType.getRawType ();
    TypeVariable < ? > [] vars = rawClass.getTypeParameters ();
    Type [] typeArgs = parameterizedType.getActualTypeArguments ();
    checkState (vars.length == typeArgs.length);
    for (int i = 0;
    i < vars.length; i ++) {
        map (new TypeVariableKey (vars [i]), typeArgs [i]);
    }
    visit (rawClass);
    visit (parameterizedType.getOwnerType ());
}

void visitTypeVariable (TypeVariable < ? > t) {
    visit (t.getBounds ());
}

void visitWildcardType (WildcardType t) {
    visit (t.getUpperBounds ());
}

private void map (final TypeVariableKey var, final Type arg) {
    if (mappings.containsKey (var)) {
        return;
    }
    for (Type t = arg;
    t != null; t = mappings.get (TypeVariableKey.forLookup (t))) {
        if (var.equalsType (t)) {
            for (Type x = arg;
            x != null; x = mappings.remove (TypeVariableKey.forLookup (x))) {
            }
            return;
        }
    }
    mappings.put (var, arg);
}

Type capture (Type type) {
    checkNotNull (type);
    if (type instanceof Class) {
        return type;
    }
    if (type instanceof TypeVariable) {
        return type;
    }
    if (type instanceof GenericArrayType) {
        GenericArrayType arrayType = (GenericArrayType) type;
        return Types.newArrayType (capture (arrayType.getGenericComponentType ()));
    }
    if (type instanceof ParameterizedType) {
        ParameterizedType parameterizedType = (ParameterizedType) type;
        return Types.newParameterizedTypeWithOwner (captureNullable (parameterizedType.getOwnerType ()), (Class < ? >) parameterizedType.getRawType (), capture (parameterizedType.getActualTypeArguments ()));
    }
    if (type instanceof WildcardType) {
        WildcardType wildcardType = (WildcardType) type;
        Type [] lowerBounds = wildcardType.getLowerBounds ();
        if (lowerBounds.length == 0) {
            Type [] upperBounds = wildcardType.getUpperBounds ();
            String name = "capture#" + id.incrementAndGet () + "-of ? extends " + Joiner.on ('&').join (upperBounds);
            return Types.newArtificialTypeVariable (WildcardCapturer.class, name, wildcardType.getUpperBounds ());
        } else {
            return type;
        }
    }
    throw new AssertionError ("must have been one of the known types");
}

private Type captureNullable (@Nullable
Type type) {
    if (type == null) {
        return null;
    }
    return capture (type);
}

private Type [] capture (Type [] types) {
    Type [] result = new Type [types.length];
    for (int i = 0;
    i < types.length; i ++) {
        result [i] = capture (types [i]);
    }
    return result;
}

TypeVariableKey (TypeVariable < ? > var) {
    this.var = checkNotNull (var);
}

public int hashCode () {
    return Objects.hashCode (var.getGenericDeclaration (), var.getName ());
}

public boolean equals (Object obj) {
    if (obj instanceof TypeVariableKey) {
        TypeVariableKey that = (TypeVariableKey) obj;
        return equalsTypeVariable (that.var);
    } else {
        return false;
    }
}

public String toString () {
    return var.toString ();
}

static TypeVariableKey forLookup (Type t) {
    if (t instanceof TypeVariable) {
        return new TypeVariableKey ((TypeVariable < ? >) t);
    } else {
        return null;
    }
}

boolean equalsType (Type type) {
    if (type instanceof TypeVariable) {
        return equalsTypeVariable ((TypeVariable < ? >) type);
    } else {
        return false;
    }
}

private boolean equalsTypeVariable (TypeVariable < ? > that) {
    return var.getGenericDeclaration ().equals (that.getGenericDeclaration ()) && var.getName ().equals (that.getName ());
}

protected TypeParameter () {
    Type type = capture ();
    checkArgument (type instanceof TypeVariable, "%s should be a type variable.", type);
    this.typeVariable = (TypeVariable < ? >) type;
}

public final int hashCode () {
    return typeVariable.hashCode ();
}

public final boolean equals (@Nullable
Object o) {
    if (o instanceof TypeParameter) {
        TypeParameter < ? > that = (TypeParameter < ? >) o;
        return typeVariable.equals (that.typeVariable);
    }
    return false;
}

public String toString () {
    return typeVariable.toString ();
}

public final void visit (Type...types) {
    for (Type type : types) {
        if (type == null || ! visited.add (type)) {
            continue;
        }
        boolean succeeded = false;
        try {
            if (type instanceof TypeVariable) {
                visitTypeVariable ((TypeVariable < ? >) type);
            } else if (type instanceof WildcardType) {
                visitWildcardType ((WildcardType) type);
            } else if (type instanceof ParameterizedType) {
                visitParameterizedType ((ParameterizedType) type);
            } else if (type instanceof Class) {
                visitClass ((Class < ? >) type);
            } else if (type instanceof GenericArrayType) {
                visitGenericArrayType ((GenericArrayType) type);
            } else {
                throw new AssertionError ("Unknown type: " + type);
            }

            succeeded = true;
        } finally {
            if (! succeeded) {
                visited.remove (type);
            }
        }
    }
}

public final Object invoke (Object proxy, Method method,@Nullable
Object [] args) throws Throwable {
    if (args == null) {
        args = NO_ARGS;
    }
    if (args.length == 0 && method.getName ().equals ("hashCode")) {
        return hashCode ();
    }
    if (args.length == 1 && method.getName ().equals ("equals") && method.getParameterTypes () [0] == Object.class) {
        Object arg = args [0];
        if (arg == null) {
            return false;
        }
        if (proxy == arg) {
            return true;
        }
        return isProxyOfSameInterfaces (arg, proxy.getClass ()) && equals (Proxy.getInvocationHandler (arg));
    }
    if (args.length == 0 && method.getName ().equals ("toString")) {
        return toString ();
    }
    return handleInvocation (proxy, method, args);
}

public boolean equals (Object obj) {
    return super.equals (obj);
}

public int hashCode () {
    return super.hashCode ();
}

public String toString () {
    return super.toString ();
}

private static boolean isProxyOfSameInterfaces (Object arg, Class < ? > proxyClass) {
    return proxyClass.isInstance (arg) || (Proxy.isProxyClass (arg.getClass ()) && Arrays.equals (arg.getClass ().getInterfaces (), proxyClass.getInterfaces ()));
}

public static Escaper xmlContentEscaper () {
    return XML_CONTENT_ESCAPER;
}

public static Escaper xmlAttributeEscaper () {
    return XML_ATTRIBUTE_ESCAPER;
}

InternetDomainName (String name) {
    name = Ascii.toLowerCase (DOTS_MATCHER.replaceFrom (name, '.'));
    if (name.endsWith (".")) {
        name = name.substring (0, name.length () - 1);
    }
    checkArgument (name.length () <= MAX_LENGTH, "Domain name too long: '%s':", name);
    this.name = name;
    this.parts = ImmutableList.copyOf (DOT_SPLITTER.split (name));
    checkArgument (parts.size () <= MAX_PARTS, "Domain has too many parts: '%s'", name);
    checkArgument (validateSyntax (parts), "Not a valid domain name: '%s'", name);
    this.publicSuffixIndex = findPublicSuffix ();
}

private int findPublicSuffix () {
    final int partsSize = parts.size ();
    for (int i = 0;
    i < partsSize; i ++) {
        String ancestorName = DOT_JOINER.join (parts.subList (i, partsSize));
        if (PublicSuffixPatterns.EXACT.containsKey (ancestorName)) {
            return i;
        }
        if (PublicSuffixPatterns.EXCLUDED.containsKey (ancestorName)) {
            return i + 1;
        }
        if (matchesWildcardPublicSuffix (ancestorName)) {
            return i;
        }
    }
    return NO_PUBLIC_SUFFIX_FOUND;
}

public static InternetDomainName from (String domain) {
    return new InternetDomainName (checkNotNull (domain));
}

private static boolean validateSyntax (List < String > parts) {
    final int lastIndex = parts.size () - 1;
    if (! validatePart (parts.get (lastIndex), true)) {
        return false;
    }
    for (int i = 0;
    i < lastIndex; i ++) {
        String part = parts.get (i);
        if (! validatePart (part, false)) {
            return false;
        }
    }
    return true;
}

private static boolean validatePart (String part, boolean isFinalPart) {
    if (part.length () < 1 || part.length () > MAX_DOMAIN_PART_LENGTH) {
        return false;
    }
    String asciiChars = CharMatcher.ascii ().retainFrom (part);
    if (! PART_CHAR_MATCHER.matchesAllOf (asciiChars)) {
        return false;
    }
    if (DASH_MATCHER.matches (part.charAt (0)) || DASH_MATCHER.matches (part.charAt (part.length () - 1))) {
        return false;
    }
    if (isFinalPart && CharMatcher.digit ().matches (part.charAt (0))) {
        return false;
    }
    return true;
}

public ImmutableList < String > parts () {
    return parts;
}

public boolean isPublicSuffix () {
    return publicSuffixIndex == 0;
}

public boolean hasPublicSuffix () {
    return publicSuffixIndex != NO_PUBLIC_SUFFIX_FOUND;
}

public InternetDomainName publicSuffix () {
    return hasPublicSuffix () ? ancestor (publicSuffixIndex) : null;
}

public boolean isUnderPublicSuffix () {
    return publicSuffixIndex > 0;
}

public boolean isTopPrivateDomain () {
    return publicSuffixIndex == 1;
}

public InternetDomainName topPrivateDomain () {
    if (isTopPrivateDomain ()) {
        return this;
    }
    checkState (isUnderPublicSuffix (), "Not under a public suffix: %s", name);
    return ancestor (publicSuffixIndex - 1);
}

public boolean hasParent () {
    return parts.size () > 1;
}

public InternetDomainName parent () {
    checkState (hasParent (), "Domain '%s' has no parent", name);
    return ancestor (1);
}

private InternetDomainName ancestor (int levels) {
    return from (DOT_JOINER.join (parts.subList (levels, parts.size ())));
}

public InternetDomainName child (String leftParts) {
    return from (checkNotNull (leftParts) + "." + name);
}

public static boolean isValid (String name) {
    try {
        from (name);
        return true;
    } catch (IllegalArgumentException e) {
        return false;
    }
}

private static boolean matchesWildcardPublicSuffix (String domain) {
    final String [] pieces = domain.split (DOT_REGEX, 2);
    return pieces.length == 2 && PublicSuffixPatterns.UNDER.containsKey (pieces [1]);
}

public String toString () {
    return name;
}

public boolean equals (@Nullable
Object object) {
    if (object == this) {
        return true;
    }
    if (object instanceof InternetDomainName) {
        InternetDomainName that = (InternetDomainName) object;
        return this.name.equals (that.name);
    }
    return false;
}

public int hashCode () {
    return name.hashCode ();
}

public PercentEscaper (String safeChars, boolean plusForSpace) {
    checkNotNull (safeChars);
    if (safeChars.matches (".*[0-9A-Za-z].*")) {
        throw new IllegalArgumentException ("Alphanumeric characters are always 'safe' and should not be explicitly specified");
    }
    safeChars += "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
    if (plusForSpace && safeChars.contains (" ")) {
        throw new IllegalArgumentException ("plusForSpace cannot be specified when space is a 'safe' character");
    }
    this.plusForSpace = plusForSpace;
    this.safeOctets = createSafeOctets (safeChars);
}

private static boolean [] createSafeOctets (String safeChars) {
    int maxChar = - 1;
    char [] safeCharArray = safeChars.toCharArray ();
    for (char c : safeCharArray) {
        maxChar = Math.max (c, maxChar);
    }
    boolean [] octets = new boolean [maxChar + 1];
    for (char c : safeCharArray) {
        octets [c] = true;
    }
    return octets;
}

protected int nextEscapeIndex (CharSequence csq, int index, int end) {
    checkNotNull (csq);
    for (; index < end; index ++) {
        char c = csq.charAt (index);
        if (c >= safeOctets.length || ! safeOctets [c]) {
            break;
        }
    }
    return index;
}

public String escape (String s) {
    checkNotNull (s);
    int slen = s.length ();
    for (int index = 0;
    index < slen; index ++) {
        char c = s.charAt (index);
        if (c >= safeOctets.length || ! safeOctets [c]) {
            return escapeSlow (s, index);
        }
    }
    return s;
}

protected char [] escape (int cp) {
    if (cp < safeOctets.length && safeOctets [cp]) {
        return null;
    } else if (cp == ' ' && plusForSpace) {
        return PLUS_SIGN;
    } else if (cp <= 0x7F) {
        char [] dest = new char [3];
        dest [0] = '%';
        dest [2] = UPPER_HEX_DIGITS [cp & 0xF];
        dest [1] = UPPER_HEX_DIGITS [cp>>> 4];
        return dest;
    } else if (cp <= 0x7ff) {
        char [] dest = new char [6];
        dest [0] = '%';
        dest [3] = '%';
        dest [5] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [4] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [2] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [1] = UPPER_HEX_DIGITS [0xC | cp];
        return dest;
    } else if (cp <= 0xffff) {
        char [] dest = new char [9];
        dest [0] = '%';
        dest [1] = 'E';
        dest [3] = '%';
        dest [6] = '%';
        dest [8] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [7] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [5] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [4] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [2] = UPPER_HEX_DIGITS [cp];
        return dest;
    } else if (cp <= 0x10ffff) {
        char [] dest = new char [12];
        dest [0] = '%';
        dest [1] = 'F';
        dest [3] = '%';
        dest [6] = '%';
        dest [9] = '%';
        dest [11] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [10] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [8] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [7] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [5] = UPPER_HEX_DIGITS [cp & 0xF];
        cp>>>= 4;
        dest [4] = UPPER_HEX_DIGITS [0x8 | (cp & 0x3)];
        cp>>>= 2;
        dest [2] = UPPER_HEX_DIGITS [cp & 0x7];
        return dest;
    } else {
        throw new IllegalArgumentException ("Invalid unicode character value " + cp);
    }

}

private HostAndPort (String host, int port, boolean hasBracketlessColons) {
    this.host = host;
    this.port = port;
    this.hasBracketlessColons = hasBracketlessColons;
}

public String getHost () {
    return host;
}

public String getHostText () {
    return host;
}

public boolean hasPort () {
    return port >= 0;
}

public int getPort () {
    checkState (hasPort ());
    return port;
}

public int getPortOrDefault (int defaultPort) {
    return hasPort () ? port : defaultPort;
}

public static HostAndPort fromParts (String host, int port) {
    checkArgument (isValidPort (port), "Port out of range: %s", port);
    HostAndPort parsedHost = fromString (host);
    checkArgument (! parsedHost.hasPort (), "Host has a port: %s", host);
    return new HostAndPort (parsedHost.host, port, parsedHost.hasBracketlessColons);
}

public static HostAndPort fromHost (String host) {
    HostAndPort parsedHost = fromString (host);
    checkArgument (! parsedHost.hasPort (), "Host has a port: %s", host);
    return parsedHost;
}

public static HostAndPort fromString (String hostPortString) {
    checkNotNull (hostPortString);
    String host;
    String portString = null;
    boolean hasBracketlessColons = false;
    if (hostPortString.startsWith ("[")) {
        String [] hostAndPort = getHostAndPortFromBracketedHost (hostPortString);
        host = hostAndPort [0];
        portString = hostAndPort [1];
    } else {
        int colonPos = hostPortString.indexOf (':');
        if (colonPos >= 0 && hostPortString.indexOf (':', colonPos + 1) == - 1) {
            host = hostPortString.substring (0, colonPos);
            portString = hostPortString.substring (colonPos + 1);
        } else {
            host = hostPortString;
            hasBracketlessColons = (colonPos >= 0);
        }
    }
    int port = NO_PORT;
    if (! Strings.isNullOrEmpty (portString)) {
        checkArgument (! portString.startsWith ("+"), "Unparseable port number: %s", hostPortString);
        try {
            port = Integer.parseInt (portString);
        } catch (NumberFormatException e) {
            throw new IllegalArgumentException ("Unparseable port number: " + hostPortString);
        }
        checkArgument (isValidPort (port), "Port number out of range: %s", hostPortString);
    }
    return new HostAndPort (host, port, hasBracketlessColons);
}

private static String [] getHostAndPortFromBracketedHost (String hostPortString) {
    int colonIndex = 0;
    int closeBracketIndex = 0;
    checkArgument (hostPortString.charAt (0) == '[', "Bracketed host-port string must start with a bracket: %s", hostPortString);
    colonIndex = hostPortString.indexOf (':');
    closeBracketIndex = hostPortString.lastIndexOf (']');
    checkArgument (colonIndex > - 1 && closeBracketIndex > colonIndex, "Invalid bracketed host/port: %s", hostPortString);
    String host = hostPortString.substring (1, closeBracketIndex);
    if (closeBracketIndex + 1 == hostPortString.length ()) {
        return new String [] {host, ""};
    } else {
        checkArgument (hostPortString.charAt (closeBracketIndex + 1) == ':', "Only a colon may follow a close bracket: %s", hostPortString);
        for (int i = closeBracketIndex + 2;
        i < hostPortString.length (); ++ i) {
            checkArgument (Character.isDigit (hostPortString.charAt (i)), "Port must be numeric: %s", hostPortString);
        }
        return new String [] {host, hostPortString.substring (closeBracketIndex + 2)};
    }
}

public HostAndPort withDefaultPort (int defaultPort) {
    checkArgument (isValidPort (defaultPort));
    if (hasPort () || port == defaultPort) {
        return this;
    }
    return new HostAndPort (host, defaultPort, hasBracketlessColons);
}

public HostAndPort requireBracketsForIPv6 () {
    checkArgument (! hasBracketlessColons, "Possible bracketless IPv6 literal: %s", host);
    return this;
}

public boolean equals (@Nullable
Object other) {
    if (this == other) {
        return true;
    }
    if (other instanceof HostAndPort) {
        HostAndPort that = (HostAndPort) other;
        return Objects.equal (this.host, that.host) && this.port == that.port && this.hasBracketlessColons == that.hasBracketlessColons;
    }
    return false;
}

public int hashCode () {
    return Objects.hashCode (host, port, hasBracketlessColons);
}

public String toString () {
    StringBuilder builder = new StringBuilder (host.length () + 8);
    if (host.indexOf (':') >= 0) {
        builder.append ('[').append (host).append (']');
    } else {
        builder.append (host);
    }
    if (hasPort ()) {
        builder.append (':').append (port);
    }
    return builder.toString ();
}

private static boolean isValidPort (int port) {
    return port >= 0 && port <= 65535;
}

private static Inet4Address getInet4Address (byte [] bytes) {
    checkArgument (bytes.length == 4, "Byte array has invalid length for an IPv4 address: %s != 4.", bytes.length);
    return (Inet4Address) bytesToInetAddress (bytes);
}

public static InetAddress forString (String ipString) {
    byte [] addr = ipStringToBytes (ipString);
    if (addr == null) {
        throw formatIllegalArgumentException ("'%s' is not an IP string literal.", ipString);
    }
    return bytesToInetAddress (addr);
}

public static boolean isInetAddress (String ipString) {
    return ipStringToBytes (ipString) != null;
}

private static byte [] ipStringToBytes (String ipString) {
    boolean hasColon = false;
    boolean hasDot = false;
    for (int i = 0;
    i < ipString.length (); i ++) {
        char c = ipString.charAt (i);
        if (c == '.') {
            hasDot = true;
        } else if (c == ':') {
            if (hasDot) {
                return null;
            }
            hasColon = true;
        } else if (Character.digit (c, 16) == - 1) {
            return null;
        }

    }
    if (hasColon) {
        if (hasDot) {
            ipString = convertDottedQuadToHex (ipString);
            if (ipString == null) {
                return null;
            }
        }
        return textToNumericFormatV6 (ipString);
    } else if (hasDot) {
        return textToNumericFormatV4 (ipString);
    }

    return null;
}

private static byte [] textToNumericFormatV4 (String ipString) {
    byte [] bytes = new byte [IPV4_PART_COUNT];
    int i = 0;
    try {
        for (String octet : IPV4_SPLITTER.split (ipString)) {
            bytes [i ++] = parseOctet (octet);
        }
    } catch (NumberFormatException ex) {
        return null;
    }
    return i == IPV4_PART_COUNT ? bytes : null;
}

private static byte [] textToNumericFormatV6 (String ipString) {
    String [] parts = ipString.split (":", IPV6_PART_COUNT + 2);
    if (parts.length < 3 || parts.length > IPV6_PART_COUNT + 1) {
        return null;
    }
    int skipIndex = - 1;
    for (int i = 1;
    i < parts.length - 1; i ++) {
        if (parts [i].length () == 0) {
            if (skipIndex >= 0) {
                return null;
            }
            skipIndex = i;
        }
    }
    int partsHi;
    int partsLo;
    if (skipIndex >= 0) {
        partsHi = skipIndex;
        partsLo = parts.length - skipIndex - 1;
        if (parts [0].length () == 0 && -- partsHi != 0) {
            return null;
        }
        if (parts [parts.length - 1].length () == 0 && -- partsLo != 0) {
            return null;
        }
    } else {
        partsHi = parts.length;
        partsLo = 0;
    }
    int partsSkipped = IPV6_PART_COUNT - (partsHi + partsLo);
    if (! (skipIndex >= 0 ? partsSkipped >= 1 : partsSkipped == 0)) {
        return null;
    }
    ByteBuffer rawBytes = ByteBuffer.allocate (2 * IPV6_PART_COUNT);
    try {
        for (int i = 0;
        i < partsHi; i ++) {
            rawBytes.putShort (parseHextet (parts [i]));
        }
        for (int i = 0;
        i < partsSkipped; i ++) {
            rawBytes.putShort ((short) 0);
        }
        for (int i = partsLo;
        i > 0; i --) {
            rawBytes.putShort (parseHextet (parts [parts.length - i]));
        }
    } catch (NumberFormatException ex) {
        return null;
    }
    return rawBytes.array ();
}

private static String convertDottedQuadToHex (String ipString) {
    int lastColon = ipString.lastIndexOf (':');
    String initialPart = ipString.substring (0, lastColon + 1);
    String dottedQuad = ipString.substring (lastColon + 1);
    byte [] quad = textToNumericFormatV4 (dottedQuad);
    if (quad == null) {
        return null;
    }
    String penultimate = Integer.toHexString (((quad [0] & 0xff) << 8) | (quad [1] & 0xff));
    String ultimate = Integer.toHexString (((quad [2] & 0xff) << 8) | (quad [3] & 0xff));
    return initialPart + penultimate + ":" + ultimate;
}

private static byte parseOctet (String ipPart) {
    int octet = Integer.parseInt (ipPart);
    if (octet > 255 || (ipPart.startsWith ("0") && ipPart.length () > 1)) {
        throw new NumberFormatException ();
    }
    return (byte) octet;
}

private static short parseHextet (String ipPart) {
    int hextet = Integer.parseInt (ipPart, 16);
    if (hextet > 0xffff) {
        throw new NumberFormatException ();
    }
    return (short) hextet;
}

private static InetAddress bytesToInetAddress (byte [] addr) {
    try {
        return InetAddress.getByAddress (addr);
    } catch (UnknownHostException e) {
        throw new AssertionError (e);
    }
}

public static String toAddrString (InetAddress ip) {
    checkNotNull (ip);
    if (ip instanceof Inet4Address) {
        return ip.getHostAddress ();
    }
    checkArgument (ip instanceof Inet6Address);
    byte [] bytes = ip.getAddress ();
    int [] hextets = new int [IPV6_PART_COUNT];
    for (int i = 0;
    i < hextets.length; i ++) {
        hextets [i] = Ints.fromBytes ((byte) 0, (byte) 0, bytes [2 * i], bytes [2 * i + 1]);
    }
    compressLongestRunOfZeroes (hextets);
    return hextetsToIPv6String (hextets);
}

private static void compressLongestRunOfZeroes (int [] hextets) {
    int bestRunStart = - 1;
    int bestRunLength = - 1;
    int runStart = - 1;
    for (int i = 0;
    i < hextets.length + 1; i ++) {
        if (i < hextets.length && hextets [i] == 0) {
            if (runStart < 0) {
                runStart = i;
            }
        } else if (runStart >= 0) {
            int runLength = i - runStart;
            if (runLength > bestRunLength) {
                bestRunStart = runStart;
                bestRunLength = runLength;
            }
            runStart = - 1;
        }

    }
    if (bestRunLength >= 2) {
        Arrays.fill (hextets, bestRunStart, bestRunStart + bestRunLength, - 1);
    }
}

private static String hextetsToIPv6String (int [] hextets) {
    StringBuilder buf = new StringBuilder (39);
    boolean lastWasNumber = false;
    for (int i = 0;
    i < hextets.length; i ++) {
        boolean thisIsNumber = hextets [i] >= 0;
        if (thisIsNumber) {
            if (lastWasNumber) {
                buf.append (':');
            }
            buf.append (Integer.toHexString (hextets [i]));
        } else {
            if (i == 0 || lastWasNumber) {
                buf.append ("::");
            }
        }
        lastWasNumber = thisIsNumber;
    }
    return buf.toString ();
}

public static String toUriString (InetAddress ip) {
    if (ip instanceof Inet6Address) {
        return "[" + toAddrString (ip) + "]";
    }
    return toAddrString (ip);
}

public static InetAddress forUriString (String hostAddr) {
    InetAddress addr = forUriStringNoThrow (hostAddr);
    if (addr == null) {
        throw formatIllegalArgumentException ("Not a valid URI IP literal: '%s'", hostAddr);
    }
    return addr;
}

private static InetAddress forUriStringNoThrow (String hostAddr) {
    checkNotNull (hostAddr);
    String ipString;
    int expectBytes;
    if (hostAddr.startsWith ("[") && hostAddr.endsWith ("]")) {
        ipString = hostAddr.substring (1, hostAddr.length () - 1);
        expectBytes = 16;
    } else {
        ipString = hostAddr;
        expectBytes = 4;
    }
    byte [] addr = ipStringToBytes (ipString);
    if (addr == null || addr.length != expectBytes) {
        return null;
    }
    return bytesToInetAddress (addr);
}

public static boolean isUriInetAddress (String ipString) {
    return forUriStringNoThrow (ipString) != null;
}

public static boolean isCompatIPv4Address (Inet6Address ip) {
    if (! ip.isIPv4CompatibleAddress ()) {
        return false;
    }
    byte [] bytes = ip.getAddress ();
    if ((bytes [12] == 0) && (bytes [13] == 0) && (bytes [14] == 0) && ((bytes [15] == 0) || (bytes [15] == 1))) {
        return false;
    }
    return true;
}

public static Inet4Address getCompatIPv4Address (Inet6Address ip) {
    checkArgument (isCompatIPv4Address (ip), "Address '%s' is not IPv4-compatible.", toAddrString (ip));
    return getInet4Address (Arrays.copyOfRange (ip.getAddress (), 12, 16));
}

public static boolean is6to4Address (Inet6Address ip) {
    byte [] bytes = ip.getAddress ();
    return (bytes [0] == (byte) 0x20) && (bytes [1] == (byte) 0x02);
}

public static Inet4Address get6to4IPv4Address (Inet6Address ip) {
    checkArgument (is6to4Address (ip), "Address '%s' is not a 6to4 address.", toAddrString (ip));
    return getInet4Address (Arrays.copyOfRange (ip.getAddress (), 2, 6));
}

public TeredoInfo (@Nullable
Inet4Address server,@Nullable
Inet4Address client, int port, int flags) {
    checkArgument ((port >= 0) && (port <= 0xffff), "port '%s' is out of range (0 <= port <= 0xffff)", port);
    checkArgument ((flags >= 0) && (flags <= 0xffff), "flags '%s' is out of range (0 <= flags <= 0xffff)", flags);
    this.server = MoreObjects.firstNonNull (server, ANY4);
    this.client = MoreObjects.firstNonNull (client, ANY4);
    this.port = port;
    this.flags = flags;
}

public Inet4Address getServer () {
    return server;
}

public Inet4Address getClient () {
    return client;
}

public int getPort () {
    return port;
}

public int getFlags () {
    return flags;
}

public static boolean isTeredoAddress (Inet6Address ip) {
    byte [] bytes = ip.getAddress ();
    return (bytes [0] == (byte) 0x20) && (bytes [1] == (byte) 0x01) && (bytes [2] == 0) && (bytes [3] == 0);
}

public static TeredoInfo getTeredoInfo (Inet6Address ip) {
    checkArgument (isTeredoAddress (ip), "Address '%s' is not a Teredo address.", toAddrString (ip));
    byte [] bytes = ip.getAddress ();
    Inet4Address server = getInet4Address (Arrays.copyOfRange (bytes, 4, 8));
    int flags = ByteStreams.newDataInput (bytes, 8).readShort () & 0xffff;
    int port = ~ ByteStreams.newDataInput (bytes, 10).readShort () & 0xffff;
    byte [] clientBytes = Arrays.copyOfRange (bytes, 12, 16);
    for (int i = 0;
    i < clientBytes.length; i ++) {
        clientBytes [i] = (byte) ~ clientBytes [i];
    }
    Inet4Address client = getInet4Address (clientBytes);
    return new TeredoInfo (server, client, port, flags);
}

public static boolean isIsatapAddress (Inet6Address ip) {
    if (isTeredoAddress (ip)) {
        return false;
    }
    byte [] bytes = ip.getAddress ();
    if ((bytes [8] | (byte) 0x03) != (byte) 0x03) {
        return false;
    }
    return (bytes [9] == (byte) 0x00) && (bytes [10] == (byte) 0x5e) && (bytes [11] == (byte) 0xfe);
}

public static Inet4Address getIsatapIPv4Address (Inet6Address ip) {
    checkArgument (isIsatapAddress (ip), "Address '%s' is not an ISATAP address.", toAddrString (ip));
    return getInet4Address (Arrays.copyOfRange (ip.getAddress (), 12, 16));
}

public static boolean hasEmbeddedIPv4ClientAddress (Inet6Address ip) {
    return isCompatIPv4Address (ip) || is6to4Address (ip) || isTeredoAddress (ip);
}

public static Inet4Address getEmbeddedIPv4ClientAddress (Inet6Address ip) {
    if (isCompatIPv4Address (ip)) {
        return getCompatIPv4Address (ip);
    }
    if (is6to4Address (ip)) {
        return get6to4IPv4Address (ip);
    }
    if (isTeredoAddress (ip)) {
        return getTeredoInfo (ip).getClient ();
    }
    throw formatIllegalArgumentException ("'%s' has no embedded IPv4 address.", toAddrString (ip));
}

public static boolean isMappedIPv4Address (String ipString) {
    byte [] bytes = ipStringToBytes (ipString);
    if (bytes != null && bytes.length == 16) {
        for (int i = 0;
        i < 10; i ++) {
            if (bytes [i] != 0) {
                return false;
            }
        }
        for (int i = 10;
        i < 12; i ++) {
            if (bytes [i] != (byte) 0xff) {
                return false;
            }
        }
        return true;
    }
    return false;
}

public static Inet4Address getCoercedIPv4Address (InetAddress ip) {
    if (ip instanceof Inet4Address) {
        return (Inet4Address) ip;
    }
    byte [] bytes = ip.getAddress ();
    boolean leadingBytesOfZero = true;
    for (int i = 0;
    i < 15; ++ i) {
        if (bytes [i] != 0) {
            leadingBytesOfZero = false;
            break;
        }
    }
    if (leadingBytesOfZero && (bytes [15] == 1)) {
        return LOOPBACK4;
    } else if (leadingBytesOfZero && (bytes [15] == 0)) {
        return ANY4;
    }

    Inet6Address ip6 = (Inet6Address) ip;
    long addressAsLong = 0;
    if (hasEmbeddedIPv4ClientAddress (ip6)) {
        addressAsLong = getEmbeddedIPv4ClientAddress (ip6).hashCode ();
    } else {
        addressAsLong = ByteBuffer.wrap (ip6.getAddress (), 0, 8).getLong ();
    }
    int coercedHash = Hashing.murmur3_32 ().hashLong (addressAsLong).asInt ();
    coercedHash |= 0xe0000000;
    if (coercedHash == 0xffffffff) {
        coercedHash = 0xfffffffe;
    }
    return getInet4Address (Ints.toByteArray (coercedHash));
}

public static int coerceToInteger (InetAddress ip) {
    return ByteStreams.newDataInput (getCoercedIPv4Address (ip).getAddress ()).readInt ();
}

public static Inet4Address fromInteger (int address) {
    return getInet4Address (Ints.toByteArray (address));
}

public static InetAddress fromLittleEndianByteArray (byte [] addr) throws UnknownHostException {
    byte [] reversed = new byte [addr.length];
    for (int i = 0;
    i < addr.length; i ++) {
        reversed [i] = addr [addr.length - i - 1];
    }
    return InetAddress.getByAddress (reversed);
}

public static InetAddress decrement (InetAddress address) {
    byte [] addr = address.getAddress ();
    int i = addr.length - 1;
    while (i >= 0 && addr [i] == (byte) 0x00) {
        addr [i] = (byte) 0xff;
        i --;
    }
    checkArgument (i >= 0, "Decrementing %s would wrap.", address);
    addr [i] --;
    return bytesToInetAddress (addr);
}

public static InetAddress increment (InetAddress address) {
    byte [] addr = address.getAddress ();
    int i = addr.length - 1;
    while (i >= 0 && addr [i] == (byte) 0xff) {
        addr [i] = 0;
        i --;
    }
    checkArgument (i >= 0, "Incrementing %s would wrap.", address);
    addr [i] ++;
    return bytesToInetAddress (addr);
}

public static boolean isMaximum (InetAddress address) {
    byte [] addr = address.getAddress ();
    for (int i = 0;
    i < addr.length; i ++) {
        if (addr [i] != (byte) 0xff) {
            return false;
        }
    }
    return true;
}

