private static MediaType create (String type, String subtype, Multimap < String, String > parameters) {
    checkNotNull (type);
    checkNotNull (subtype);
    checkNotNull (parameters);
    String normalizedType = normalizeToken (type);
    String normalizedSubtype = normalizeToken (subtype);
    checkArgument (! WILDCARD.equals (normalizedType) || WILDCARD.equals (normalizedSubtype), "A wildcard type cannot be used with a non-wildcard subtype");
    ImmutableListMultimap.Builder < String, String > builder = ImmutableListMultimap.builder ();
    for (Entry < String, String > entry : parameters.entries ()) {
        String attribute = normalizeToken (entry.getKey ());
        builder.put (attribute, normalizeParameterValue (attribute, entry.getValue ()));
    }
    MediaType mediaType = new MediaType (normalizedType, normalizedSubtype, builder.build ());
    return MoreObjects.firstNonNull (KNOWN_TYPES.get (mediaType), mediaType);
}

private static String normalizeToken (String token) {
    checkArgument (TOKEN_MATCHER.matchesAllOf (token));
    return Ascii.toLowerCase (token);
}

private static String normalizeParameterValue (String attribute, String value) {
    return CHARSET_ATTRIBUTE.equals (attribute) ? Ascii.toLowerCase (value) : value;
}

public static MediaType parse (String input) {
    checkNotNull (input);
    Tokenizer tokenizer = new Tokenizer (input);
    try {
        String type = tokenizer.consumeToken (TOKEN_MATCHER);
        tokenizer.consumeCharacter ('/');
        String subtype = tokenizer.consumeToken (TOKEN_MATCHER);
        ImmutableListMultimap.Builder < String, String > parameters = ImmutableListMultimap.builder ();
        while (tokenizer.hasMore ()) {
            tokenizer.consumeTokenIfPresent (LINEAR_WHITE_SPACE);
            tokenizer.consumeCharacter (';');
            tokenizer.consumeTokenIfPresent (LINEAR_WHITE_SPACE);
            String attribute = tokenizer.consumeToken (TOKEN_MATCHER);
            tokenizer.consumeCharacter ('=');
            final String value;
            if ('"' == tokenizer.previewChar ()) {
                tokenizer.consumeCharacter ('"');
                StringBuilder valueBuilder = new StringBuilder ();
                while ('"' != tokenizer.previewChar ()) {
                    if ('\\' == tokenizer.previewChar ()) {
                        tokenizer.consumeCharacter ('\\');
                        valueBuilder.append (tokenizer.consumeCharacter (ascii ()));
                    } else {
                        valueBuilder.append (tokenizer.consumeToken (QUOTED_TEXT_MATCHER));
                    }
                }
                value = valueBuilder.toString ();
                tokenizer.consumeCharacter ('"');
            } else {
                value = tokenizer.consumeToken (TOKEN_MATCHER);
            }
            parameters.put (attribute, value);
        }
        return create (type, subtype, parameters.build ());
    } catch (IllegalStateException e) {
        throw new IllegalArgumentException ("Could not parse '" + input + "'", e);
    }
}

Tokenizer (String input) {
    this.input = input;
}

String consumeTokenIfPresent (CharMatcher matcher) {
    checkState (hasMore ());
    int startPosition = position;
    position = matcher.negate ().indexIn (input, startPosition);
    return hasMore () ? input.substring (startPosition, position) : input.substring (startPosition);
}

String consumeToken (CharMatcher matcher) {
    int startPosition = position;
    String token = consumeTokenIfPresent (matcher);
    checkState (position != startPosition);
    return token;
}

char consumeCharacter (CharMatcher matcher) {
    checkState (hasMore ());
    char c = previewChar ();
    checkState (matcher.matches (c));
    position ++;
    return c;
}

char consumeCharacter (char c) {
    checkState (hasMore ());
    checkState (previewChar () == c);
    position ++;
    return c;
}

char previewChar () {
    checkState (hasMore ());
    return input.charAt (position);
}

boolean hasMore () {
    return (position >= 0) && (position < input.length ());
}

public boolean equals (@Nullable
Object obj) {
    if (obj == this) {
        return true;
    } else if (obj instanceof MediaType) {
        MediaType that = (MediaType) obj;
        return this.type.equals (that.type) && this.subtype.equals (that.subtype) && this.parametersAsMap ().equals (that.parametersAsMap ());
    } else {
        return false;
    }

}

public int hashCode () {
    int h = hashCode;
    if (h == 0) {
        h = Objects.hashCode (type, subtype, parametersAsMap ());
        hashCode = h;
    }
    return h;
}

public String toString () {
    String result = toString;
    if (result == null) {
        result = computeToString ();
        toString = result;
    }
    return result;
}

private String computeToString () {
    StringBuilder builder = new StringBuilder ().append (type).append ('/').append (subtype);
    if (! parameters.isEmpty ()) {
        builder.append ("; ");
        Multimap < String, String > quotedParameters = Multimaps.transformValues (parameters, new Function < String, String > () {
            @Override
            public String apply (String value) {
                return TOKEN_MATCHER.matchesAllOf (value) ? value : escapeAndQuote (value);
            }}

        );
        PARAMETER_JOINER.appendTo (builder, quotedParameters.entries ());
    }
    return builder.toString ();
}

public String apply (String value) {
    return TOKEN_MATCHER.matchesAllOf (value) ? value : escapeAndQuote (value);
}

private static String escapeAndQuote (String value) {
    StringBuilder escaped = new StringBuilder (value.length () + 16).append ('"');
    for (int i = 0;
    i < value.length (); i ++) {
        char ch = value.charAt (i);
        if (ch == '\r' || ch == '\\' || ch == '"') {
            escaped.append ('\\');
        }
        escaped.append (ch);
    }
    return escaped.append ('"').toString ();
}

