            return rest.length + 2;
        }@Override
        public Object get (int index) {
            switch (index) {
                case 0 :
                    return first;
                case 1 :
                    return second;
                default :
                    return rest [index - 2];
            }
        }}

    ;
}

public int size () {
    return rest.length + 2;
}

