Object value) {
    ValueHolder valueHolder = addHolder ();
    valueHolder.value = value;
    return this;
}

private ToStringHelper addHolder (String name,@Nullable
Object value) {
    ValueHolder valueHolder = addHolder ();
    valueHolder.value = value;
    valueHolder.name = checkNotNull (name);
    return this;
}

protected FinalizableSoftReference (T referent, FinalizableReferenceQueue queue) {
    super (referent, queue.queue);
    queue.cleanUp ();
}

protected final T endOfData () {
    state = State.DONE;
    return null;
}

public final boolean hasNext () {
    checkState (state != State.FAILED);
    switch (state) {
        case READY :
            return true;
        case DONE :
            return false;
        default :
    }
    return tryToComputeNext ();
}

private boolean tryToComputeNext () {
    state = State.FAILED;
    next = computeNext ();
    if (state != State.DONE) {
        state = State.READY;
        return true;
    }
    return false;
}

public final T next () {
    if (! hasNext ()) {
        throw new NoSuchElementException ();
    }
    state = State.NOT_READY;
    T result = next;
    next = null;
    return result;
}

public final void remove () {
    throw new UnsupportedOperationException ();
}

public static void startFinalizer (Class < ? > finalizableReferenceClass, ReferenceQueue < Object > queue, PhantomReference < Object > frqReference) {
    if (! finalizableReferenceClass.getName ().equals (FINALIZABLE_REFERENCE)) {
        throw new IllegalArgumentException ("Expected " + FINALIZABLE_REFERENCE + ".");
    }
    Finalizer finalizer = new Finalizer (finalizableReferenceClass, queue, frqReference);
    Thread thread = new Thread (finalizer);
    thread.setName (Finalizer.class.getName ());
    thread.setDaemon (true);
    try {
        if (inheritableThreadLocals != null) {
            inheritableThreadLocals.set (thread, null);
        }
    } catch (Throwable t) {
        logger.log (Level.INFO, "Failed to clear thread local values inherited by reference finalizer thread.", t);
    }
    thread.start ();
}

private Finalizer (Class < ? > finalizableReferenceClass, ReferenceQueue < Object > queue, PhantomReference < Object > frqReference) {
    this.queue = queue;
    this.finalizableReferenceClassReference = new WeakReference < Class < ? > > (finalizableReferenceClass);
    this.frqReference = frqReference;
}

public void run () {
    while (true) {
        try {
            if (! cleanUp (queue.remove ())) {
                break;
            }
        } catch (InterruptedException e) {
        }
    }
}

private boolean cleanUp (Reference < ? > reference) {
    Method finalizeReferentMethod = getFinalizeReferentMethod ();
    if (finalizeReferentMethod == null) {
        return false;
    }
    do {
        reference.clear ();
        if (reference == frqReference) {
            return false;
        }
        try {
            finalizeReferentMethod.invoke (reference);
        } catch (Throwable t) {
            logger.log (Level.SEVERE, "Error cleaning up after reference.", t);
        }
    } while ((reference = queue.poll ()) != null);
    return true;
}

private Method getFinalizeReferentMethod () {
    Class < ? > finalizableReferenceClass = finalizableReferenceClassReference.get ();
    if (finalizableReferenceClass == null) {
        return null;
    }
    try {
        return finalizableReferenceClass.getMethod ("finalizeReferent");
    } catch (NoSuchMethodException e) {
        throw new AssertionError (e);
    }
}

public static Field getInheritableThreadLocalsField () {
    try {
        Field inheritableThreadLocals = Thread.class.getDeclaredField ("inheritableThreadLocals");
        inheritableThreadLocals.setAccessible (true);
        return inheritableThreadLocals;
    } catch (Throwable t) {
        logger.log (Level.INFO, "Couldn't access Thread.inheritableThreadLocals. Reference finalizer threads will " + "inherit thread local values.");
        return null;
    }
}

public static int encodedLength (CharSequence sequence) {
    int utf16Length = sequence.length ();
    int utf8Length = utf16Length;
    int i = 0;
    while (i < utf16Length && sequence.charAt (i) < 0x80) {
        i ++;
    }
    for (; i < utf16Length; i ++) {
        char c = sequence.charAt (i);
        if (c < 0x800) {
            utf8Length += ((0x7f - c)>>> 31);
        } else {
            utf8Length += encodedLengthGeneral (sequence, i);
            break;
        }
    }
    if (utf8Length < utf16Length) {
        throw new IllegalArgumentException ("UTF-8 length does not fit in int: " + (utf8Length + (1L << 32)));
    }
    return utf8Length;
}

private static int encodedLengthGeneral (CharSequence sequence, int start) {
    int utf16Length = sequence.length ();
    int utf8Length = 0;
    for (int i = start;
    i < utf16Length; i ++) {
        char c = sequence.charAt (i);
        if (c < 0x800) {
            utf8Length += (0x7f - c)>>> 31;
        } else {
            utf8Length += 2;
            if (MIN_SURROGATE <= c && c <= MAX_SURROGATE) {
                if (Character.codePointAt (sequence, i) == c) {
                    throw new IllegalArgumentException (unpairedSurrogateMsg (i));
                }
                i ++;
            }
        }
    }
    return utf8Length;
}

public static boolean isWellFormed (byte [] bytes) {
    return isWellFormed (bytes, 0, bytes.length);
}

public static boolean isWellFormed (byte [] bytes, int off, int len) {
    int end = off + len;
    checkPositionIndexes (off, end, bytes.length);
    for (int i = off;
    i < end; i ++) {
        if (bytes [i] < 0) {
            return isWellFormedSlowPath (bytes, i, end);
        }
    }
    return true;
}

private static boolean isWellFormedSlowPath (byte [] bytes, int off, int end) {
    int index = off;
    while (true) {
        int byte1;
        do {
            if (index >= end) {
                return true;
            }
        } while ((byte1 = bytes [index ++]) >= 0);
        if (byte1 < (byte) 0xE0) {
            if (index == end) {
                return false;
            }
            if (byte1 < (byte) 0xC2 || bytes [index ++] > (byte) 0xBF) {
                return false;
            }
        } else if (byte1 < (byte) 0xF0) {
            if (index + 1 >= end) {
                return false;
            }
            int byte2 = bytes [index ++];
            if (byte2 > (byte) 0xBF || (byte1 == (byte) 0xE0 && byte2 < (byte) 0xA0) || (byte1 == (byte) 0xED && (byte) 0xA0 <= byte2) || bytes [index ++] > (byte) 0xBF) {
                return false;
            }
        } else {
            if (index + 2 >= end) {
                return false;
            }
            int byte2 = bytes [index ++];
            if (byte2 > (byte) 0xBF || (((byte1 << 28) + (byte2 - (byte) 0x90))>> 30) != 0 || bytes [index ++] > (byte) 0xBF || bytes [index ++] > (byte) 0xBF) {
                return false;
            }
        }

    }
}

private static String unpairedSurrogateMsg (int i) {
    return "Unpaired surrogate at index " + i;
}

public static String toLowerCase (String string) {
    int length = string.length ();
    for (int i = 0;
    i < length; i ++) {
        if (isUpperCase (string.charAt (i))) {
            char [] chars = string.toCharArray ();
            for (; i < length; i ++) {
                char c = chars [i];
                if (isUpperCase (c)) {
                    chars [i] = (char) (c ^ 0x20);
                }
            }
            return String.valueOf (chars);
        }
    }
    return string;
}

public static String toLowerCase (CharSequence chars) {
    if (chars instanceof String) {
        return toLowerCase ((String) chars);
    }
    char [] newChars = new char [chars.length ()];
    for (int i = 0;
    i < newChars.length; i ++) {
        newChars [i] = toLowerCase (chars.charAt (i));
    }
    return String.valueOf (newChars);
}

public static char toLowerCase (char c) {
    return isUpperCase (c) ? (char) (c ^ 0x20) : c;
}

public static String toUpperCase (String string) {
    int length = string.length ();
    for (int i = 0;
    i < length; i ++) {
        if (isLowerCase (string.charAt (i))) {
            char [] chars = string.toCharArray ();
            for (; i < length; i ++) {
                char c = chars [i];
                if (isLowerCase (c)) {
                    chars [i] = (char) (c & 0x5f);
                }
            }
            return String.valueOf (chars);
        }
    }
    return string;
}

public static String toUpperCase (CharSequence chars) {
    if (chars instanceof String) {
        return toUpperCase ((String) chars);
    }
    char [] newChars = new char [chars.length ()];
    for (int i = 0;
    i < newChars.length; i ++) {
        newChars [i] = toUpperCase (chars.charAt (i));
    }
    return String.valueOf (newChars);
}

public static char toUpperCase (char c) {
    return isLowerCase (c) ? (char) (c & 0x5f) : c;
}

public static boolean isLowerCase (char c) {
    return (c >= 'a') && (c <= 'z');
}

public static boolean isUpperCase (char c) {
    return (c >= 'A') && (c <= 'Z');
}

public static String truncate (CharSequence seq, int maxLength, String truncationIndicator) {
    checkNotNull (seq);
    int truncationLength = maxLength - truncationIndicator.length ();
    checkArgument (truncationLength >= 0, "maxLength (%s) must be >= length of the truncation indicator (%s)", maxLength, truncationIndicator.length ());
    if (seq.length () <= maxLength) {
        String string = seq.toString ();
        if (string.length () <= maxLength) {
            return string;
        }
        seq = string;
    }
    return new StringBuilder (maxLength).append (seq, 0, truncationLength).append (truncationIndicator).toString ();
}

public static boolean equalsIgnoreCase (CharSequence s1, CharSequence s2) {
    int length = s1.length ();
    if (s1 == s2) {
        return true;
    }
    if (length != s2.length ()) {
        return false;
    }
    for (int i = 0;
    i < length; i ++) {
        char c1 = s1.charAt (i);
        char c2 = s2.charAt (i);
        if (c1 == c2) {
            continue;
        }
        int alphaIndex = getAlphaIndex (c1);
        if (alphaIndex < 26 && alphaIndex == getAlphaIndex (c2)) {
            continue;
        }
        return false;
    }
    return true;
}

private static int getAlphaIndex (char c) {
    return (char) ((c | 0x20) - 'a');
}

