public static < X extends Throwable > void throwIfInstanceOf (Throwable throwable, Class < X > declaredType) throws X {
    checkNotNull (throwable);
    if (declaredType.isInstance (throwable)) {
        throw declaredType.cast (throwable);
    }
}

public static < X extends Throwable > void propagateIfInstanceOf (@Nullable
Throwable throwable, Class < X > declaredType) throws X {
    if (throwable != null) {
        throwIfInstanceOf (throwable, declaredType);
    }
}

public static void throwIfUnchecked (Throwable throwable) {
    checkNotNull (throwable);
    if (throwable instanceof RuntimeException) {
        throw (RuntimeException) throwable;
    }
    if (throwable instanceof Error) {
        throw (Error) throwable;
    }
}

public static void propagateIfPossible (@Nullable
Throwable throwable) {
    if (throwable != null) {
        throwIfUnchecked (throwable);
    }
}

public static < X extends Throwable > void propagateIfPossible (@Nullable
Throwable throwable, Class < X > declaredType) throws X {
    propagateIfInstanceOf (throwable, declaredType);
    propagateIfPossible (throwable);
}

public static < X1 extends Throwable, X2 extends Throwable > void propagateIfPossible (@Nullable
Throwable throwable, Class < X1 > declaredType1, Class < X2 > declaredType2) throws X1, X2 {
    checkNotNull (declaredType2);
    propagateIfInstanceOf (throwable, declaredType1);
    propagateIfPossible (throwable, declaredType2);
}

public static RuntimeException propagate (Throwable throwable) {
    throwIfUnchecked (throwable);
    throw new RuntimeException (throwable);
}

public static Throwable getRootCause (Throwable throwable) {
    Throwable cause;
    while ((cause = throwable.getCause ()) != null) {
        throwable = cause;
    }
    return throwable;
}

public static List < Throwable > getCausalChain (Throwable throwable) {
    checkNotNull (throwable);
    List < Throwable > causes = new ArrayList < Throwable > (4);
    while (throwable != null) {
        causes.add (throwable);
        throwable = throwable.getCause ();
    }
    return Collections.unmodifiableList (causes);
}

