public static < T > Iterable < T > presentInstances (final Iterable < ? extends Optional < ? extends T > > optionals) {
    checkNotNull (optionals);
    return new Iterable < T > () {
        @Override
        public Iterator < T > iterator () {
            return new AbstractIterator < T > () {
                private final Iterator < ? extends Optional < ? extends T > > iterator = checkNotNull (optionals.iterator ());
                @Override
                protected T computeNext () {
                    while (iterator.hasNext ()) {
                        Optional < ? extends T > optional = iterator.next ();
                        if (optional.isPresent ()) {
                            return optional.get ();
                        }
                    }
                    return endOfData ();
                }}

            ;
        }}

    ;
}

public Iterator < T > iterator () {
    return new AbstractIterator < T > () {
        private final Iterator < ? extends Optional < ? extends T > > iterator = checkNotNull (optionals.iterator ());
        @Override
        protected T computeNext () {
            while (iterator.hasNext ()) {
                Optional < ? extends T > optional = iterator.next ();
                if (optional.isPresent ()) {
                    return optional.get ();
                }
            }
            return endOfData ();
        }}

    ;
}

protected T computeNext () {
    while (iterator.hasNext ()) {
        Optional < ? extends T > optional = iterator.next ();
        if (optional.isPresent ()) {
            return optional.get ();
        }
    }
    return endOfData ();
}

public FinalizableReferenceQueue () {
    queue = new ReferenceQueue < Object > ();
    frqRef = new PhantomReference < Object > (this, queue);
    boolean threadStarted = false;
    try {
        startFinalizer.invoke (null, FinalizableReference.class, queue, frqRef);
        threadStarted = true;
    } catch (IllegalAccessException impossible) {
        throw new AssertionError (impossible);
    } catch (Throwable t) {
        logger.log (Level.INFO, "Failed to start reference finalizer thread." + " Reference cleanup will only occur when new references are created.", t);
    }
    this.threadStarted = threadStarted;
}

public void close () {
    frqRef.enqueue ();
    cleanUp ();
}

void cleanUp () {
    if (threadStarted) {
        return;
    }
    Reference < ? > reference;
    while ((reference = queue.poll ()) != null) {
        reference.clear ();
        try {
            ((FinalizableReference) reference).finalizeReferent ();
        } catch (Throwable t) {
            logger.log (Level.SEVERE, "Error cleaning up after reference.", t);
        }
    }
}

private static Class < ? > loadFinalizer (FinalizerLoader...loaders) {
    for (FinalizerLoader loader : loaders) {
        Class < ? > finalizer = loader.loadFinalizer ();
        if (finalizer != null) {
            return finalizer;
        }
    }
    throw new AssertionError ();
}

public Class < ? > loadFinalizer () {
    if (disabled) {
        return null;
    }
    ClassLoader systemLoader;
    try {
        systemLoader = ClassLoader.getSystemClassLoader ();
    } catch (SecurityException e) {
        logger.info ("Not allowed to access system class loader.");
        return null;
    }
    if (systemLoader != null) {
        try {
            return systemLoader.loadClass (FINALIZER_CLASS_NAME);
        } catch (ClassNotFoundException e) {
            return null;
        }
    } else {
        return null;
    }
}

public Class < ? > loadFinalizer () {
    try {
        ClassLoader finalizerLoader = newLoader (getBaseUrl ());
        return finalizerLoader.loadClass (FINALIZER_CLASS_NAME);
    } catch (Exception e) {
        logger.log (Level.WARNING, LOADING_ERROR, e);
        return null;
    }
}

URL getBaseUrl () throws IOException {
    String finalizerPath = FINALIZER_CLASS_NAME.replace ('.', '/') + ".class";
    URL finalizerUrl = getClass ().getClassLoader ().getResource (finalizerPath);
    if (finalizerUrl == null) {
        throw new FileNotFoundException (finalizerPath);
    }
    String urlString = finalizerUrl.toString ();
    if (! urlString.endsWith (finalizerPath)) {
        throw new IOException ("Unsupported path style: " + urlString);
    }
    urlString = urlString.substring (0, urlString.length () - finalizerPath.length ());
    return new URL (finalizerUrl, urlString);
}

URLClassLoader newLoader (URL base) {
    return new URLClassLoader (new URL [] {base}, null);
}

public Class < ? > loadFinalizer () {
    try {
        return Class.forName (FINALIZER_CLASS_NAME);
    } catch (ClassNotFoundException e) {
        throw new AssertionError (e);
    }
}

static Method getStartFinalizer (Class < ? > finalizer) {
    try {
        return finalizer.getMethod ("startFinalizer", Class.class, ReferenceQueue.class, PhantomReference.class);
    } catch (NoSuchMethodException e) {
        throw new AssertionError (e);
    }
}

public static Stopwatch createUnstarted () {
    return new Stopwatch ();
}

public static Stopwatch createUnstarted (Ticker ticker) {
    return new Stopwatch (ticker);
}

public static Stopwatch createStarted () {
    return new Stopwatch ().start ();
}

public static Stopwatch createStarted (Ticker ticker) {
    return new Stopwatch (ticker).start ();
}

Stopwatch () {
    this.ticker = Ticker.systemTicker ();
}

Stopwatch (Ticker ticker) {
    this.ticker = checkNotNull (ticker, "ticker");
}

public boolean isRunning () {
    return isRunning;
}

public Stopwatch start () {
    checkState (! isRunning, "This stopwatch is already running.");
    isRunning = true;
    startTick = ticker.read ();
    return this;
}

public Stopwatch stop () {
    long tick = ticker.read ();
    checkState (isRunning, "This stopwatch is already stopped.");
    isRunning = false;
    elapsedNanos += tick - startTick;
    return this;
}

public Stopwatch reset () {
    elapsedNanos = 0;
    isRunning = false;
    return this;
}

private long elapsedNanos () {
    return isRunning ? ticker.read () - startTick + elapsedNanos : elapsedNanos;
}

public long elapsed (TimeUnit desiredUnit) {
    return desiredUnit.convert (elapsedNanos (), NANOSECONDS);
}

public String toString () {
    long nanos = elapsedNanos ();
    TimeUnit unit = chooseUnit (nanos);
    double value = (double) nanos / NANOSECONDS.convert (1, unit);
    return Platform.formatCompact4Digits (value) + " " + abbreviate (unit);
}

private static TimeUnit chooseUnit (long nanos) {
    if (DAYS.convert (nanos, NANOSECONDS) > 0) {
        return DAYS;
    }
    if (HOURS.convert (nanos, NANOSECONDS) > 0) {
        return HOURS;
    }
    if (MINUTES.convert (nanos, NANOSECONDS) > 0) {
        return MINUTES;
    }
    if (SECONDS.convert (nanos, NANOSECONDS) > 0) {
        return SECONDS;
    }
    if (MILLISECONDS.convert (nanos, NANOSECONDS) > 0) {
        return MILLISECONDS;
    }
    if (MICROSECONDS.convert (nanos, NANOSECONDS) > 0) {
        return MICROSECONDS;
    }
    return NANOSECONDS;
}

private static String abbreviate (TimeUnit unit) {
    switch (unit) {
        case NANOSECONDS :
            return "ns";
        case MICROSECONDS :
            return "\u03bcs";
        case MILLISECONDS :
            return "ms";
        case SECONDS :
            return "s";
        case MINUTES :
            return "min";
        case HOURS :
            return "h";
        case DAYS :
            return "d";
        default :
            throw new AssertionError ();
    }
}

protected FinalizableWeakReference (T referent, FinalizableReferenceQueue queue) {
    super (referent, queue.queue);
    queue.cleanUp ();
}

