CharMatcher precomputedInternal () {
    final BitSet table = new BitSet ();
    setBits (table);
    int totalCharacters = table.cardinality ();
    if (totalCharacters * 2 <= DISTINCT_CHARS) {
        return precomputedPositive (totalCharacters, table, toString ());
    } else {
        table.flip (Character.MIN_VALUE, Character.MAX_VALUE + 1);
        int negatedCharacters = DISTINCT_CHARS - totalCharacters;
        String suffix = ".negate()";
        final String description = toString ();
        String negatedDescription = description.endsWith (suffix) ? description.substring (0, description.length () - suffix.length ()) : description + suffix;
        return new NegatedFastMatcher (precomputedPositive (negatedCharacters, table, negatedDescription)) {
            @Override
            public String toString () {
                return description;
            }}

        ;
    }
}

public String toString () {
    return description;
}

private static CharMatcher precomputedPositive (int totalCharacters, BitSet table, String description) {
    switch (totalCharacters) {
        case 0 :
            return none ();
        case 1 :
            return is ((char) table.nextSetBit (0));
        case 2 :
            char c1 = (char) table.nextSetBit (0);
            char c2 = (char) table.nextSetBit (c1 + 1);
            return isEither (c1, c2);
        default :
            return isSmall (totalCharacters, table.length ()) ? SmallCharMatcher.from (table, description) : new BitSetMatcher (table, description);
    }
}

private static boolean isSmall (int totalCharacters, int tableLength) {
    return totalCharacters <= SmallCharMatcher.MAX_SIZE && tableLength > (totalCharacters * 4 * Character.SIZE);
}

void setBits (BitSet table) {
    for (int c = Character.MAX_VALUE;
    c >= Character.MIN_VALUE; c --) {
        if (matches ((char) c)) {
            table.set (c);
        }
    }
}

public boolean matchesAnyOf (CharSequence sequence) {
    return ! matchesNoneOf (sequence);
}

public boolean matchesAllOf (CharSequence sequence) {
    for (int i = sequence.length () - 1;
    i >= 0; i --) {
        if (! matches (sequence.charAt (i))) {
            return false;
        }
    }
    return true;
}

public boolean matchesNoneOf (CharSequence sequence) {
    return indexIn (sequence) == - 1;
}

public int indexIn (CharSequence sequence) {
    return indexIn (sequence, 0);
}

public int indexIn (CharSequence sequence, int start) {
    int length = sequence.length ();
    checkPositionIndex (start, length);
    for (int i = start;
    i < length; i ++) {
        if (matches (sequence.charAt (i))) {
            return i;
        }
    }
    return - 1;
}

public int lastIndexIn (CharSequence sequence) {
    for (int i = sequence.length () - 1;
    i >= 0; i --) {
        if (matches (sequence.charAt (i))) {
            return i;
        }
    }
    return - 1;
}

public int countIn (CharSequence sequence) {
    int count = 0;
    for (int i = 0;
    i < sequence.length (); i ++) {
        if (matches (sequence.charAt (i))) {
            count ++;
        }
    }
    return count;
}

public String removeFrom (CharSequence sequence) {
    String string = sequence.toString ();
    int pos = indexIn (string);
    if (pos == - 1) {
        return string;
    }
    char [] chars = string.toCharArray ();
    int spread = 1;
    OUT : while (true) {
        pos ++;
        while (true) {
            if (pos == chars.length) {
                break OUT;
            }
            if (matches (chars [pos])) {
                break;
            }
            chars [pos - spread] = chars [pos];
            pos ++;
        }
        spread ++;
    }
    return new String (chars, 0, pos - spread);
}

public String retainFrom (CharSequence sequence) {
    return negate ().removeFrom (sequence);
}

public String replaceFrom (CharSequence sequence, char replacement) {
    String string = sequence.toString ();
    int pos = indexIn (string);
    if (pos == - 1) {
        return string;
    }
    char [] chars = string.toCharArray ();
    chars [pos] = replacement;
    for (int i = pos + 1;
    i < chars.length; i ++) {
        if (matches (chars [i])) {
            chars [i] = replacement;
        }
    }
    return new String (chars);
}

public String replaceFrom (CharSequence sequence, CharSequence replacement) {
    int replacementLen = replacement.length ();
    if (replacementLen == 0) {
        return removeFrom (sequence);
    }
    if (replacementLen == 1) {
        return replaceFrom (sequence, replacement.charAt (0));
    }
    String string = sequence.toString ();
    int pos = indexIn (string);
    if (pos == - 1) {
        return string;
    }
    int len = string.length ();
    StringBuilder buf = new StringBuilder ((len * 3 / 2) + 16);
    int oldpos = 0;
    do {
        buf.append (string, oldpos, pos);
        buf.append (replacement);
        oldpos = pos + 1;
        pos = indexIn (string, oldpos);
    } while (pos != - 1);
    buf.append (string, oldpos, len);
    return buf.toString ();
}

public String trimFrom (CharSequence sequence) {
    int len = sequence.length ();
    int first;
    int last;
    for (first = 0; first < len; first ++) {
        if (! matches (sequence.charAt (first))) {
            break;
        }
    }
    for (last = len - 1; last > first; last --) {
        if (! matches (sequence.charAt (last))) {
            break;
        }
    }
    return sequence.subSequence (first, last + 1).toString ();
}

public String trimLeadingFrom (CharSequence sequence) {
    int len = sequence.length ();
    for (int first = 0;
    first < len; first ++) {
        if (! matches (sequence.charAt (first))) {
            return sequence.subSequence (first, len).toString ();
        }
    }
    return "";
}

public String trimTrailingFrom (CharSequence sequence) {
    int len = sequence.length ();
    for (int last = len - 1;
    last >= 0; last --) {
        if (! matches (sequence.charAt (last))) {
            return sequence.subSequence (0, last + 1).toString ();
        }
    }
    return "";
}

public String collapseFrom (CharSequence sequence, char replacement) {
    int len = sequence.length ();
    for (int i = 0;
    i < len; i ++) {
        char c = sequence.charAt (i);
        if (matches (c)) {
            if (c == replacement && (i == len - 1 || ! matches (sequence.charAt (i + 1)))) {
                i ++;
            } else {
                StringBuilder builder = new StringBuilder (len).append (sequence, 0, i).append (replacement);
                return finishCollapseFrom (sequence, i + 1, len, replacement, builder, true);
            }
        }
    }
    return sequence.toString ();
}

public String trimAndCollapseFrom (CharSequence sequence, char replacement) {
    int len = sequence.length ();
    int first = 0;
    int last = len - 1;
    while (first < len && matches (sequence.charAt (first))) {
        first ++;
    }
    while (last > first && matches (sequence.charAt (last))) {
        last --;
    }
    return (first == 0 && last == len - 1) ? collapseFrom (sequence, replacement) : finishCollapseFrom (sequence, first, last + 1, replacement, new StringBuilder (last + 1 - first), false);
}

private String finishCollapseFrom (CharSequence sequence, int start, int end, char replacement, StringBuilder builder, boolean inMatchingGroup) {
    for (int i = start;
    i < end; i ++) {
        char c = sequence.charAt (i);
        if (matches (c)) {
            if (! inMatchingGroup) {
                builder.append (replacement);
                inMatchingGroup = true;
            }
        } else {
            builder.append (c);
            inMatchingGroup = false;
        }
    }
    return builder.toString ();
}

public boolean apply (Character character) {
    return matches (character);
}

