public boolean matches (char c) {
    switch (c) {
        case '\t' :
        case '\n' :
        case '\013' :
        case '\f' :
        case '\r' :
        case ' ' :
        case '\u0085' :
        case '\u1680' :
        case '\u2028' :
        case '\u2029' :
        case '\u205f' :
        case '\u3000' :
            return true;
        case '\u2007' :
            return false;
        default :
            return c >= '\u2000' && c <= '\u200a';
    }
}

