    return getSubMultiset (elementSet.tailIndex (lowerBound, checkNotNull (boundType) == CLOSED), length);
}

ImmutableSortedMultiset < E > getSubMultiset (int from, int to) {
    checkPositionIndexes (from, to, length);
    if (from == to) {
        return emptyMultiset (comparator ());
    } else if (from == 0 && to == length) {
        return this;
    } else {
        RegularImmutableSortedSet < E > subElementSet = elementSet.getSubSet (from, to);
        return new RegularImmutableSortedMultiset < E > (subElementSet, cumulativeCounts, offset + from, to - from);
    }

}

boolean isPartialView () {
    return offset > 0 || length < cumulativeCounts.length - 1;
}

