public boolean contains (@Nullable
Object target) {
    Object [] table = this.table;
    if (target == null || table == null) {
        return false;
    }
    for (int i = Hashing.smearedHash (target);
    ; i ++) {
        i &= mask;
        Object candidate = table [i];
        if (candidate == null) {
            return false;
        } else if (candidate.equals (target)) {
            return true;
        }

    }
}

