static < R, C, V > RegularImmutableTable < R, C, V > forCells (List < Cell < R, C, V > > cells,@Nullable
final Comparator < ? super R > rowComparator,@Nullable
final Comparator < ? super C > columnComparator) {
    checkNotNull (cells);
    if (rowComparator != null || columnComparator != null) {
        Comparator < Cell < R, C, V > > comparator = new Comparator < Cell < R, C, V > > () {
            @Override
            public int compare (Cell < R, C, V > cell1, Cell < R, C, V > cell2) {
                int rowCompare = (rowComparator == null) ? 0 : rowComparator.compare (cell1.getRowKey (), cell2.getRowKey ());
                if (rowCompare != 0) {
                    return rowCompare;
                }
                return (columnComparator == null) ? 0 : columnComparator.compare (cell1.getColumnKey (), cell2.getColumnKey ());
            }}

        ;
        Collections.sort (cells, comparator);
    }
    return forCellsInternal (cells, rowComparator, columnComparator);
}

public int compare (Cell < R, C, V > cell1, Cell < R, C, V > cell2) {
    int rowCompare = (rowComparator == null) ? 0 : rowComparator.compare (cell1.getRowKey (), cell2.getRowKey ());
    if (rowCompare != 0) {
        return rowCompare;
    }
    return (columnComparator == null) ? 0 : columnComparator.compare (cell1.getColumnKey (), cell2.getColumnKey ());
}

static < R, C, V > RegularImmutableTable < R, C, V > forCells (Iterable < Cell < R, C, V > > cells) {
    return forCellsInternal (cells, null, null);
}

private static final < R, C, V > RegularImmutableTable < R, C, V > forCellsInternal (Iterable < Cell < R, C, V > > cells,@Nullable
Comparator < ? super R > rowComparator,@Nullable
Comparator < ? super C > columnComparator) {
    Set < R > rowSpaceBuilder = new LinkedHashSet < R > ();
    Set < C > columnSpaceBuilder = new LinkedHashSet < C > ();
    ImmutableList < Cell < R, C, V > > cellList = ImmutableList.copyOf (cells);
    for (Cell < R, C, V > cell : cells) {
        rowSpaceBuilder.add (cell.getRowKey ());
        columnSpaceBuilder.add (cell.getColumnKey ());
    }
    ImmutableSet < R > rowSpace = (rowComparator == null) ? ImmutableSet.copyOf (rowSpaceBuilder) : ImmutableSet.copyOf (Ordering.from (rowComparator).immutableSortedCopy (rowSpaceBuilder));
    ImmutableSet < C > columnSpace = (columnComparator == null) ? ImmutableSet.copyOf (columnSpaceBuilder) : ImmutableSet.copyOf (Ordering.from (columnComparator).immutableSortedCopy (columnSpaceBuilder));
    return forOrderedComponents (cellList, rowSpace, columnSpace);
}

static < R, C, V > RegularImmutableTable < R, C, V > forOrderedComponents (ImmutableList < Cell < R, C, V > > cellList, ImmutableSet < R > rowSpace, ImmutableSet < C > columnSpace) {
    return (cellList.size () > (((long) rowSpace.size () * columnSpace.size ()) / 2)) ? new DenseImmutableTable < R, C, V > (cellList, rowSpace, columnSpace) : new SparseImmutableTable < R, C, V > (cellList, rowSpace, columnSpace);
}

