private void ensureCapacity (int minCapacity) {
    if (minCapacity > entries.length) {
        entries = ObjectArrays.arraysCopyOf (entries, ImmutableCollection.Builder.expandedCapacity (entries.length, minCapacity));
        entriesUsed = false;
    }
}

public Builder < K, V > put (K key, V value) {
