public final Iterable < T > children (final T root) {
    checkNotNull (root);
    return new FluentIterable < T > () {
        @Override
        public Iterator < T > iterator () {
            return new AbstractIterator < T > () {
                boolean doneLeft;
                boolean doneRight;
                @Override
                protected T computeNext () {
                    if (! doneLeft) {
                        doneLeft = true;
                        Optional < T > left = leftChild (root);
                        if (left.isPresent ()) {
                            return left.get ();
                        }
                    }
                    if (! doneRight) {
                        doneRight = true;
                        Optional < T > right = rightChild (root);
                        if (right.isPresent ()) {
                            return right.get ();
                        }
                    }
                    return endOfData ();
                }}

            ;
        }}

    ;
}

public Iterator < T > iterator () {
    return new AbstractIterator < T > () {
        boolean doneLeft;
        boolean doneRight;
        @Override
        protected T computeNext () {
            if (! doneLeft) {
                doneLeft = true;
                Optional < T > left = leftChild (root);
                if (left.isPresent ()) {
                    return left.get ();
                }
            }
            if (! doneRight) {
                doneRight = true;
                Optional < T > right = rightChild (root);
                if (right.isPresent ()) {
                    return right.get ();
                }
            }
            return endOfData ();
        }}

    ;
}

protected T computeNext () {
    if (! doneLeft) {
        doneLeft = true;
        Optional < T > left = leftChild (root);
        if (left.isPresent ()) {
            return left.get ();
        }
    }
    if (! doneRight) {
        doneRight = true;
        Optional < T > right = rightChild (root);
        if (right.isPresent ()) {
            return right.get ();
        }
    }
    return endOfData ();
}

UnmodifiableIterator < T > preOrderIterator (T root) {
    return new PreOrderIterator (root);
}

PreOrderIterator (T root) {
    this.stack = new ArrayDeque < T > (8);
    stack.addLast (root);
}

public boolean hasNext () {
    return ! stack.isEmpty ();
}

public T next () {
    T result = stack.removeLast ();
    pushIfPresent (stack, rightChild (result));
    pushIfPresent (stack, leftChild (result));
    return result;
}

public T peek () {
    return stack.getLast ();
}

UnmodifiableIterator < T > postOrderIterator (T root) {
    return new PostOrderIterator (root);
}

PostOrderIterator (T root) {
    this.stack = new ArrayDeque < T > (8);
    stack.addLast (root);
    this.hasExpanded = new BitSet ();
}

public boolean hasNext () {
    return ! stack.isEmpty ();
}

public T next () {
    while (true) {
        T node = stack.getLast ();
        boolean expandedNode = hasExpanded.get (stack.size () - 1);
        if (expandedNode) {
            stack.removeLast ();
            hasExpanded.clear (stack.size ());
            return node;
        } else {
            hasExpanded.set (stack.size () - 1);
            pushIfPresent (stack, rightChild (node));
            pushIfPresent (stack, leftChild (node));
        }
    }
}

public final FluentIterable < T > inOrderTraversal (final T root) {
    checkNotNull (root);
    return new FluentIterable < T > () {
        @Override
        public UnmodifiableIterator < T > iterator () {
            return new InOrderIterator (root);
        }}

    ;
}

public UnmodifiableIterator < T > iterator () {
    return new InOrderIterator (root);
}

InOrderIterator (T root) {
    this.stack = new ArrayDeque < T > (8);
    this.hasExpandedLeft = new BitSet ();
    stack.addLast (root);
}

protected T computeNext () {
    while (! stack.isEmpty ()) {
        T node = stack.getLast ();
        if (hasExpandedLeft.get (stack.size () - 1)) {
            stack.removeLast ();
            hasExpandedLeft.clear (stack.size ());
            pushIfPresent (stack, rightChild (node));
            return node;
        } else {
            hasExpandedLeft.set (stack.size () - 1);
            pushIfPresent (stack, leftChild (node));
        }
    }
    return endOfData ();
}

private static < T > void pushIfPresent (Deque < T > stack, Optional < T > node) {
    if (node.isPresent ()) {
        stack.addLast (node.get ());
    }
}

