    this.map = map;
    totalSize = 0;
    for (Collection < V > values : map.values ()) {
        checkArgument (! values.isEmpty ());
        totalSize += values.size ();
    }
}

Collection < V > createUnmodifiableEmptyCollection () {
    return unmodifiableCollectionSubclass (createCollection ());
}

Collection < V > createCollection (@Nullable
K key) {
    return createCollection ();
}

Map < K, Collection < V > > backingMap () {
    return map;
}

public int size () {
    return totalSize;
}

public boolean containsKey (@Nullable
Object key) {
    return map.containsKey (key);
}

public boolean put (@Nullable
K key,@Nullable
V value) {
    Collection < V > collection = map.get (key);
    if (collection == null) {
        collection = createCollection (key);
        if (collection.add (value)) {
            totalSize ++;
            map.put (key, collection);
            return true;
        } else {
            throw new AssertionError ("New Collection violated the Collection spec");
        }
    } else if (collection.add (value)) {
        totalSize ++;
        return true;
    } else {
        return false;
    }

}

private Collection < V > getOrCreateCollection (@Nullable
K key) {
    Collection < V > collection = map.get (key);
    if (collection == null) {
        collection = createCollection (key);
        map.put (key, collection);
    }
    return collection;
}

public Collection < V > replaceValues (@Nullable
K key, Iterable < ? extends V > values) {
    Iterator < ? extends V > iterator = values.iterator ();
    if (! iterator.hasNext ()) {
        return removeAll (key);
    }
    Collection < V > collection = getOrCreateCollection (key);
    Collection < V > oldValues = createCollection ();
    oldValues.addAll (collection);
    totalSize -= collection.size ();
    collection.clear ();
    while (iterator.hasNext ()) {
        if (collection.add (iterator.next ())) {
            totalSize ++;
        }
    }
    return unmodifiableCollectionSubclass (oldValues);
}

public Collection < V > removeAll (@Nullable
Object key) {
    Collection < V > collection = map.remove (key);
    if (collection == null) {
        return createUnmodifiableEmptyCollection ();
    }
    Collection < V > output = createCollection ();
    output.addAll (collection);
    totalSize -= collection.size ();
    collection.clear ();
    return unmodifiableCollectionSubclass (output);
}

Collection < V > unmodifiableCollectionSubclass (Collection < V > collection) {
    if (collection instanceof SortedSet) {
        return Collections.unmodifiableSortedSet ((SortedSet < V >) collection);
    } else if (collection instanceof Set) {
        return Collections.unmodifiableSet ((Set < V >) collection);
    } else if (collection instanceof List) {
        return Collections.unmodifiableList ((List < V >) collection);
    } else {
        return Collections.unmodifiableCollection (collection);
    }

}

public void clear () {
    for (Collection < V > collection : map.values ()) {
        collection.clear ();
    }
    map.clear ();
    totalSize = 0;
}

public Collection < V > get (@Nullable
K key) {
    Collection < V > collection = map.get (key);
    if (collection == null) {
        collection = createCollection (key);
    }
    return wrapCollection (key, collection);
}

Collection < V > wrapCollection (@Nullable
K key, Collection < V > collection) {
    if (collection instanceof SortedSet) {
        return new WrappedSortedSet (key, (SortedSet < V >) collection, null);
    } else if (collection instanceof Set) {
        return new WrappedSet (key, (Set < V >) collection);
    } else if (collection instanceof List) {
        return wrapList (key, (List < V >) collection, null);
    } else {
        return new WrappedCollection (key, collection, null);
    }

}

private List < V > wrapList (@Nullable
K key, List < V > list,@Nullable
WrappedCollection ancestor) {
    return (list instanceof RandomAccess) ? new RandomAccessWrappedList (key, list, ancestor) : new WrappedList (key, list, ancestor);
}

WrappedCollection (@Nullable
K key, Collection < V > delegate,@Nullable
WrappedCollection ancestor) {
    this.key = key;
    this.delegate = delegate;
    this.ancestor = ancestor;
    this.ancestorDelegate = (ancestor == null) ? null : ancestor.getDelegate ();
}

void refreshIfEmpty () {
    if (ancestor != null) {
        ancestor.refreshIfEmpty ();
        if (ancestor.getDelegate () != ancestorDelegate) {
            throw new ConcurrentModificationException ();
        }
    } else if (delegate.isEmpty ()) {
        Collection < V > newDelegate = map.get (key);
        if (newDelegate != null) {
            delegate = newDelegate;
        }
    }

}

void removeIfEmpty () {
    if (ancestor != null) {
        ancestor.removeIfEmpty ();
    } else if (delegate.isEmpty ()) {
        map.remove (key);
    }

}

K getKey () {
    return key;
}

void addToMap () {
    if (ancestor != null) {
        ancestor.addToMap ();
    } else {
        map.put (key, delegate);
    }
}

public int size () {
    refreshIfEmpty ();
    return delegate.size ();
}

