    if (collection.isEmpty ()) {
        return false;
    }
    int oldSize = size ();
    boolean changed = delegate.addAll (collection);
    if (changed) {
        int newSize = delegate.size ();
        totalSize += (newSize - oldSize);
        if (oldSize == 0) {
            addToMap ();
        }
    }
    return changed;
}

