public boolean remove (@Nullable
Object o) {
    Predicate < ? super Entry < K, V > > entryPredicate = multimap.entryPredicate ();
    for (Iterator < Entry < K, V > > unfilteredItr = multimap.unfiltered ().entries ().iterator ();
    unfilteredItr.hasNext ();) {
        Map.Entry < K, V > entry = unfilteredItr.next ();
        if (entryPredicate.apply (entry) && Objects.equal (entry.getValue (), o)) {
            unfilteredItr.remove ();
            return true;
        }
    }
    return false;
}

public boolean removeAll (Collection < ? > c) {
    return Iterables.removeIf (multimap.unfiltered ().entries (), Predicates.< Entry < K, V > > and (multimap.entryPredicate (), Maps.< V > valuePredicateOnEntries (Predicates.in (c))));
}

public boolean retainAll (Collection < ? > c) {
    return Iterables.removeIf (multimap.unfiltered ().entries (), Predicates.< Entry < K, V > > and (multimap.entryPredicate (), Maps.< V > valuePredicateOnEntries (Predicates.not (Predicates.in (c)))));
}

