private int unsafeCompare (Object o1, Object o2) {
    Comparator < ? super E > comparator = comparator ();
    return (comparator == null) ? ((Comparable < Object >) o1).compareTo (o2) : ((Comparator < Object >) comparator).compare (o1, o2);
}

protected boolean standardContains (@Nullable
Object object) {
    try {
        @SuppressWarnings("unchecked")
        SortedSet < Object > self = (SortedSet < Object >) this;
        Object ceiling = self.tailSet (object).first ();
        return unsafeCompare (ceiling, object) == 0;
    } catch (ClassCastException e) {
        return false;
    } catch (NoSuchElementException e) {
        return false;
    } catch (NullPointerException e) {
        return false;
    }
}

protected boolean standardRemove (@Nullable
Object object) {
    try {
        @SuppressWarnings("unchecked")
        SortedSet < Object > self = (SortedSet < Object >) this;
        Iterator < Object > iterator = self.tailSet (object).iterator ();
        if (iterator.hasNext ()) {
            Object ceiling = iterator.next ();
            if (unsafeCompare (ceiling, object) == 0) {
                iterator.remove ();
                return true;
            }
        }
    } catch (ClassCastException e) {
        return false;
    } catch (NullPointerException e) {
        return false;
    }
    return false;
}

protected SortedSet < E > standardSubSet (E fromElement, E toElement) {
    return tailSet (fromElement).headSet (toElement);
}

