    Count count = mapEntry.getValue ();
    if (count == null || count.get () == 0) {
        Count frequency = backingMap.get (getElement ());
        if (frequency != null) {
            return frequency.get ();
        }
    }
    return (count == null) ? 0 : count.get ();
}

