MapBasedMultisetIterator () {
    this.entryIterator = backingMap.entrySet ().iterator ();
}

public boolean hasNext () {
    return occurrencesLeft > 0 || entryIterator.hasNext ();
}

public E next () {
    if (occurrencesLeft == 0) {
        currentEntry = entryIterator.next ();
        occurrencesLeft = currentEntry.getValue ().get ();
    }
    occurrencesLeft --;
    canRemove = true;
    return currentEntry.getKey ();
}

public void remove () {
    checkRemove (canRemove);
    int frequency = currentEntry.getValue ().get ();
    if (frequency <= 0) {
        throw new ConcurrentModificationException ();
    }
    if (currentEntry.getValue ().addAndGet (- 1) == 0) {
        entryIterator.remove ();
    }
    size --;
    canRemove = false;
}

public int count (@Nullable
Object element) {
    Count frequency = Maps.safeGet (backingMap, element);
    return (frequency == null) ? 0 : frequency.get ();
}

public int add (@Nullable
E element, int occurrences) {
    if (occurrences == 0) {
        return count (element);
    }
    checkArgument (occurrences > 0, "occurrences cannot be negative: %s", occurrences);
    Count frequency = backingMap.get (element);
    int oldCount;
    if (frequency == null) {
        oldCount = 0;
        backingMap.put (element, new Count (occurrences));
    } else {
        oldCount = frequency.get ();
        long newCount = (long) oldCount + (long) occurrences;
        checkArgument (newCount <= Integer.MAX_VALUE, "too many occurrences: %s", newCount);
        frequency.add (occurrences);
    }
    size += occurrences;
    return oldCount;
}

public int remove (@Nullable
Object element, int occurrences) {
    if (occurrences == 0) {
        return count (element);
    }
    checkArgument (occurrences > 0, "occurrences cannot be negative: %s", occurrences);
    Count frequency = backingMap.get (element);
    if (frequency == null) {
        return 0;
    }
    int oldCount = frequency.get ();
    int numberRemoved;
    if (oldCount > occurrences) {
        numberRemoved = occurrences;
    } else {
        numberRemoved = oldCount;
        backingMap.remove (element);
    }
    frequency.add (- numberRemoved);
    size -= numberRemoved;
    return oldCount;
}

public int setCount (@Nullable
E element, int count) {
    checkNonnegative (count, "count");
    Count existingCounter;
    int oldCount;
    if (count == 0) {
        existingCounter = backingMap.remove (element);
        oldCount = getAndSet (existingCounter, count);
    } else {
        existingCounter = backingMap.get (element);
        oldCount = getAndSet (existingCounter, count);
        if (existingCounter == null) {
            backingMap.put (element, new Count (count));
        }
    }
    size += (count - oldCount);
    return oldCount;
}

private static int getAndSet (@Nullable
Count i, int count) {
    if (i == null) {
        return 0;
    }
    return i.getAndSet (count);
}

