public static < T > boolean removeIf (Iterator < T > removeFrom, Predicate < ? super T > predicate) {
    checkNotNull (predicate);
    boolean modified = false;
    while (removeFrom.hasNext ()) {
        if (predicate.apply (removeFrom.next ())) {
            removeFrom.remove ();
            modified = true;
        }
    }
    return modified;
}

