private static < T > UnmodifiableIterator < List < T > > partitionImpl (final Iterator < T > iterator, final int size, final boolean pad) {
    checkNotNull (iterator);
    checkArgument (size > 0);
    return new UnmodifiableIterator < List < T > > () {
        @Override
        public boolean hasNext () {
            return iterator.hasNext ();
        }@Override
        public List < T > next () {
            if (! hasNext ()) {
                throw new NoSuchElementException ();
            }
            Object [] array = new Object [size];
            int count = 0;
            for (; count < size && iterator.hasNext (); count ++) {
                array [count] = iterator.next ();
            }
            for (int i = count;
            i < size; i ++) {
                array [i] = null;
            }
            @SuppressWarnings("unchecked")
            List < T > list = Collections.unmodifiableList ((List < T >) Arrays.asList (array));
            return (pad || count == size) ? list : list.subList (0, count);
        }}

    ;
}

public boolean hasNext () {
    return iterator.hasNext ();
}

public List < T > next () {
    if (! hasNext ()) {
        throw new NoSuchElementException ();
    }
    Object [] array = new Object [size];
    int count = 0;
    for (; count < size && iterator.hasNext (); count ++) {
        array [count] = iterator.next ();
    }
    for (int i = count;
    i < size; i ++) {
        array [i] = null;
    }
    @SuppressWarnings("unchecked")
    List < T > list = Collections.unmodifiableList ((List < T >) Arrays.asList (array));
    return (pad || count == size) ? list : list.subList (0, count);
}

public static < T > UnmodifiableIterator < T > filter (final Iterator < T > unfiltered, final Predicate < ? super T > retainIfTrue) {
    checkNotNull (unfiltered);
    checkNotNull (retainIfTrue);
    return new AbstractIterator < T > () {
        @Override
        protected T computeNext () {
            while (unfiltered.hasNext ()) {
                T element = unfiltered.next ();
                if (retainIfTrue.apply (element)) {
                    return element;
                }
            }
            return endOfData ();
        }}

    ;
}

protected T computeNext () {
    while (unfiltered.hasNext ()) {
        T element = unfiltered.next ();
        if (retainIfTrue.apply (element)) {
            return element;
        }
    }
    return endOfData ();
}

