static < T > T pollNext (Iterator < T > iterator) {
    if (iterator.hasNext ()) {
        T result = iterator.next ();
        iterator.remove ();
        return result;
    } else {
        return null;
    }
}

static void clear (Iterator < ? > iterator) {
    checkNotNull (iterator);
    while (iterator.hasNext ()) {
        iterator.next ();
        iterator.remove ();
    }
}

