public boolean intersects (Range < C > otherRange) {
    int ceilingIndex = SortedLists.binarySearch (ranges, Range.< C > lowerBoundFn (), otherRange.lowerBound, Ordering.natural (), ANY_PRESENT, NEXT_HIGHER);
    if (ceilingIndex < ranges.size () && ranges.get (ceilingIndex).isConnected (otherRange) && ! ranges.get (ceilingIndex).intersection (otherRange).isEmpty ()) {
        return true;
    }
    return ceilingIndex > 0 && ranges.get (ceilingIndex - 1).isConnected (otherRange) && ! ranges.get (ceilingIndex - 1).intersection (otherRange).isEmpty ();
}

public boolean encloses (Range < C > otherRange) {
    int index = SortedLists.binarySearch (ranges, Range.< C > lowerBoundFn (), otherRange.lowerBound, Ordering.natural (), ANY_PRESENT, NEXT_LOWER);
    return index != - 1 && ranges.get (index).encloses (otherRange);
}

public Range < C > rangeContaining (C value) {
    int index = SortedLists.binarySearch (ranges, Range.< C > lowerBoundFn (), Cut.belowValue (value), Ordering.natural (), ANY_PRESENT, NEXT_LOWER);
    if (index != - 1) {
        Range < C > range = ranges.get (index);
        return range.contains (value) ? range : null;
    }
    return null;
}

public Range < C > span () {
    if (ranges.isEmpty ()) {
        throw new NoSuchElementException ();
    }
    return Range.create (ranges.get (0).lowerBound, ranges.get (ranges.size () - 1).upperBound);
}

public boolean isEmpty () {
    return ranges.isEmpty ();
}

