private List < E > snapshot () {
    List < E > list = Lists.newArrayListWithExpectedSize (size ());
    for (Multiset.Entry < E > entry : entrySet ()) {
        E element = entry.getElement ();
        for (int i = entry.getCount ();
        i > 0; i --) {
            list.add (element);
        }
    }
    return list;
}

public int add (E element, int occurrences) {
    checkNotNull (element);
    if (occurrences == 0) {
        return count (element);
    }
    CollectPreconditions.checkPositive (occurrences, "occurences");
    while (true) {
        AtomicInteger existingCounter = Maps.safeGet (countMap, element);
        if (existingCounter == null) {
            existingCounter = countMap.putIfAbsent (element, new AtomicInteger (occurrences));
            if (existingCounter == null) {
                return 0;
            }
        }
        while (true) {
            int oldValue = existingCounter.get ();
            if (oldValue != 0) {
                try {
                    int newValue = IntMath.checkedAdd (oldValue, occurrences);
                    if (existingCounter.compareAndSet (oldValue, newValue)) {
                        return oldValue;
                    }
                } catch (ArithmeticException overflow) {
                    throw new IllegalArgumentException ("Overflow adding " + occurrences + " occurrences to a count of " + oldValue);
                }
            } else {
                AtomicInteger newCounter = new AtomicInteger (occurrences);
                if ((countMap.putIfAbsent (element, newCounter) == null) || countMap.replace (element, existingCounter, newCounter)) {
                    return 0;
                }
                break;
            }
        }
    }
}

public int remove (@Nullable
Object element, int occurrences) {
    if (occurrences == 0) {
        return count (element);
    }
    CollectPreconditions.checkPositive (occurrences, "occurences");
    AtomicInteger existingCounter = Maps.safeGet (countMap, element);
    if (existingCounter == null) {
        return 0;
    }
    while (true) {
        int oldValue = existingCounter.get ();
        if (oldValue != 0) {
            int newValue = Math.max (0, oldValue - occurrences);
            if (existingCounter.compareAndSet (oldValue, newValue)) {
                if (newValue == 0) {
                    countMap.remove (element, existingCounter);
                }
                return oldValue;
            }
        } else {
            return 0;
        }
    }
}

public boolean removeExactly (@Nullable
Object element, int occurrences) {
    if (occurrences == 0) {
        return true;
    }
    CollectPreconditions.checkPositive (occurrences, "occurences");
    AtomicInteger existingCounter = Maps.safeGet (countMap, element);
    if (existingCounter == null) {
        return false;
    }
    while (true) {
        int oldValue = existingCounter.get ();
        if (oldValue < occurrences) {
            return false;
        }
        int newValue = oldValue - occurrences;
        if (existingCounter.compareAndSet (oldValue, newValue)) {
            if (newValue == 0) {
                countMap.remove (element, existingCounter);
            }
            return true;
        }
    }
}

public int setCount (E element, int count) {
    checkNotNull (element);
    checkNonnegative (count, "count");
    while (true) {
        AtomicInteger existingCounter = Maps.safeGet (countMap, element);
        if (existingCounter == null) {
            if (count == 0) {
                return 0;
            } else {
                existingCounter = countMap.putIfAbsent (element, new AtomicInteger (count));
                if (existingCounter == null) {
                    return 0;
                }
            }
        }
        while (true) {
            int oldValue = existingCounter.get ();
            if (oldValue == 0) {
                if (count == 0) {
                    return 0;
                } else {
                    AtomicInteger newCounter = new AtomicInteger (count);
                    if ((countMap.putIfAbsent (element, newCounter) == null) || countMap.replace (element, existingCounter, newCounter)) {
                        return 0;
                    }
                }
                break;
            } else {
                if (existingCounter.compareAndSet (oldValue, count)) {
                    if (count == 0) {
                        countMap.remove (element, existingCounter);
                    }
                    return oldValue;
                }
            }
        }
    }
}

public boolean setCount (E element, int expectedOldCount, int newCount) {
    checkNotNull (element);
    checkNonnegative (expectedOldCount, "oldCount");
    checkNonnegative (newCount, "newCount");
    AtomicInteger existingCounter = Maps.safeGet (countMap, element);
    if (existingCounter == null) {
        if (expectedOldCount != 0) {
            return false;
        } else if (newCount == 0) {
            return true;
        } else {
            return countMap.putIfAbsent (element, new AtomicInteger (newCount)) == null;
        }

    }
    int oldValue = existingCounter.get ();
    if (oldValue == expectedOldCount) {
        if (oldValue == 0) {
            if (newCount == 0) {
                countMap.remove (element, existingCounter);
                return true;
            } else {
                AtomicInteger newCounter = new AtomicInteger (newCount);
                return (countMap.putIfAbsent (element, newCounter) == null) || countMap.replace (element, existingCounter, newCounter);
            }
        } else {
            if (existingCounter.compareAndSet (oldValue, newCount)) {
                if (newCount == 0) {
                    countMap.remove (element, existingCounter);
                }
                return true;
            }
        }
    }
    return false;
}

