public static < T > boolean removeIf (Iterable < T > removeFrom, Predicate < ? super T > predicate) {
    if (removeFrom instanceof RandomAccess && removeFrom instanceof List) {
        return removeIfFromRandomAccessList ((List < T >) removeFrom, checkNotNull (predicate));
    }
    return Iterators.removeIf (removeFrom.iterator (), predicate);
}

private static < T > boolean removeIfFromRandomAccessList (List < T > list, Predicate < ? super T > predicate) {
    int from = 0;
    int to = 0;
    for (; from < list.size (); from ++) {
        T element = list.get (from);
        if (! predicate.apply (element)) {
            if (from > to) {
                try {
                    list.set (to, element);
                } catch (UnsupportedOperationException e) {
                    slowRemoveIfForRemainingElements (list, predicate, to, from);
                    return true;
                } catch (IllegalArgumentException e) {
                    slowRemoveIfForRemainingElements (list, predicate, to, from);
                    return true;
                }
            }
            to ++;
        }
    }
    list.subList (to, list.size ()).clear ();
    return from != to;
}

private static < T > void slowRemoveIfForRemainingElements (List < T > list, Predicate < ? super T > predicate, int to, int from) {
    for (int n = list.size () - 1;
    n > from; n --) {
        if (predicate.apply (list.get (n))) {
            list.remove (n);
        }
    }
    for (int n = from - 1;
    n >= to; n --) {
        list.remove (n);
    }
}

static < T > T removeFirstMatching (Iterable < T > removeFrom, Predicate < ? super T > predicate) {
    checkNotNull (predicate);
    Iterator < T > iterator = removeFrom.iterator ();
    while (iterator.hasNext ()) {
        T next = iterator.next ();
        if (predicate.apply (next)) {
            iterator.remove ();
            return next;
        }
    }
    return null;
}

