public static < K, V > Multimap < K, V > filterKeys (Multimap < K, V > unfiltered, final Predicate < ? super K > keyPredicate) {
    if (unfiltered instanceof SetMultimap) {
        return filterKeys ((SetMultimap < K, V >) unfiltered, keyPredicate);
    } else if (unfiltered instanceof ListMultimap) {
        return filterKeys ((ListMultimap < K, V >) unfiltered, keyPredicate);
    } else if (unfiltered instanceof FilteredKeyMultimap) {
        FilteredKeyMultimap < K, V > prev = (FilteredKeyMultimap < K, V >) unfiltered;
        return new FilteredKeyMultimap < K, V > (prev.unfiltered, Predicates.< K > and (prev.keyPredicate, keyPredicate));
    } else if (unfiltered instanceof FilteredMultimap) {
        FilteredMultimap < K, V > prev = (FilteredMultimap < K, V >) unfiltered;
        return filterFiltered (prev, Maps.< K > keyPredicateOnEntries (keyPredicate));
    } else {
        return new FilteredKeyMultimap < K, V > (unfiltered, keyPredicate);
    }

}

public static < K, V > SetMultimap < K, V > filterKeys (SetMultimap < K, V > unfiltered, final Predicate < ? super K > keyPredicate) {
    if (unfiltered instanceof FilteredKeySetMultimap) {
        FilteredKeySetMultimap < K, V > prev = (FilteredKeySetMultimap < K, V >) unfiltered;
        return new FilteredKeySetMultimap < K, V > (prev.unfiltered (), Predicates.< K > and (prev.keyPredicate, keyPredicate));
    } else if (unfiltered instanceof FilteredSetMultimap) {
        FilteredSetMultimap < K, V > prev = (FilteredSetMultimap < K, V >) unfiltered;
        return filterFiltered (prev, Maps.< K > keyPredicateOnEntries (keyPredicate));
    } else {
        return new FilteredKeySetMultimap < K, V > (unfiltered, keyPredicate);
    }

}

public static < K, V > ListMultimap < K, V > filterKeys (ListMultimap < K, V > unfiltered, final Predicate < ? super K > keyPredicate) {
    if (unfiltered instanceof FilteredKeyListMultimap) {
        FilteredKeyListMultimap < K, V > prev = (FilteredKeyListMultimap < K, V >) unfiltered;
        return new FilteredKeyListMultimap < K, V > (prev.unfiltered (), Predicates.< K > and (prev.keyPredicate, keyPredicate));
    } else {
        return new FilteredKeyListMultimap < K, V > (unfiltered, keyPredicate);
    }
}

public static < K, V > Multimap < K, V > filterValues (Multimap < K, V > unfiltered, final Predicate < ? super V > valuePredicate) {
    return filterEntries (unfiltered, Maps.< V > valuePredicateOnEntries (valuePredicate));
}

public static < K, V > SetMultimap < K, V > filterValues (SetMultimap < K, V > unfiltered, final Predicate < ? super V > valuePredicate) {
    return filterEntries (unfiltered, Maps.< V > valuePredicateOnEntries (valuePredicate));
}

public static < K, V > Multimap < K, V > filterEntries (Multimap < K, V > unfiltered, Predicate < ? super Entry < K, V > > entryPredicate) {
    checkNotNull (entryPredicate);
    if (unfiltered instanceof SetMultimap) {
        return filterEntries ((SetMultimap < K, V >) unfiltered, entryPredicate);
    }
    return (unfiltered instanceof FilteredMultimap) ? filterFiltered ((FilteredMultimap < K, V >) unfiltered, entryPredicate) : new FilteredEntryMultimap < K, V > (checkNotNull (unfiltered), entryPredicate);
}

public static < K, V > SetMultimap < K, V > filterEntries (SetMultimap < K, V > unfiltered, Predicate < ? super Entry < K, V > > entryPredicate) {
    checkNotNull (entryPredicate);
    return (unfiltered instanceof FilteredSetMultimap) ? filterFiltered ((FilteredSetMultimap < K, V >) unfiltered, entryPredicate) : new FilteredEntrySetMultimap < K, V > (checkNotNull (unfiltered), entryPredicate);
}

private static < K, V > Multimap < K, V > filterFiltered (FilteredMultimap < K, V > multimap, Predicate < ? super Entry < K, V > > entryPredicate) {
    Predicate < Entry < K, V > > predicate = Predicates.< Entry < K, V > > and (multimap.entryPredicate (), entryPredicate);
    return new FilteredEntryMultimap < K, V > (multimap.unfiltered (), predicate);
}

private static < K, V > SetMultimap < K, V > filterFiltered (FilteredSetMultimap < K, V > multimap, Predicate < ? super Entry < K, V > > entryPredicate) {
    Predicate < Entry < K, V > > predicate = Predicates.< Entry < K, V > > and (multimap.entryPredicate (), entryPredicate);
    return new FilteredEntrySetMultimap < K, V > (multimap.unfiltered (), predicate);
}

