public Range < C > get (@Nullable
Object key) {
    if (key instanceof Cut) {
        try {
            @SuppressWarnings("unchecked")
            Cut < C > cut = (Cut < C >) key;
            if (! lowerBoundWindow.contains (cut) || cut.compareTo (restriction.lowerBound) < 0 || cut.compareTo (restriction.upperBound) >= 0) {
                return null;
            } else if (cut.equals (restriction.lowerBound)) {
                Range < C > candidate = Maps.valueOrNull (rangesByLowerBound.floorEntry (cut));
                if (candidate != null && candidate.upperBound.compareTo (restriction.lowerBound) > 0) {
                    return candidate.intersection (restriction);
                }
            } else {
                Range < C > result = rangesByLowerBound.get (cut);
                if (result != null) {
                    return result.intersection (restriction);
                }
            }

        } catch (ClassCastException e) {
            return null;
        }
    }
    return null;
}

Iterator < Entry < Cut < C >, Range < C > > > entryIterator () {
    if (restriction.isEmpty ()) {
        return Iterators.emptyIterator ();
    }
    final Iterator < Range < C > > completeRangeItr;
    if (lowerBoundWindow.upperBound.isLessThan (restriction.lowerBound)) {
        return Iterators.emptyIterator ();
    } else if (lowerBoundWindow.lowerBound.isLessThan (restriction.lowerBound)) {
        completeRangeItr = rangesByUpperBound.tailMap (restriction.lowerBound, false).values ().iterator ();
    } else {
        completeRangeItr = rangesByLowerBound.tailMap (lowerBoundWindow.lowerBound.endpoint (), lowerBoundWindow.lowerBoundType () == BoundType.CLOSED).values ().iterator ();
    }

    final Cut < Cut < C > > upperBoundOnLowerBounds = Ordering.natural ().min (lowerBoundWindow.upperBound, Cut.belowValue (restriction.upperBound));
    return new AbstractIterator < Entry < Cut < C >, Range < C > > > () {
        @Override
        protected Entry < Cut < C >, Range < C > > computeNext () {
            if (! completeRangeItr.hasNext ()) {
                return endOfData ();
            }
            Range < C > nextRange = completeRangeItr.next ();
            if (upperBoundOnLowerBounds.isLessThan (nextRange.lowerBound)) {
                return endOfData ();
            } else {
                nextRange = nextRange.intersection (restriction);
                return Maps.immutableEntry (nextRange.lowerBound, nextRange);
            }
        }}

    ;
}

protected Entry < Cut < C >, Range < C > > computeNext () {
    if (! completeRangeItr.hasNext ()) {
        return endOfData ();
    }
    Range < C > nextRange = completeRangeItr.next ();
    if (upperBoundOnLowerBounds.isLessThan (nextRange.lowerBound)) {
        return endOfData ();
    } else {
        nextRange = nextRange.intersection (restriction);
        return Maps.immutableEntry (nextRange.lowerBound, nextRange);
    }
}

Iterator < Entry < Cut < C >, Range < C > > > descendingEntryIterator () {
    if (restriction.isEmpty ()) {
        return Iterators.emptyIterator ();
    }
    Cut < Cut < C > > upperBoundOnLowerBounds = Ordering.natural ().min (lowerBoundWindow.upperBound, Cut.belowValue (restriction.upperBound));
    final Iterator < Range < C > > completeRangeItr = rangesByLowerBound.headMap (upperBoundOnLowerBounds.endpoint (), upperBoundOnLowerBounds.typeAsUpperBound () == BoundType.CLOSED).descendingMap ().values ().iterator ();
    return new AbstractIterator < Entry < Cut < C >, Range < C > > > () {
        @Override
        protected Entry < Cut < C >, Range < C > > computeNext () {
            if (! completeRangeItr.hasNext ()) {
                return endOfData ();
            }
            Range < C > nextRange = completeRangeItr.next ();
            if (restriction.lowerBound.compareTo (nextRange.upperBound) >= 0) {
                return endOfData ();
            }
            nextRange = nextRange.intersection (restriction);
            if (lowerBoundWindow.contains (nextRange.lowerBound)) {
                return Maps.immutableEntry (nextRange.lowerBound, nextRange);
            } else {
                return endOfData ();
            }
        }}

    ;
}

protected Entry < Cut < C >, Range < C > > computeNext () {
    if (! completeRangeItr.hasNext ()) {
        return endOfData ();
    }
    Range < C > nextRange = completeRangeItr.next ();
    if (restriction.lowerBound.compareTo (nextRange.upperBound) >= 0) {
        return endOfData ();
    }
    nextRange = nextRange.intersection (restriction);
    if (lowerBoundWindow.contains (nextRange.lowerBound)) {
        return Maps.immutableEntry (nextRange.lowerBound, nextRange);
    } else {
        return endOfData ();
    }
}

