        return;
    }
    Range < K > span = rangeMap.span ();
    checkArgument (subRange.encloses (span), "Cannot putAll rangeMap with span %s into a subRangeMap(%s)", span, subRange);
    TreeRangeMap.this.putAll (rangeMap);
}

