    return new PermutationCollection < E > (ImmutableList.copyOf (elements));
}

PermutationCollection (ImmutableList < E > input) {
    this.inputList = input;
}

public int size () {
    return IntMath.factorial (inputList.size ());
}

public boolean isEmpty () {
    return false;
}

public Iterator < List < E > > iterator () {
    return new PermutationIterator < E > (inputList);
}

public boolean contains (@Nullable
Object obj) {
    if (obj instanceof List) {
        List < ? > list = (List < ? >) obj;
        return isPermutation (inputList, list);
    }
    return false;
}

public String toString () {
    return "permutations(" + inputList + ")";
}

PermutationIterator (List < E > list) {
    this.list = new ArrayList < E > (list);
    int n = list.size ();
    c = new int [n];
    o = new int [n];
    Arrays.fill (c, 0);
    Arrays.fill (o, 1);
    j = Integer.MAX_VALUE;
}

protected List < E > computeNext () {
    if (j <= 0) {
        return endOfData ();
    }
    ImmutableList < E > next = ImmutableList.copyOf (list);
    calculateNextPermutation ();
    return next;
}

void calculateNextPermutation () {
    j = list.size () - 1;
    int s = 0;
    if (j == - 1) {
        return;
    }
    while (true) {
        int q = c [j] + o [j];
        if (q < 0) {
            switchDirection ();
            continue;
        }
        if (q == j + 1) {
            if (j == 0) {
                break;
            }
            s ++;
            switchDirection ();
            continue;
        }
        Collections.swap (list, j - c [j] + s, j - q + s);
        c [j] = q;
        break;
    }
}

void switchDirection () {
    o [j] = - o [j];
    j --;
}

private static boolean isPermutation (List < ? > first, List < ? > second) {
    if (first.size () != second.size ()) {
        return false;
    }
    Multiset < ? > firstMultiset = HashMultiset.create (first);
    Multiset < ? > secondMultiset = HashMultiset.create (second);
    return firstMultiset.equals (secondMultiset);
}

private static boolean isPositiveInt (long n) {
    return n >= 0 && n <= Integer.MAX_VALUE;
}

private EvictingQueue (int maxSize) {
    checkArgument (maxSize >= 0, "maxSize (%s) must >= 0", maxSize);
    this.delegate = new ArrayDeque < E > (maxSize);
    this.maxSize = maxSize;
}

