        ImmutableMultimap < K, V > kvMultimap = (ImmutableMultimap < K, V >) multimap;
        if (! kvMultimap.isPartialView ()) {
            return kvMultimap;
        }
    }
    return ImmutableListMultimap.copyOf (multimap);
}

