static int hashCodeImpl (List < ? > list) {
    int hashCode = 1;
    for (Object o : list) {
        hashCode = 31 * hashCode + (o == null ? 0 : o.hashCode ());
        hashCode = ~ ~ hashCode;
    }
    return hashCode;
}

static boolean equalsImpl (List < ? > thisList,@Nullable
Object other) {
    if (other == checkNotNull (thisList)) {
        return true;
    }
    if (! (other instanceof List)) {
        return false;
    }
    List < ? > otherList = (List < ? >) other;
    int size = thisList.size ();
    if (size != otherList.size ()) {
        return false;
    }
    if (thisList instanceof RandomAccess && otherList instanceof RandomAccess) {
        for (int i = 0;
        i < size; i ++) {
            if (! Objects.equal (thisList.get (i), otherList.get (i))) {
                return false;
            }
        }
        return true;
    } else {
        return Iterators.elementsEqual (thisList.iterator (), otherList.iterator ());
    }
}

static < E > boolean addAllImpl (List < E > list, int index, Iterable < ? extends E > elements) {
    boolean changed = false;
    ListIterator < E > listIterator = list.listIterator (index);
    for (E e : elements) {
        listIterator.add (e);
        changed = true;
    }
    return changed;
}

static int indexOfImpl (List < ? > list,@Nullable
Object element) {
    if (list instanceof RandomAccess) {
        return indexOfRandomAccess (list, element);
    } else {
        ListIterator < ? > listIterator = list.listIterator ();
        while (listIterator.hasNext ()) {
            if (Objects.equal (element, listIterator.next ())) {
                return listIterator.previousIndex ();
            }
        }
        return - 1;
    }
}

private static int indexOfRandomAccess (List < ? > list,@Nullable
Object element) {
    int size = list.size ();
    if (element == null) {
        for (int i = 0;
        i < size; i ++) {
            if (list.get (i) == null) {
                return i;
            }
        }
    } else {
        for (int i = 0;
        i < size; i ++) {
            if (element.equals (list.get (i))) {
                return i;
            }
        }
    }
    return - 1;
}

static int lastIndexOfImpl (List < ? > list,@Nullable
Object element) {
    if (list instanceof RandomAccess) {
        return lastIndexOfRandomAccess (list, element);
    } else {
        ListIterator < ? > listIterator = list.listIterator (list.size ());
        while (listIterator.hasPrevious ()) {
            if (Objects.equal (element, listIterator.previous ())) {
                return listIterator.nextIndex ();
            }
        }
        return - 1;
    }
}

private static int lastIndexOfRandomAccess (List < ? > list,@Nullable
Object element) {
    if (element == null) {
        for (int i = list.size () - 1;
        i >= 0; i --) {
            if (list.get (i) == null) {
                return i;
            }
        }
    } else {
        for (int i = list.size () - 1;
        i >= 0; i --) {
            if (element.equals (list.get (i))) {
                return i;
            }
        }
    }
    return - 1;
}

