RegularContiguousSet (Range < C > range, DiscreteDomain < C > domain) {
    super (domain);
    this.range = range;
}

private ContiguousSet < C > intersectionInCurrentDomain (Range < C > other) {
    return (range.isConnected (other)) ? ContiguousSet.create (range.intersection (other), domain) : new EmptyContiguousSet < C > (domain);
}

ContiguousSet < C > headSetImpl (C toElement, boolean inclusive) {
    return intersectionInCurrentDomain (Range.upTo (toElement, BoundType.forBoolean (inclusive)));
}

ContiguousSet < C > subSetImpl (C fromElement, boolean fromInclusive, C toElement, boolean toInclusive) {
    if (fromElement.compareTo (toElement) == 0 && ! fromInclusive && ! toInclusive) {
        return new EmptyContiguousSet < C > (domain);
    }
    return intersectionInCurrentDomain (Range.range (fromElement, BoundType.forBoolean (fromInclusive), toElement, BoundType.forBoolean (toInclusive)));
}

ContiguousSet < C > tailSetImpl (C fromElement, boolean inclusive) {
    return intersectionInCurrentDomain (Range.downTo (fromElement, BoundType.forBoolean (inclusive)));
}

int indexOf (Object target) {
    return contains (target) ? (int) domain.distance (first (), (C) target) : - 1;
}

public UnmodifiableIterator < C > iterator () {
    return new AbstractSequentialIterator < C > (first ()) {
        final C last = last ();
        @Override
        protected C computeNext (C previous) {
            return equalsOrThrow (previous, last) ? null : domain.next (previous);
        }}

    ;
}

protected C computeNext (C previous) {
    return equalsOrThrow (previous, last) ? null : domain.next (previous);
}

public UnmodifiableIterator < C > descendingIterator () {
    return new AbstractSequentialIterator < C > (last ()) {
        final C first = first ();
        @Override
        protected C computeNext (C previous) {
            return equalsOrThrow (previous, first) ? null : domain.previous (previous);
        }}

    ;
}

protected C computeNext (C previous) {
    return equalsOrThrow (previous, first) ? null : domain.previous (previous);
}

private static boolean equalsOrThrow (Comparable < ? > left,@Nullable
Comparable < ? > right) {
    return right != null && Range.compareOrThrow (left, right) == 0;
}

