public ImmutableSortedMap < K, V > build () {
    switch (size) {
        case 0 :
            return emptyMap (comparator);
        case 1 :
            return of (comparator, entries [0].getKey (), entries [0].getValue ());
        default :
            return fromEntries (comparator, false, entries, size);
    }
}

