    while (true) {
        InternalEntry < E, Dummy, ? > entry = map.getEntry (sample);
        if (entry != null) {
            E canonical = entry.getKey ();
            if (canonical != null) {
                return canonical;
            }
        }
        Dummy sneaky = map.putIfAbsent (sample, Dummy.VALUE);
        if (sneaky == null) {
            return sample;
        } else {
        }
    }
}

