    return elements.size ();
}

public boolean contains (@Nullable
Object o) {
    try {
        return o != null && unsafeBinarySearch (o) >= 0;
    } catch (ClassCastException e) {
        return false;
    }
}

public boolean containsAll (Collection < ? > targets) {
    if (targets instanceof Multiset) {
        targets = ((Multiset < ? >) targets).elementSet ();
    }
    if (! SortedIterables.hasSameComparator (comparator (), targets) || (targets.size () <= 1)) {
        return super.containsAll (targets);
    }
    PeekingIterator < E > thisIterator = Iterators.peekingIterator (iterator ());
    Iterator < ? > thatIterator = targets.iterator ();
    Object target = thatIterator.next ();
    try {
        while (thisIterator.hasNext ()) {
            int cmp = unsafeCompare (thisIterator.peek (), target);
            if (cmp < 0) {
                thisIterator.next ();
            } else if (cmp == 0) {
                if (! thatIterator.hasNext ()) {
                    return true;
                }
                target = thatIterator.next ();
            } else if (cmp > 0) {
                return false;
            }

        }
    } catch (NullPointerException e) {
        return false;
    } catch (ClassCastException e) {
        return false;
    }
    return false;
}

private int unsafeBinarySearch (Object key) throws ClassCastException {
    return Collections.binarySearch (elements, key, unsafeComparator ());
}

boolean isPartialView () {
    return elements.isPartialView ();
}

int copyIntoArray (Object [] dst, int offset) {
    return elements.copyIntoArray (dst, offset);
}

public boolean equals (@Nullable
Object object) {
    if (object == this) {
        return true;
    }
    if (! (object instanceof Set)) {
        return false;
    }
    Set < ? > that = (Set < ? >) object;
    if (size () != that.size ()) {
        return false;
    } else if (isEmpty ()) {
        return true;
    }

    if (SortedIterables.hasSameComparator (comparator, that)) {
        Iterator < ? > otherIterator = that.iterator ();
        try {
            Iterator < E > iterator = iterator ();
            while (iterator.hasNext ()) {
                Object element = iterator.next ();
                Object otherElement = otherIterator.next ();
                if (otherElement == null || unsafeCompare (element, otherElement) != 0) {
                    return false;
                }
            }
            return true;
        } catch (ClassCastException e) {
            return false;
        } catch (NoSuchElementException e) {
            return false;
        }
    }
    return containsAll (that);
}

public E first () {
    if (isEmpty ()) {
        throw new NoSuchElementException ();
    }
    return elements.get (0);
}

public E last () {
    if (isEmpty ()) {
        throw new NoSuchElementException ();
    }
    return elements.get (size () - 1);
}

public E lower (E element) {
    int index = headIndex (element, false) - 1;
    return (index == - 1) ? null : elements.get (index);
}

public E floor (E element) {
    int index = headIndex (element, true) - 1;
    return (index == - 1) ? null : elements.get (index);
}

public E ceiling (E element) {
    int index = tailIndex (element, true);
    return (index == size ()) ? null : elements.get (index);
}

public E higher (E element) {
    int index = tailIndex (element, false);
    return (index == size ()) ? null : elements.get (index);
}

ImmutableSortedSet < E > headSetImpl (E toElement, boolean inclusive) {
    return getSubSet (0, headIndex (toElement, inclusive));
}

int headIndex (E toElement, boolean inclusive) {
    return SortedLists.binarySearch (elements, checkNotNull (toElement), comparator (), inclusive ? FIRST_AFTER : FIRST_PRESENT, NEXT_HIGHER);
}

ImmutableSortedSet < E > subSetImpl (E fromElement, boolean fromInclusive, E toElement, boolean toInclusive) {
    return tailSetImpl (fromElement, fromInclusive).headSetImpl (toElement, toInclusive);
}

ImmutableSortedSet < E > tailSetImpl (E fromElement, boolean inclusive) {
    return getSubSet (tailIndex (fromElement, inclusive), size ());
}

int tailIndex (E fromElement, boolean inclusive) {
    return SortedLists.binarySearch (elements, checkNotNull (fromElement), comparator (), inclusive ? FIRST_PRESENT : FIRST_AFTER, NEXT_HIGHER);
}

