    return (Comparator < Object >) comparator;
}

RegularImmutableSortedSet < E > getSubSet (int newFromIndex, int newToIndex) {
    if (newFromIndex == 0 && newToIndex == size ()) {
        return this;
    } else if (newFromIndex < newToIndex) {
        return new RegularImmutableSortedSet < E > (elements.subList (newFromIndex, newToIndex), comparator);
    } else {
        return emptySet (comparator);
    }

}

int indexOf (@Nullable
Object target) {
    if (target == null) {
        return - 1;
    }
    int position;
    try {
        position = SortedLists.binarySearch (elements, target, unsafeComparator (), ANY_PRESENT, INVERTED_INSERTION_INDEX);
    } catch (ClassCastException e) {
        return - 1;
    }
    return (position >= 0) ? position : - 1;
}

