public static < E > ImmutableSet < E > of (E e1, E e2, E e3, E e4, E e5, E e6, E...others) {
    final int paramCount = 6;
    Object [] elements = new Object [paramCount + others.length];
    elements [0] = e1;
    elements [1] = e2;
    elements [2] = e3;
    elements [3] = e4;
    elements [4] = e5;
    elements [5] = e6;
    System.arraycopy (others, 0, elements, paramCount, others.length);
    return construct (elements.length, elements);
}

private static < E > ImmutableSet < E > construct (int n, Object...elements) {
    switch (n) {
        case 0 :
            return of ();
        case 1 :
            @SuppressWarnings("unchecked")
            E elem = (E) elements [0];
            return of (elem);
        default :
    }
    int tableSize = chooseTableSize (n);
    Object [] table = new Object [tableSize];
    int mask = tableSize - 1;
    int hashCode = 0;
    int uniques = 0;
    for (int i = 0;
    i < n; i ++) {
        Object element = checkElementNotNull (elements [i], i);
        int hash = element.hashCode ();
        for (int j = Hashing.smear (hash);
        ; j ++) {
            int index = j & mask;
            Object value = table [index];
            if (value == null) {
                elements [uniques ++] = element;
                table [index] = element;
                hashCode += hash;
                break;
            } else if (value.equals (element)) {
                break;
            }

        }
    }
    Arrays.fill (elements, uniques, n, null);
    if (uniques == 1) {
        @SuppressWarnings("unchecked")
        E element = (E) elements [0];
        return new SingletonImmutableSet < E > (element, hashCode);
    } else if (tableSize != chooseTableSize (uniques)) {
        return construct (uniques, elements);
    } else {
        Object [] uniqueElements = (uniques < elements.length) ? ObjectArrays.arraysCopyOf (elements, uniques) : elements;
        return new RegularImmutableSet < E > (uniqueElements, hashCode, table, mask);
    }

}

static int chooseTableSize (int setSize) {
    if (setSize < CUTOFF) {
        int tableSize = Integer.highestOneBit (setSize - 1) << 1;
        while (tableSize * DESIRED_LOAD_FACTOR < setSize) {
            tableSize <<= 1;
        }
        return tableSize;
    }
    checkArgument (setSize < MAX_TABLE_SIZE, "collection too large");
    return MAX_TABLE_SIZE;
}

public static < E > ImmutableSet < E > copyOf (Collection < ? extends E > elements) {
    if (elements instanceof ImmutableSet && ! (elements instanceof ImmutableSortedSet)) {
        @SuppressWarnings("unchecked")
        ImmutableSet < E > set = (ImmutableSet < E >) elements;
        if (! set.isPartialView ()) {
            return set;
        }
    } else if (elements instanceof EnumSet) {
        return copyOfEnumSet ((EnumSet) elements);
    }

    Object [] array = elements.toArray ();
    return construct (array.length, array);
}

