public boolean isOrdered (Iterable < ? extends T > iterable) {
    Iterator < ? extends T > it = iterable.iterator ();
    if (it.hasNext ()) {
        T prev = it.next ();
        while (it.hasNext ()) {
            T next = it.next ();
            if (compare (prev, next) > 0) {
                return false;
            }
            prev = next;
        }
    }
    return true;
}

public boolean isStrictlyOrdered (Iterable < ? extends T > iterable) {
    Iterator < ? extends T > it = iterable.iterator ();
    if (it.hasNext ()) {
        T prev = it.next ();
        while (it.hasNext ()) {
            T next = it.next ();
            if (compare (prev, next) >= 0) {
                return false;
            }
            prev = next;
        }
    }
    return true;
}

